(10347, 'tr-tr', 810, 1, '9786050955842', '11902018', 'Binnaz Abla ile Kahve Falı - Binnaz Gündoğan', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 260<br>En / Boy: 13,80 / 17,80 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Kasım 2018<br><br>Kitabın Özeti: Türk kahvesini diğer kahvelerden ayıran önemli bir özelliği var: Fal. Bu gelenek yaşadığımız toprakların insanlarını birleştiren özelliklerinden biri aynı zamanda. Üstelik tüm dünya tarafından kabul edilen bir gelenek. İspatı ise UNESCO’nun Türk kahvesi kültürü ve geleneğini “UNESCO İnsanlığın Somut Olmayan Kültürel Mirasının Temsili Listesi”ne alması. Bu kitapta bir ailenin yüzyıllar süren Türk kahvesi ve fal macerasını okuyacaksınız. En lezzetli kahve için kavurmasından öğütmesine saklamasından pişirmesine hatta sunumuna kadar tüm detayları öğrenecek, bu coğrafyanın kahvelerini tanıyacak ve bir kahvenin doğru miktarda tüketildiğinde insan bedenine ne kadar yararlı olabileceğini öğreneceksiniz. Bu kitapla birlikte 100 kahve falı örneğine de sahip olacaksınız. Eğer o gün yanınızda falınıza bakacak kimse yoksa ya da arkadaşlarınızla bir araya geldiğinizde “Falımıza keşke Binnaz Abla baksa” diyorsanız bu falları kullanabilirsiniz. Kahvenizi kapatırken, “Kahve pir, kalbime gir, kalbimdekini bil” deyip bir sayfa açın ve unutmayın, gönlünde güzel niyetler yatan kişiye, güzel yollar açılır.', 0, '9786050955842', 1869, 9.9, 2),
