(10351, 'tr-tr', 810, 1, '9789750740060', '11938554', 'Saf Bir Yürek - Gustave Flaubert', 'Kitabın Özellikleri: <br>Basım Dili: Türkçe<br>Orijinal Dil: Fransızca<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 56<br>En / Boy: 12,50 / 19,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Aralık 2019<br><br>Kitabın Özeti: Fransız edebiyatında gerçekçiliğin öncüsü sayılan Gustave Flaubert, birçoklarınca başyapıt kabul edilen öyküsü Saf Bir Yürek’te, biricik aşkı Théodore askere alınmamak için hali vakti yerinde bir kadınla evlenince, çalıştığı çiftlikten ayrılıp başka bir kentte yaşayan dul bir kadının hizmetçisi olan Félicité\'nin öyküsünü anlatır. Karşılıksız veren, karşılıksız seven bu talihsiz kızın hikâyesi eşliğinde ruhsal bir yolculuğa çıkarır okuru. Flaubert’in tüm yazınsal ustalığını sergileyen bu eşsiz öyküyü Samih Rifat’ın çevirisiyle sunuyoruz.', 0, '9789750740060', 1869, 8.5, 2),
(10352, 'tr-tr', 810, 1, '9789750740091', '11938555', 'Polikuşka - Lev Nikolayeviç Tolstoy', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Orijinal Dil: Rusça<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 88<br>En / Boy: 12,50 / 19,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Eylül 2019<br><br>Kitabın Özeti: Gerçek bir olaydan esinlenen bu uzun öykü toprak kölesi Polikuşka’nın hikâyesini anlatır. Köyde sahtekârlıklarıyla tanınan Polikuşka’ya bir şans daha vermek isteyen toprak ağası hanımı, kasabaya ulaştırılmak üzere ona yüklü bir miktarda para emanet eder. Bütün bir köyün hayatını derinden sarsacak olayların fitili böylece ateşlenmiş olur. Savaş ve Barış, Anna Karenina gibi başyapıtlarıyla tanıdığımız Tolstoy’un, toprak kölelerinin hayatına ışık tuttuğu, derin psikolojik ve ahlaki analizler içeren bu öykü, türün en parlak örneklerinden biri.', 0, '9789750740091', 1869, 8.5, 2),
