(10355, 'tr-tr', 261, 1, '9786057583079', '12028053', 'Düşman Okullar 3-Son Ders - Dilara Keskin', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 416<br>En / Boy: 13,50 / 21,00 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Mayıs 2019<br><br>Kitabın Özeti: Kader, halkaları birbirine geçirilen şans zincirinden ibarettir kimine göre. Kimine göreyse, sonu belli olmayan ve gidişatın değişmesinde rol alamayacağımız bir film... Defne tüm bu tanımları yıkıp kendi kaderini çizmeye karar verir. Bu süreçte dostlarının onu yalnız bırakmaya hiç niyeti yoktur. Hal böyle olunca, yeni bir maceradan ne kadar kaçılabilir ki? Düşman Okullar, büyük bir aşk ve dostluğa tanıklık etmeniz için son kez kapınızı çalıyor.', 0, '9786057583079', 1869, 45, 2),
(10356, 'tr-tr', 261, 1, '9786052064498', '12028058', 'Nar - Emre Gül', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye<br>Sayfa Sayısı: 384<br>En / Boy: 13,50 / 21,00 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Mart 2018<br><br>Kitabın Özeti: Hep yıldız kayarken dilek tutulurdu değil mi? Onlar saatlerce bir yıldızın kaymasını bekleyip o kaydıktan sonra tutmuşlardı dileklerini; çünkü onlar için, kayan yıldız gökyüzüne ihanet etmişti. Bu yüzden dileklerini ona değil, gökyüzünden vazgeçmeyen tüm yıldızlara sunmuşlardı. Sırf âşık olduğu adama ulaşmak uğruna saçlarına kıyan Rapunzel’in masalını dinlediğinden beri, masal gibi bir dostluğun, masallardaki aşklardan daha değerli olduğuna inanan Çınar Duman’ın, dört yıldır aynı evi paylaştığı bal kızı Balın İmge ile olan dostluğu bir yaz tatili projesiyle bir şehirden diğerine uzanacaktır. Proje için seçilen diğer altı öğrenciden kimisi bu ikiliyle samimi dostluklar içerisine girer, kimisi de gizli kimlikler ardında çeşitli oyunlar düzenlemekten geri kalmaz.', 0, '9786052064498', 1869, 45, 2),
