(10359, 'tr-tr', 810, 1, '9786050966473', '12036035', 'Yarınsız - Harun Candan', 'Kitabın Özeti: Deniz Yelkencioğlu, bir taşra kasabasının kütüphanesinde duvara asılı deniz feneri resmine bakıp bakıp hayaller kurardı. Masum düşleri aşk için cinayet işlediğini sandığında parçalandı. Artık farklı kimliklerle farklı deneyimlere yelken açacak, otoyollarda, uzak çiftliklerde, herkesin unuttuğu kentlerde kurduğu yeni yaşantılar suçlu bir kaçışla sonlanacaktı. Geçmişi ve kasabanın tozlu sureti unutulmaya yüz tutmuştu yavaş yavaş. Yarınsızdı. Ta ki Deniz’ini buluncaya kadar…Her deneyimin kapısı, dünyanın bir ucunda büyülü bir deniz fenerinin bekçilik yaptığı kıyılara açılıyordu belki de. Yaşamı, dünü, bugünü, yarını var eden aşkın kıyılarına…', 0, '9786050966473', 1869, 28, 2),
