(10369, 'tr-tr', 589, 1, '9786058032118', '12047433', 'Annemin Saklı Defteri Büşra Küçük', 'Kitabın Özellikleri:<br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 260<br>En / Boy: 13,50 / 21,00 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ekim 2019<br><br>Kitabın Özeti: Satürn, Güneş, Mars, Venüs… Anahtarlıklar, kolyeler, boş evler, tamamlanmamış besteler… Tek bir defter, çözülecek bir sürü gizem… Roman Melnik annesinin ölümünün ardından, dayısıyla yaşamak üzere Rusya’dan Türkiye’ye gelir. Dayısının evinde onu bekleyen yeni bir hayatın yanı sıra annesinin gençlik yıllarından kalma bir defterdir. Hayallerle kırgınlıklarla ve küçük mutluluklarla dolu bir defter. Ve tabii bir sürü şifreyle ve gizemle de.', 0, '9786058032118', 1869, 35, 2),
