(10371, 'tr-tr', 394, 1, '9786052957936', '12045108', 'Yahuda İskariot - Leonid Andreyev', 'Kitabın Özellikleri:<br> Basım Dili: Türkçe<br>Orijinal Dil: Rusça<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 88<br>En / Boy: 12,50 / 20,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ağustos 2019<br><br>Kitabın Özeti: Andreyev’in 1907 yılında yazdığı bu novellanın “kahramanı” adı ihanetle özdeşleşen Yahuda İskariot’tur. Yazar Kitabı Mukaddes’teki fikirlerden ziyade kişi ve durumları eserine taşımıştır. Metinde bir hilkat garibesi gibi tasvir edilen Yahuda’nın kaotik görüntüsü, karmaşık düşünce süreçlerini ve ruhunu yansıtır. Andreyev kötülük ile iyilik arasında gidip gelen hainin psikolojisine ve ihanetin gerçek nedenlerine odaklanır. Bu odaklanışta yazarın insanlık durumu üzerine düşüncelerinin izleri sürülebilir. Eserin yazıldığı dönemde akıl ve inanç arasındaki çatışma epey tanıdık bir temadır. Yahuda rasyonel gerçekliğin peşindedir. Yaşadığı kötü deneyimler yüzünden insanlığa dair düşünceleri son derece kuşkucu ve kötümserdir. Havarilerinin İsa’ya olan sevgisinden de baştan beri hep kuşku duyar ve bu sevgiyi sınamaya kalkışır. Ancak Andreyev’in çıkarcı, sinsi, yalancı ve hırsız Yahuda’sı İsa’yı çılgınca sever. Tek derdi onun dikkatini çekmek ve sevgisini kazanmaktır. Ona göre ihaneti hem insanın kötülüğünü hem de İsa’yı yalnızca kendisinin sevdiğini teyit eder.', 0, '9786052957936', 1869, 9, 2),
(10372, 'tr-tr', 405, 1, '9786057865359', '12031710', 'Aslanlı Yol Sunay Akın', 'Kitabın Özellikleri:<br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 103<br>En / Boy: 13,50 / 19,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Eylül 2019<br><br>Kitabın Özeti: Sunay Akın’dan Cumhuriyet tarihinin “ilk” aydınlarının hikâyeleri…Taksim Meydanı’nın simgesi Cumhuriyet Anıtı’nın yapımı için Roma’ya gönderilen 21 yaşında bir genç kadın Sabiha Ziya, kültür ve sanatın gelişimi için yaptıklarıyla bir döneme adını altın harflerle yazdırmış Hasan Ali Yücel’in “bir çocuk olarak” portresi, karikatürist Altan Erbulak’ın henüz çocukken Mustafa Kemal’le karşılaşma anları, Atatürk’ün kütüphanecisi Nuri Ulusu’nun çocukluğunda kendine çizdiği yol, Türkiye’nin ilk kadın tiyatrocusu Afife Jale, savaş sırasında insanlara umut veren Çalıkuşu ve çok daha fazlası Sunay Akın’ın etkileyici anlatımıyla Aslanlı Yol’da kendine yer buluyor. İşgale, adaletsizliğe, haksızlığa karşı bağımsızlığı, kardeşliği ve barışı savunan; aydınlanma tarihimizin cesur ve güzel yüreklerini, usta hikâye anlatıcısı Sunay Akın’ın kaleminden okuyacaksınız.', 0, '9786057865359', 1869, 24, 2),
