(10375, 'tr-tr', 394, 1, '9786052959145', '12022692', 'Uyanış Kate Chopin', 'Kitabın Özellikleri:<br> Basım Dili: Türkçe<br>Orijinal Dil: İngilizce<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 200<br>En / Boy: 12,50 / 20,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ocak 2020<br><br>Kitabın Özeti: New Orleans kültürünü işlediği yapıtlarıyla tanınan ve edebiyatta yerel renkleri savunan Kate Chopin’in bu romanı 1899 yılında yayımlandığında Amerikan kamuoyunu sarsmıştı. Bir kadının uyanışını, kendi ayakları üzerinde durarak bireyselliğini ilan edişini anlatan Uyanış, bazı açılardan Madam Bovary’ye benzetilir. Chopin’in kendi arzularının peşinden giden bağımsız kadın karakterine yönelik nesnel yaklaşımı zamanında tepki çekse de, romanın üslup güzelliği ve duyarlığı övgüyle karşılanmıştı.Chopin’in kadınların özgürleşmesine verdiği önem ve sonraki feminist edebiyatçılara öncülük etmesi, 20. yüzyıl sonlarında yapıtlarının, özellikle de uzun zaman önce unutulup gitmiş olan Uyanış’ın yeniden gündeme gelmesine yol açtı. Romanı yeniden ele alan bazı eleştirmenler “cesur” gerçekçiliğine vurgu yaptı. Per Seyersted’in 1969 yılında yayımlanan Kate Chopin biyografisi, yazarın yaşamına ve yapıtlarına yönelik kapsamlı bir incelemenin ürünüydü. Daha önce gün ışığına çıkarılmamış öykülerinin, mektuplarının ve günlüklerinin keşfi, o güne kadar bilinenden farklı, çok daha azimli ve meselesi olan bir yazar portresi ortaya koydu. Kate Chopin böylece 19. yüzyıl Amerikan edebiyatının önemli yazarları arasında hak ettiği yeri almış oldu.', 0, '9786052959145', 1869, 14, 2),
