(10377, 'tr-tr', 394, 1, '9786052958902', '12022694', 'Peter Pan', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Orijinal Dil: İngilizce<br>Basım Yeri: Türkiye<br>Sayfa Sayısı: 192<br>En / Boy: 12,50 / 20,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ocak 2020<br><br>Kitabın Özeti: 1904 yılında Londra’da tiyatro sahnelerinde doğan Peter Pan, daha sonra 1911’de Peter Pan’in yayımlanmasıyla birlikte kitap sayfalarına ve ardından beyaz perdeye taşındı. Okurlarını Londra sokaklarından alıp Hiçbiryer’e götüren J. M. Barrie’nin kahramanı, ebedi bir gençlikle özdeşleştirilir. Büyümek istemeyen bu oğlan çocuğu, küçük okurları için özgürlüğü simgelerken yetişkin okurları için masumiyeti ve çocukluğa olan özlemi yansıtır. Yazar J. M. Barrie, bu dünyayı yaratırken hem Stevenson’ın Define Adası kitabındaki karakter ve olaylardan hem de mitolojiden faydalanmıştır. Nitekim Peter Pan karakteri tanrıların dünyası ile insanların dünyası arasında özgürce seyahat edebilen haberci tanrı Hermes ile Hermes’in oğlu ve kırların koruyucu tanrısı olan keçi ayaklı Pan gibi pek çok mitolojik figürden izler taşır. Peter Pan’in bitmeyen çocukluğunu, arkadaşlarının ve düşmanlarının başından geçenleri anlatan bu masal, ona inananlar olduğu müddetçe yaşamaya devam edecektir.', 0, '9786052958902', 1869, 12, 2),
(10378, 'tr-tr', 394, 1, '9786052958889', '12022695', 'Dünyalar Savaşı H.G.Wells', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Orijinal Dil: İngilizce<br>Basım Yeri: Türkiye<br>Sayfa Sayısı: 264<br>En / Boy: 12,50 / 20,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ocak 2020<br><br>Kitabın Özeti: Dünyalar Savaşı’nın Pearson’s Magazine’de tefrika edildiği 1897 yılında, Kraliçe Victoria’nın tahta çıkışının altmışıncı yılı törenlerle kutlanmıştı. Büyük Britanya İmparatorluğu, Kanada’dan Yeni Zelanda’ya uzanan, Afrika’nın büyük bir kısmıyla Hint yarımadasının tamamını kapsayan geniş topraklarıyla gücünün doruğundaydı. Dünyalar Savaşı, Wells’in İngiliz emperyalizmi üzerine bir yorumu; 20. yüzyıl başında imparatorluğun genişlemesinin muhtemel sonuçlarına ilişkin kaygıları yansıtan felsefi ve ideolojik öyküsüdür. Mars’tan gelip tuhaf araçlarıyla imparatorluk topraklarında gezinen, yollarına çıkan her şeyi ölümcül ısı ışınlarıyla yerle bir ederken tüm yaşamı da sona erdiren yaratıkların istilası, belki de Victoria dönemi okurunun bu kaygılarına denk düşmüştü. Orson Welles’in 1938’de romandan uyarladığı bir radyo oyununu gerçek sanan dinleyicilerin panik içinde sokağa dökülmesi, yapıtın imgelemi tetikleme gücünü ortaya koydu. Çeşitli film ve dizi versiyonları yapılan Dünyalar Savaşı birçoğuna da esin verdi. Wells’in capcanlı imgelemiyle özgün ve gerçekçi anlatımı, uzay yolculuğu ve başka gezegenlerden dünyamıza yönelik istilalar konusuna artık hiç de yabancı olmadığımız bugün de her kuşaktan okuru cezbetmeye devam ediyor.', 0, '9786052958889', 1869, 16, 2),
