(10387, 'tr-tr', 218, 1, '9786050911022', '10062078', 'Okula Hazırım-Basit Sözcükler Öğreniyorum', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Orijinal Dil: İngilizce<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 32<br>En / Boy: 21,00 / 28,00 cm<br>Kağıt Cinsi: 1. Hamur<br>Basım Tarihi: Mayıs 2014<br>Yaş Grubu: 6 - 7<br><br>Kitabın Özeti: On iki kitaptan oluşan Okula Hazırım dizisi, çocukların okuma, yazma ve matematik becerilerini geliştirmeye yardımcı olacak. Türkçe ve matematik olarak iki ayrı kategoriden oluşan Okula Hazırım kitapları, deneyimli öğretmenlerin katkılarıyla yeni müfredata uyumlu olarak hazırlandı. 66 aylık öğrencilerin de okula başlamasıyla birlikte önemi artan bu zengin içerikli dizide, hem okula hazırlık hem de öğretilen müfredatın tekrar edilmesi amaçlanıyor. Toplama ve çıkarma, saatler, çarpım tablosu, işlemler, eşleştirme ve ayırt etme, basit sözcükler, okuma ve yazma gibi farklı başlıklarda toplanan kitaplar, renkli görselleri ve basit anlatımı sayesinde öğrenme sürecini eğlenceye dönüştürüyor. Aileler için öneriler içeren dizi, günlük aktivitelerin de pekiştirilmesini sağlıyor. Çalışmaları ödüllendirmek amacıyla her kitapta yer alan yıldız çıkartmaları ve rozetlerse çocukların doğru sonuca ulaşma isteğini olumlu ölçüde destekliyor. Matematik işlemlerinde pratik kazandıracak, okuma ve yazma becerilerini pekiştirecek olan Okula Hazırım dizisi, çocukların başarısında önemli bir rol oynayacak.', 0, '9786050911022', 1869, 17, 2),
