(10405, 'tr-tr', 392, 1, '9786053759867', '11966517', 'Beren İle Lüthien J.R.R. Tolkien', 'Kitabın Özellikleri:<br> Basım Dili: Türkçe<br>Orijinal Dil: İngilizce<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 281<br>En / Boy: 13,50 / 21,00 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Aralık 2019 <br><br>Kitabın Özeti: Tolkien’in yayımlanmayan metinlerinden derlenerek başlı başına bir kitap haline getirilen Beren ile Luthien’in destansı hikayesi Hobbit, Yüzüklerin Efendisi, Silmarillion ve Tolkien’in yarattığı Elfler, İnsanlar, Orklar ve Cücelerle dolu Orta Dünya hayranlarını bir kez daha bir araya getirecek. J.R.R. Tolkien’in İlk Çağ’daki destanları ve mitleri anlattığı Silmarillion’ın gelişiminde büyük bir rol oynayan Beren ile Luthien’in hikayesinin yazım sürecinde pek çok detay değişse de gölgelenen aşkları hep baki kaldı: Beren ölümlü bir İnsandı, Luthien ise ölümsüz bir Elf. Önemli bir Elf beyi olan babası, kızının Beren’le olmasına karşıydı ve eğer Luthien’le evlenmek istiyorsa Beren imkansız bir görevi yerine getirmek zorundaydı. Beren, Luthien ile birlikte kötülerin en kötüsü, Kara Düşman, Morgoth olarak da bilinen Melkor’dan en değerli mücevher Silmarili çalmaya çalışacaktı. Bu kitapta Christopher Tolkien, Beren ile Luthien’in hikayesinin ilk yazıldığı tarihten, Silmarillion’daki haline kadar geçen süreci adım adım ele alıp Orta Dünya’nın en önemli aşk hikayesine nasıl dönüştüğünü, bu evrende giderek nasıl daha büyük bir yer kapladığını gözler önüne seriyor. Bunu yaparken de babasının kelimelerine dokunmadan, orijinal hallerini koruyarak destanın hem manzum hem de mensur biçimlerini ilk kez birlikte yayımlıyor.Kitabın Özellikleri:<br> Basım Dili: Türkçe<br>Orijinal Dil: İngilizce<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 281<br>En / Boy: 13,50 / 21,00 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Aralık 2019 <br><br>Kitabın Özeti: Tolkien’in yayımlanmayan metinlerinden derlenerek başlı başına bir kitap haline getirilen Beren ile Luthien’in destansı hikayesi Hobbit, Yüzüklerin Efendisi, Silmarillion ve Tolkien’in yarattığı Elfler, İnsanlar, Orklar ve Cücelerle dolu Orta Dünya hayranlarını bir kez daha bir araya getirecek. J.R.R. Tolkien’in İlk Çağ’daki destanları ve mitleri anlattığı Silmarillion’ın gelişiminde büyük bir rol oynayan Beren ile Luthien’in hikayesinin yazım sürecinde pek çok detay değişse de gölgelenen aşkları hep baki kaldı: Beren ölümlü bir İnsandı, Luthien ise ölümsüz bir Elf. Önemli bir Elf beyi olan babası, kızının Beren’le olmasına karşıydı ve eğer Luthien’le evlenmek istiyorsa Beren imkansız bir görevi yerine getirmek zorundaydı. Beren, Luthien ile birlikte kötülerin en kötüsü, Kara Düşman, Morgoth olarak da bilinen Melkor’dan en değerli mücevher Silmarili çalmaya çalışacaktı. Bu kitapta Christopher Tolkien, Beren ile Luthien’in hikayesinin ilk yazıldığı tarihten, Silmarillion’daki haline kadar geçen süreci adım adım ele alıp Orta Dünya’nın en önemli aşk hikayesine nasıl dönüştüğünü, bu evrende giderek nasıl daha büyük bir yer kapladığını gözler önüne seriyor. Bunu yaparken de babasının kelimelerine dokunmadan, orijinal hallerini koruyarak destanın hem manzum hem de mensur biçimlerini ilk kez birlikte yayımlıyor.', 0, '9786053759867', 1869, 24, 2),
