(10411, 'tr-tr', 1, 1, '9786053417408', '11924679', 'Esrarlı Ada Jules Verne', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Orijinal Dil: Fransızca<br>Basım Yeri: Türkiye - Ankara<br>Sayfa Sayısı: 136<br>En / Boy: 13,50 / 19,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Haziran 2019<br><br>Kitabın Özeti: Amerikan iç savaşının sonlarına doğru; Kuzeyli General Ulysses Grant, güneydeki Richmond kentini kuşatmıştı. Richmond Valisi, Güneyli komutan General Lee’den yardım isteyecek askeri için bir balon hazırlatmıştı. İşte bu balon, Kuzeyli birkaç tutsağın kaçış umudu olacaktı. Kucağında köpeği ile bir mühendis, onun özgür bıraktığı uşağı, deneyimli bir gazeteci, usta bir denizci ve gemicinin arkadaşı bir genç; 18 Mart 1865 gecesi esir oldukları kamptan gizlice havalanır. Gaz kaçırmaya başlayan balonla okyanusta dalgalarla boğuşulan zorlu yolculuktan sonra hiç bilmedikleri bir adaya ulaşan kaçaklar, adayı kendileri için yaşanabilir hâle getirebilmek için çaba gösterirler; bir yandan çetin doğa koşullarıyla, hastalıkla mücadele ederken karşılarına rotasını şaşıran korsanlarla da savaşmak zorunda kalır. Edebiyatta bilimkurgunun öncülerinden, Jules Verne (1828-1905), ünlü romanlarından Esrarlı Ada’da, okuru eski bir tanıdıkla da buluşturuyor.', 0, '9786053417408', 1869, 6.9, 2),
