(10413, 'tr-tr', 394, 1, '9789944880985', '10672935', 'Karamazov Kardeşler Fyodor Mihayloviç Dostoyevski', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Orijinal Dil: Rusça<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 1025<br>En / Boy: 12,50 / 20,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ocak 2020<br><br>Kitabın Özeti: Fydor Mihayloviç Dostoyevski (1821-1881): İlk romanı İncancıklar 1846\'da yayımlandı.Ünlü eleştirmen V.Byelinski bu eser üzerine Dostoyevski\'den geleceğin büyük yazarı olarak söz etti.Ancak daha sonra yayımlanan öykü ve romanları,çağımızda edebiyat klasikleri arasında yer alsa da, o dönemde fazla ilgi görmedi.Yazar 1849\'da 1.Nikolay\'ın baskıcı rejimine muhalif Petraşevski grubunun üyesi olduğu gerekçesiyle tutuklandı. Kurşuna dizilmek üzereyken cezası sürgün ve zorunlu askerliğe çevrildi.Cezasını tamamlayıp Sibirya\'dan döndükten sonra Peterburg\'da Vremya dergisini çıkarmaya başladı, yazdığı romanlarla tekrar eski ününe kavuştu.Karamazov Kardeşler Dostoyevski\'nin son başyapıtıdır.', 0, '9789944880985', 1869, 30, 2),
