(10416, 'tr-tr', 382, 1, '9786057611130', '11919979', 'Pucca Günlük 7 Peki Ya Şimdi', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 216<br>En / Boy: 13,50 / 19,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Haziran 2019<br><br>Kitabın Özeti: Yaşarken Hiç Komik Değildi? <br>Senden önce ne yaşadıysam, sana tecrübe olacak. Ben yaşadığım hiçbir şeyden utanmadım. Ama seni utandırmaya çalışacaklar... Hepsini göğüsledim, kendi hayatımı savunmayı bildim. Bunu da sana göstereceğim. İnsanların ne söylediğinin öneminin olmadığını anlayacaksın. Asıl önemli olanın, o an mutlu olup olmamanla ilgili olduğunu bileceksin. İşte, tam da bu yaşam felsefesiyle kalplerimize dokunmuştu Pucca…<br>Şimdi ise o bir anne! Ama merak etmeyin, dobra diliyle bildiğini okuyan hallerinden hiçbir şey kaybetmedi. Bir de işin içine hormonlar girince, Pucca’nın içine düştüğü durumlar hiç olmadığı kadar komik bir hal aldı! <br><br>Blogger’ların kraliçesi Pucca, heyecanla beklediğiniz, bir solukta okuyacağınız yedinci günlüğü Peki Ya Şimdi? ile karşınızda!', 0, '9786057611130', 1869, 27, 2),
(10417, 'tr-tr', 810, 1, '9786050963557', '11919708', 'Sadece Şeyma Şeyma Subaşı', 'Kitabın Özellikleri: <br>Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 176<br>En / Boy: 13,50 / 21,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Haziran 2019 <br><br>Kitabın Özeti: Hatırladığım ilk anı neydi? <br>Annemle babamın bana sıkıca sarıldığı aklıma geliyor. <br>Hepimizin güldüğünü hatırlıyorum sonra. Ve anneannemin masallarını. <br>İlk anılarımı bulutlar üzerindeymişim gibi hatırlıyorum, sonrası fırtına... hepinizin bildiği gibi... ve şimdi yine pembe bulutlar... hepimizin yaşadığı gibi... <br>Ben de bir annenin gözünün nuru, bir babanın altın saçlı kızıyım. Ve küçük bir kız çocuğunun, kucağında uyumayı çok sevdiği annesiyim. <br><br>Bunları unutmadan okuyun isterim hayatımı...', 0, '9786050963557', 1869, 23.9, 2),
