(10445, 'tr-tr', 810, 1, '9789750738814', '11894538', 'Sürüklenme Latife Tekin', 'Kitabın Özellikleri:<br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 192<br>En / Boy: 12,50 / 19,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Mart 2019<br><br>Kitabın Özeti: Yüzümüze ölümün gölgesi düştüğünde hayat ısrarla yaşama şansı tanımak istiyor bize, türlü biçimlerde uyarıp tekrar tekrar sınıyor bunun için. Sürüklenme’nin isimsiz anlatıcısı görünüşte sivil toplum örgütü gibi işleyen bir oluşumun destekçisidir. Bir yolculuk dönüşü, önce uçakta karşılaştığı tekinsiz bir kişinin, sonra bir kâhini andıran karizmatik taksicinin, hatta gökyüzü ve yeryüzündeki tarifsiz güçlerin tesiri altında sürüklenip durur. Örgüte kaynak temin etmek için Türkiye’deki büyük şirketlerin yuttuğu beldelerde ve Rusya\'dan İngiltere\'ye, Yunanistan\'dan Almanya\'ya yolculuk eden anlatıcı, bir taraftan örgütün kuruluş amacı konusunda, lideriyle derin bir hesaplaşma içine girer. Öte yandan da kimsesiz, ayrıksı ve ele gelmez gençlere sahip çıkarak kendi hayatına anlam vermeye, yaşadığı derin hüsranı ve zamanımıza has yersiz yurtsuzluk hissini, sevgi açlığını tedavi etmeye çalışmaktadır. Latife Tekin, Manves City’yle aynı anda yayımladığı Sürüklenme’de Türkiye’nin bu acımasız ve hoyrat günlerine ayna tutuyor. Manves City’yle birbirine el uzatan Sürüklenme, süregelen toptan yıkıma karşı yeni mücadele yollarının, çaresiz yetişkinlerin, sahipsiz, yoksul, yalnızlaştırılmış gençliğin ve onların yeni bir hayat kurma, sürüklenirken tutunma çabalarının romanı.', 0, '9789750738814', 1869, 24.5, 2),
(10446, 'tr-tr', 810, 1, '9789750738715', '11894539', 'Sevgili Arsız Ölüm Latife Tekin', '', 0, '9789750738715', 1869, 30, 2),
(10447, 'tr-tr', 810, 1, '9789750738807', '11894540', 'Manves City Latife Tekin', 'Kitabın Özellikleri: <br>Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 152<br>En / Boy: 12,50 / 19,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Mart 2019<br><br>Kitabın Özeti: Manves City, Türkiye’nin büyük şirketlere teslim olan bir beldesinde, Erice’de yaşananları gözler önüne seriyor. Yıllar sonra hapisten çıkıp memleketine dönen Ersel, dev üretim tesislerinin ve fabrikaların ele geçirdiği bir Erice’yle karşılaşır. Yuvası dağılmış olan Ersel kayıplara karışan üvey kızının peşine düşer. Bu dokunaklı yolculuğunda, yerel bir gazetede yazılarıyla halkın sesi olan çocukluk arkadaşı Nergis, ona eşlik edecektir. Sürüklenmeyle aynı anda yayımlanan Manves City, yoksullaşan insanların, yok edilen doğanın, katledilen kadınların, kirlenen derelerin, acımasız holdinglerin, günümüz Türkiye’sinin romanı. Latife Tekin, sürüklenmeyle birbirine el uzatan Manves City\'de yepyeni, duru bir dille işsizleri, yoksulları, ağaçları, çocukları; bu büyük yıkıma direnenleri yazıyor.', 0, '9789750738807', 1869, 22, 2),
