(10483, 'tr-tr', 394, 1, '9786053324249', '10672955', 'Dava - Franz Kafka', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Orijinal Dil: Almanca<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 224<br>En / Boy: 12,50 / 20,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Şubat 2020<br><br>Kitabın Özeti: Dava yazılışından bir süre sonra dünya sahnesine çıkan, yurttaşlık haklarının askıya alındığı, bir sivil itaatsizlik imasının dahi zulümle karşılandığı totaliter rejimlere dair bir öngörü ve eleştiri olarak yorumlanır çoğunlukla. Nazi Almanya’sına dair bir “önsezi” barındırdığı söylenebilir belki. Erişilmez bir otorite tarafından yöneltilen ve ne olduğu hiçbir zaman açıklanmayan bir suçlamayla karşı karşıya kalan Josef K.’nın davasında, mahkemeye dinsel ya da metafizik bir otorite de atfedilebilir. Kafka Dava’da suçu yalnızca bir eylem olarak tanımlamayıp zanlının “kötü niyeti”yle de ilişkilendiren ve suçtan çok suçluya odaklanan absürd bir hukuk sistemi paradigması inşa eder. Kuramsal olarak ortada yasadışı bir eylem olmaksızın suçu mümkün kılan bir sistemdir bu. Ancak Kafka suç, sorumluluk ve özgürlük üzerine yazarken bir sistem ya da doktrin ortaya koymaz, çözüm önermez. Okuru ister istemez içine çeken bu karanlık dünya tasavvurunun tartışmaya açık olmayan tek bir özelliği varsa, o da müphemliğidir.', 0, '9786053324249', 1869, 14, 2),
(10484, 'tr-tr', 810, 1, '9786051853635', '11819913', 'Gör Beni-İki Devrin Hikayesi - Akilah Azra Kohen', '', 0, '9786051853635', 1869, 36.11, 2),
