(10486, 'tr-tr', 394, 1, '9786053328322', '11851098', 'Franz Kafka Babaya Mektup - Franz Kafka', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Orijinal Dil: Almanca<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 72<br>En / Boy: 12,50 / 20,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ocak 2020<br><br>Kitabın Özeti: Kafka’nın babası Hermann Kafka’ya Kasım 1919’da yazdığı bu mektup, alıcısına hiçbir zaman ulaşmadı. Yazarın yapıtlarına ve esin dolu dünyasına adım atmak için mükemmel bir giriş metni olan mektup, aynı zamanda 20. yüzyıl edebiyat tarihinin büyük itiraflarından biri sayılabilir. Kafka, suçlayıcı bir tonla hafif bir ironinin birbirine karıştığı mektubunda, babası tarafından kabul görme talebini dillendirir. Aslında babasıyla arasındaki yabancılaşma ve iletişimsizliği, yapıtlarının çoğunda kendine mesele edindiği daha geniş kapsamlı varoluşsal bir açmazın parçası olarak görüyordu. Yazar evliliğe ve yetişkin bir erkek olmaya hazırlanan Georg Bendemann adlı karakterinin babası tarafından ölüme mahkûm edildiği Yargı adlı öyküsünde olduğu gibi, evlenememesinden ve yetişkin olamamasından babasını sorumlu tutuyordu. Başarılı bir iş insanı olan Hermann Kafka’nın oğluyla ilişkisinde, işlerini devam ettirecek tek erkek evladına yönelik geleneksel beklentisi belirleyici olmuştu. Bu, yeni oluşmuş ataerkil Yahudi orta sınıfının yaşadığı tipik baba-oğul çatışmasının yaygın bir örneğiydi aslında.', 0, '9786053328322', 1869, 9, 2),
(10487, 'tr-tr', 382, 1, '9786052361689', '11796242', 'Martin Eden - Jack London', '', 0, '9786052361689', 1869, 25, 2),
