(10495, 'tr-tr', 394, 1, '9789754582901', '10672925', 'Sineklerin Tanrısı - William Golding', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Orijinal Dil: İngilizce<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 262<br>En / Boy: 12,50 / 20,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ocak 2020<br><br>Kitabın Özeti: Sineklerin Tanrısı başlangıçta, ıssız bir adaya düşen çocukların serüvenlerini anlatan, küçükler için yazılmış bir öykü, R.M. Ballantyne’ın Mercan Adası’nın çağdaş bir uygulaması sanılabilir. Hatta Golding, kendine özgü buruk alaycılıkla, okuyucunun bu sanısını pekiştirmek istercesine, Sineklerin Tanrısı’nın başlıca iki kişisine Mercan Adası’ndaki çocuklardan aldığı Ralph ve Jack adlarını verir. Mercan Adası’nda Ballantyne, oldukça duygusal ve biraz da bön bir iyimserlikle, gemileri battıktan sonra Pasifik Okyanusu’nda ıssız bir adaya sığınan üç İngiliz gencinin, Büyük Britanya uygarlığının oldukça başarılı bir küçük örneğini nasıl yeniden kurduklarını anlatır.', 0, '9789754582901', 1869, 16, 2),
(10496, 'tr-tr', 394, 1, '9786053606116', '10672945', 'Satranç - Stefan Zweig', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Orijinal Dil: Almanca<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 77<br>En / Boy: 12,5 / 20,5 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ocak 2020<br><br>Kitabın Özeti: Stefan Zweig, çok geniş bir psikoloji birikimini eserlerinde bütünüyle kullanmış ender yazarlardandır. Onun dünya edebiyatında bir biyografi yazarı olarak kazandığı haklı ünün temelinde de bu özelliği, yani yazarlığının yanı sıra çok usta bir psikolog olması yatar. Satranç, Zweig’ın psikolojik birikimini bütünüyle devreye soktuğu bir öyküdür ve bu öykünün baş kişileri, tamamen yazarın biyografilerinde ele aldığı kişileri işleyiş biçimiyle sergilenmiştir. Zweig ölümünden hemen önce tamamladığı birkaç düzyazı metinden biri olan Satranç’ı kaleme aldığı sırada, karısı Lotte Zweig ile birlikte göç ettiği Brezilya’da yaşamaktaydı. Satranç’ta da, olay yeri olarak New York’dan Buenos Aires’e gitmekte olan bir yolcu gemisini seçmiştir. Bu gemide tamamen rastlantı sonucu karşılaşan üç kişi: yeni dünya satranç şampiyonu Mirko Czentovic, sıradan bir satranç oyuncusu olan anlatıcı ve bir zamanlar çok usta bir satranç oyuncusu olan, ama hayli zamandır satrançtan uzak kalmış bulunan Dr. B., öykünün aktörleridir.', 0, '9786053606116', 1869, 7, 2),
(10497, 'tr-tr', 385, 1, '9789751039514', '11757265', 'Atatürk Etkisi - Sinan Meydan', '', 0, '9789751039514', 1869, 35.19, 2),
(10498, 'tr-tr', 434, 1, '9789752430990', '11853316', 'Bir Ömür Nasıl Yaşanır? - İlber Ortaylı', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye<br>Sayfa Sayısı: 288<br>En / Boy: 13,50 / 21,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Şubat 2019<br><br> Kitabın Özeti: Daha anlamlı yaşamak için İlber Ortaylı’dan tavsiyeler…<br>“Cesur olun. Kendinizi rahat hissettiğiniz alanın dışında pencereler açın. Farklı dünyalarla ancak böyle tanışırsınız. Ben hep yerimde dursaydım, dünyamı değiştirecek insanları aramasaydım, bugün tanıdığınız ben olmazdım. Bir insanın bittiği an, miskinliğe esir olduğu andır. İnsan, konforundan vazgeçmeyi göze almalıdır. Kendi dünyasını yerinden kendisi oynatmalıdır.” <br><br>İlber Ortaylı', 0, '9789752430990', 1869, 30, 2),
