(10742, 'tr-tr', 261, 1, '9786052064153', '11444153', 'Düşman Okullar 2 - Yapboz Dilara Keskin', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 512<br>En / Boy: 13,50 / 21,00 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Kasım 2018<br><br>Kitabın Özeti: Sadece birkaç dakika içinde, hayatımız hiç beklemediğimiz bir noktaya ulaşabilir. Kısacık bir zaman dilimi, koca bir ömrü etkileyebilir. Ufacık bir an yeter tüm dengeleri bozmak için. Hiç beklemediği birinin kalbini ona açmasıyla, bu anlardan birine yakalanan Defne\'nin hayatı, tahmin edemeyeceği bir yönde ilerlemeye başlar. Mantığı, kalbinin sesini bastırmak istercesine bağırırken, Defne\'nin hayatı içinden çıkılmaz bir labirente dönüşür. Öte yandan Çağatay tarafından hayatı kurtarılan Su, Fatih\'i aklından çıkaramayan Elif, Sıla ile benzer yönleri olduğunu fark eden Bora ve İrem\'i her geçen gün biraz daha keşfeden Arda için de yaşanılanlar hiç kolay değildir. Hayatları beklemedikleri bir yönde gelişen bu insanların tek sığınağı, yüreklerindeki eksikliği bir yapbozun parçası misali dolduran dostlarıdır.', 0, '9786052064153', 1869, 45, 2),
