(10775, 'tr-tr', 514, 1, '9786054441761', '11183853', 'İngilizce Duvar Posterleri Alphabet Frieze - Kolektif', 'Alice\'s Adventures in Wonderland - Stage 3 - İngilizce Hikaye Kitap Açıklaması: <br>One hot day Alice decides to go to the riverbank. There seems to be nothing out of the ordinary. Soon Alice begins to get bored increasingly. All of a sudden, a white rabbit runs past her quickly, looking at a pocket watch. Alice follows the rabbit down the hole without thinking twice. And the next moment she finds herself in the mysterious world of Wonderland, where everything happens in the most extraordinary way. In Wonderland, every minute is a part of the great adventure. Alice changes her size, talks to fairytale beasts, takes part in the crazy tea-party, plays the weirdest croquet ever… But will she find a border between absurdity and reality? And will she ever get out of Wonderland back home again? Get ready for the most unusual adventures with Alice in Wonderland, where your heart will burn with curiosity and admiration …<br><br>Kitap Hakkında: <br>Hamur Tipi: 1. Hamur<br>Ebat: 13 x 19,5<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz<br>Dili: İngilizce', 0, '9786054441761', 1869, 16.5, 2),
(10776, 'tr-tr', 514, 1, '9786059533423', '11302644', 'The Call Of The Wild Stage 1 - Jack London', 'The Call of the Wild - Stage 1 - İngilizce Hikaye Kitap Açıklaması: <br>Buck lived a comfortable life in California at Judge Miller’s house. But, all of a sudden, he was stolen and sold to a dog trader. The Gold Rush needed strong and fast dogs. That is why Buck goes to the North and becomes a sledge dog unwillingly. He finds himself in a new life full of different dangers. He faces hard work, unbearable cold, huge hunger, and cruel enemies. Buck has to follow the law of club and fang so that to survive among dogs and men in the North. He almost forgot the notion of friendship and mercy in the hard conditions of his new life. Soon Buck’s life changes once and for all. He meets his true master whom he loves with all his heart. Buck has many adventures with his master all over the North. Is Buck’s love stronger than his old instincts? Will he follow the wild call in the forest? Or will he stay with his master? This is an amazing story about the dog’s will-power and loyal heart. <br><br>Kitap Hakkında: <br>Hamur Tipi: 1. Hamur<br>Ebat: 13 x 19,5<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786059533423', 1869, 10, 2),
(10777, 'tr-tr', 514, 1, '9786059533409', '11302645', 'Robin Hood Stage 3 - J. Walker McSpadden', 'Robin Hood - Stage 3 - İngilizce Hikaye Kitap Açıklaması: <br>Robin Hood is a well-known hero from Sherwood Forest. He robs the rich and helps the poor. He meets many loyal friends: Little John, Friar Tuck, Will Scarlet, Alan-A-Dale and so on. He forms his own merry band of skillful archers in Sherwood Forest. Robin Hood and his men fight against injustice and cruelty. Robin Hood does his best to put his enemies out of temper and to take their money right away. At the same time, he finds his true love, Maid Marian. His life is full of dangerous adventures, amazing acts of bravery, funny moments, and generous actions. This story will make you surprised at its martial spirit, real adventure and strong love. Get ready and start your adventures with Robin Hood and his merry men. <br><br>Kitap Hakkında: <br>Hamur Tipi: 1. Hamur<br>Ebat: 13 x 19,5<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım', 0, '9786059533409', 1869, 10, 2),
(10778, 'tr-tr', 514, 1, '9786059533379', '11302973', 'Peter Pan Stage 3 - James Matthew Barrie', 'Peter Pan - Stage 3 - İngilizce Hikaye Kitap Açıklaması: <br>Peter Pan is a boy who never grows up. He lives with his band on the fabulous island called Neverland. There he has a complete freedom, eternal childhood, and an absolute absence of parental control. One day he takes Wendy, John and Michael to the Neverland, where they face many thrilling adventures. Their life is full of joy and cheerful games. But soon everything turns upside down. Captain Hook kidnaps Peter’s friends and carries them to his pirate ship. Peter knows that there will be a fight for life with only one winner. Peter or Hook this time? Will Peter rescue his friends, or will he die in this dreadful fight? Peter’s brave and impudent heart knows no fear, as even ‘to die would be such a big adventure’ for him…<br><br>Kitap Hakkında: <br>Hamur Tipi: 1. Hamur<br>Ebat: 13 x 19,5<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786059533379', 1869, 10, 2),
(10779, 'tr-tr', 514, 1, '9786059533317', '11302976', 'Alice\'s Adventures İn Wonderland Stage 3 - Lewis Carroll', 'Alice\'s Adventures in Wonderland - Stage 3 - İngilizce Hikaye Kitap Açıklaması: <br>One hot day Alice decides to go to the riverbank. There seems to be nothing out of the ordinary. Soon Alice begins to get bored increasingly. All of a sudden, a white rabbit runs past her quickly, looking at a pocket watch. Alice follows the rabbit down the hole without thinking twice. And the next moment she finds herself in the mysterious world of Wonderland, where everything happens in the most extraordinary way. In Wonderland, every minute is a part of the great adventure. Alice changes her size, talks to fairytale beasts, takes part in the crazy tea-party, plays the weirdest croquet ever… But will she find a border between absurdity and reality? And will she ever get out of Wonderland back home again? Get ready for the most unusual adventures with Alice in Wonderland, where your heart will burn with curiosity and admiration …<br><br>Kitap Hakkında: <br>Hamur Tipi: 1. Hamur<br>Ebat: 13 x 19,5<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786059533317', 1869, 10, 2),
(10780, 'tr-tr', 514, 1, '9786059533461', '11302977', 'White Fang Stage 3 - Jack London', 'White Fang - Stage 3 - İngilizce Hikaye Kitap Açıklaması: <br>White Fang was born in a frozen world of Canada. During his cubhood, he has to be strong in order to survive in the harsh conditions of the Northland. He is half dog and half wolf, whose spirit cannot be broken by the dangers of the wild life. He lives with his mother and learns the rules of survival day after day. But one day his life took a sudden and unexpectant twist – he meets Indians who seem to be the gods of everything. White Fang and his mother start to live in the Indian camp, where they lose their freedom and independence once and for all. In course of time, White Fang loses his mother unfairly. Grey Beaver becomes his god-master, who demands obedience and loyalty in spite of everything. Due to crafty cunning, White Fang becomes a slave of a very cruel man named Beauty Smith. White Fang just follows the law of his life – kill the weak and obey the strong… This is an unbelievable story which shows us a strong spirit, loyalty, love and willpower of animal from the Wild. <br><br>Kitap Hakkında: <br>Hamur Tipi: 1. Hamur<br>Ebat: 13 x 19,5<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786059533461', 1869, 10, 2),
