(10790, 'tr-tr', 219, 1, '9786050904192', '10065665', 'Mutluluk Zülfü Livaneli', 'Kitabın Özeti: Meryem: Van Gölü kıyısındaki bir kasabada, Allah’ın kendisini sevmesinden başka bir şey beklemeyen 17 yaşında bir kız. Şeyh amcasının tecavüzüne uğramış. Bir töre cinayetine kurban gitmek üzere…<br>Prof. Dr. İrfan Kurudal: İstanbullu tanınmış bir aydın. Hayattan hiçbir beklentisi kalmamış. Sahip olduğu her şeyi geride bırakarak, teknesiyle amaçsız bir Ege yolculuğuna çıkıyor. <br>Cemal: Gabar Dağları’nda PKK peşinde koşmuş bir komando. Askerliğini bitirip eve döndüğünde ömrünün en zor göreviyle karşı karşıya kalıyor: Ailenin yüzkarası amca kızını töre gereği öldürmesi gerekiyor. <br><br>Her biri mutluluğu arayan Meryem, İrfan ve Cemal, kendilerinin, birbirlerinin ve ülkenin ruhunun derinlerine doğru çalkantılı bir yolculuğa çıkıyorlar. Peki, onları neler bekliyor?', 0, '9786050904192', 1869, 37, 2),
