(10793, 'tr-tr', 791, 1, '9789750826184', '10067604', 'Tek Kanatlı Bir Kuş Yaşar Kemal', 'Kitabın Özellikleri:<br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 72<br>En / Boy: 13,00 / 21,00 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Şubat 2020<br><br>Kitabın Özeti: Edebiyatımızın çınarı, büyük usta Yaşar Kemal\'in Tek Kanatlı Bir Kuş kitabı, toplumda bulaşıcı bir hastalık gibi yayılan korkunun destansı bir romanı.Tek Kanatlı Bir Kuş\'da toplumda bulaşıcı bir hastalık gibi yayılan korkuyu anlatan Yaşar Kemal, kitabın ana teması korku ile ilgili \"Ben hep korkudan korktum. Korkudan çok korktum. Roman yazdığım zaman içimde bir korku istemezdim. O yüzden bu kitapta da korkuyu anlattım. Kayseri\'de askerlik yaptığım kasabanın üzerinde büyük bir taş vardı ve bütün kasaba bu taşın üzerlerine düşeceğinden korkuyor, taşı üzerilerine düşmesin diye demir zincirlerle bağlıyorlardı. Madem korkuyorsunuz o zaman çekin gidin derdim. Seneler senesi bu korkuyu yazmak istedim\" diyor. Yaşar Kemal\'in 1960\'ların sonunda yazdığı ve şimdi yayımlamaya karar verdiği Tek Kanatlı Bir Kuş romanı, okuru 1960\'lı yılların Anadolusu\'na götüren tarihi bir belge olmanın yanı sıra büyük ustanın edebiyatında önemli bir dönemi de gözler önüne seriyor.', 0, '9789750826184', 1869, 10, 2),
(10794, 'tr-tr', 219, 1, '9786050905441', '10067760', 'Bir Kedi, Bir Adam, Bir Ölüm Zülfü Livaneli', 'Kitabın Özeti: \"Arkadaşlarım bunun farkında değil ama ben bu bağlantıların üstünde ya da dışındayım. Onlar gibi davranmaya, onlara benzemeye çalışıyorum, lakin içim farklı, işte romanı yazan zavallı arkadaşımın inemediği derinliklerden biri de bu. O beni, politik geçmişi olan ve Kuzey sürgününe savrulmuş, sıradan insanlardan biri sanıyor. Başımdan geçenleri, benden daha ilginç buluyor. İçimdeki derin ve köklü karanlığın farkında değil. Çünkü insanları konuşarak tanıyamazsınız. Konuşmak, canlı yaratıklar arasındaki en etkisiz iletişim aracı. Dil yalan söylüyor, olanları çarpıtıyor, insanlığın hiç bıkıp usanmadığı klişeleri tekrarlıyor. Bu yüzden, insanları dinlemek onları anlamak için yeterli değil.\" <br><br>12 Mart rüzgârlarının İstanbul’dan Stockholm’e savurduğu bir mülteci olan Sami Baran, yattığı hastanede Türkiye’den bir hastayla karşılaşır. Bu adam, başına gelenlerin sorumlusu olarak gördüğü eski bir bakandır. Ondan intikamını almak amacıyla Şili, Uruguay, İran gibi farklı ülkelerden gelmiş mülteci arkadaşlarıyla birlikte bir plan yapar. Ancak, bu planı gerçekleştirmek o kadar kolay olmayacaktır: Sami Baran, anadilin yeri geldiğinde düşmanla da anlaşma aracı olabileceğini hesaba katmamıştır. Ve bu, planın önündeki engellerden sadece biridir... Zülfü Livaneli’nin usta kaleminden, sürgün yaşamı ve öldürmek-bağışlamak ikilemi üzerine, okurları ve eleştirmenleri değişik kurgusu ve beklenmedik final(ler)iyle de etkileyen, kusursuz bir roman.', 0, '9786050905441', 1869, 28, 2),
(10795, 'tr-tr', 219, 1, '9786050905434', '10067882', 'Arafatta Bir Çocuk Zülfü Livaneli', 'Kitabın Özeti: Boynuna nenesinin astığı mavi gözboncuğuna eliyle dokundu. Mavi gözlere karşı koruyacaktı onu. Unutmamıştı nerede olduğunu, ama çevresinde olup bitenlerden kopmuştu. Aydınlık bir gülümseme yayılmıştı yüzüne. Neredeyse kaşlarının üstünden başlıyordu saçları. Kıvrım kıvrım, güçlü, kapkara saçlardı. Gözleri de her şeye, her zaman şaşarak bakıyormuş gibi kocaman ve parlaktılar. Çoğu zaman, hele soğukta nemli gibi dururlardı.\" Bazı insanlar bütün hayatlarını sınırları aşma mücadelesi olarak geçirir. Bu konuda tartışmasız en deneyimli kişilerden biri olan Zülfü Livaneli’nin yıllara yayılan, yıllarla beslenen, zenginleşen deneyim ve gözlemlerinden, Almanya’da, İsveç’te, Danimarka’da, Türkiye’de... sınırlar, sınır aşanlar, sürgünler, gurbetçiler üzerine, değerleri yıllarla sınanmış öyküler... Zülfü Livaneli’nin edebiyat alanındaki ilk verimleri olan öykülerini bir araya getiren Arafat’ta Bir Çocuk, yayımlandığı 1978 yılından beri hem Türkiye’de hem de dünyada olağanüstü bir ilgi gördü. Türkiye’de defalarca basıldığı gibi Almanca ve Farsçaya da çevrildi. Kitaba adını veren öykü İsveç ve Alman televizyonlarında film yapıldı. Arafat’ta Bir Çocuk’un ana konusu, edebiyatın en eski temalarından \"sürgün\" ve bütün anlamlarıyla \"sınır\". Kitapta yer alan öykülerde, Türkiye’nin Avrupa macerasının başladığı 1960’lardan ve 12 Mart 1971’den bu yana işçi ya da siyasi mülteci olarak Avrupa ülkelerine savrulan Türklerin özellikle kültürel çatışmalar bağlamında yaşadığı sıkıntılar işleniyor.', 0, '9786050905434', 1869, 24, 2),
