(10811, 'tr-tr', 810, 1, '9786052041321', '11380884', 'Tek Kişilik Dev Orkestra! Kolektif', 'Kitabın Özellikleri: <br>Basım Dili: Türkçe<br>Basım Yeri: Türkiye<br>Sayfa Sayısı: 208<br>En / Boy: 13,50 / 21,00 cm<br>Kağıt Cinsi: 1. Hamur<br>Basım Tarihi: Ekim 2017<br><br>Kitabın Özeti: Selam arkadaşlar, ben Şakir. Hepinizin bildiği şekilde nam-ı diğer Kral Şakir. Dışarıdan bakıldığında normal bir aile gibi görünsek de bizim evde her gün ayrı bir olay yaşanır. Aslan babam Remzi, kardeşim Canan, yemek âşığı Fil Necati ile birlikte maceradan maceraya koşarız. Çılgın ve bir o kadar komik ailemle tanışacağınız için mutluyum ama şimdi biraz acelem var. Sebzelerle hamburgerler arasında kavga çıkmış; hamburgerler bir sıfır galip, olaya müdahale etmem lazım.', 0, '9786052041321', 1869, 36, 2),
