(10823, 'tr-tr', 810, 1, '9789750718533', '10672481', '1984 George Orwell', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Orijinal Dil: İngilizce<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 352<br>En / Boy: 12,50 / 19,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Kasım 2019<br><br>Kitabın Özeti: Partinin dünya görüşü, onu hiç anlayamayan insanlara çok daha kolay dayatılıyordu. Her şeyi yutuyorlar ve hiçbir zarar görmüyorlardı çünkü tıpkı bir mısır tanesinin bir kuşun bedeninden sindirilmeden geçip gitmesi gibi, yuttuklarından geriye bir şey kalmıyordu. George Orwell’in kült kitabı Bin Dokuz Yüz Seksen Dört, yazarın geleceğe ilişkin bir kâbus senaryosudur. Bireyselliğin yok edildiği, zihnin kontrol altına alındığı, insanların makineleşmiş kitlelere dönüştürüldüğü totaliter bir dünya düzeni, romanda inanılmaz bir hayal gücüyle, en ince ayrıntısına kadar kurgulanmıştır. Geçmişte ve günümüzde dünya sahnesinde tezgâhlanan oyunlar düşünüldüğünde, ütopik olduğu kadar gerçekçi bir romandır Bin Dokuz Yüz Seksen Dört. Güncelliğini hiçbir zaman yitirmeyen bir başyapıttır; yalnızca yarına değil, bugüne de ilişkin bir uyarı çığlığıdır.', 0, '9789750718533', 1869, 21, 2),
