(10825, 'tr-tr', 394, 1, '9786053608851', '10672950', 'Semaver Sait Faik Abasıyanık', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 138<br>En / Boy: 12,50 / 20,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ocak 2020<br><br>Kitabın Özeti: Türk hikayeciliği Ömer Seyfettin\'den sonra Memduh Şevket Esendal, Fahri Celalettin gibi ustaların sürdürdüğü bir türdü. Sabahattin Ali, Refik Halit\'in memleket hikayeciliğine diyalektik bir görüş katmış ve bu yeniliği ile 1940\'ların tek ismi olmuştu. Sait Faik ise onların yapmadığı bir şeyi yaptı. Bir konuyu değil, yaşamın bir parçasını işliyordu. Bir tez savunmuyor, bir yaşantıyı yansıtıyordu. İnsan sevgisi dolu, doğa sevgisi dolu bir yüreği vardı. Neye baksa bu sevgi ile ısınıyor, ışıklanıyordu. Biz ancak o el attıktan sonradır ki, en önemsiz görünen insanların ve şeylerin zevkine eriştik.', 0, '9786053608851', 1869, 12, 2),
(10826, 'tr-tr', 810, 1, '9789750726439', '10676444', 'Simyacı Paulo Coelho', 'Kitabın Özeti: Simyacı, dünyaca ünlü Brezilyalı yazar Paulo Coelho\'nun üçüncü romanı. 1996 yılından bu yana Türkiye\'de de çok okundu, çok sevildi, çok övüldü bu kitap. Bir büyük Doğu klasiği olan Mevlana\'nın ünlü Mesnevi\'sinde yer alan bir küçük öyküden yola çıkarak yazılan bu roman, yüreğinde çocukluğunun çırpınışlarını taşıyan okurlar için bir \"klasik\" yapıt haline geldi. Simyacı, İspanya\'dan kalkıp Mısır piramitlerinin eteklerinde hazinesini aramaya giden Endülüslü çoban Santiago\'nun masalsı yaşamının öyküsü. Ama aynı zamanda bir \"nasihatname\"; \"Yazgına nasıl egemen olacaksın? Mutluluğunu nasıl kuracaksın? Gibi sorulara yanıt arayan bir yaşam ve ahlak kılavuzu. Mistik bir peri masalına benzeyen bu romanın, dünyanın dört bir yanında bunca sevilmesinin gizi, kuşkusuz bu kılavuzluk niteliğinden kaynaklanıyor. Simyacı\'yı okumak, herkes daha uykudayken şafak vakti uyanıp, güneşin doğuşunu izlemeye benziyor.', 0, '9789750726439', 1869, 26.5, 2),
