(10828, 'tr-tr', 218, 1, '9786050940954', '11185651', 'Atatürk\'ün İzinde - Zülfü Livaneli', 'Kitabın Özellikleri:<br> Basım Dili: Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 132<br>En / Boy: 15,00 / 19,00 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Aralık 2018<br><br>Kitabın Özeti: Hazır mısın yolculuğa çıkmaya? Okumaya, düşünmeye, yazmaya ve üretmeye. Şimdi unutamayacağın bir yolculuğa çıkacaksın, yanında da Atatürk olacak; onun hayatı ve fikirleri sana yol gösterecek. Atatürk’ün çok yakın arkadaşın olduğunu ve onun yaşamına tanıklık ettiğini hayal et. Bu yaşadıkların sana neler katardı, neler yazardın onun hakkında? Atatürk’ün İzinde, hayalindeki Atatürk hikâyesini yazman için tasarlandı. Atatürk’e eşlik etmen, onu anlaman, yazman ve onun verdiği ilhamla yeni düşünceler geliştirmen için...Bunları yaparken, olumlu düşünme teknikleri, yaratıcı yazma etkinlikleri, pek çok edebi tür ve eğlenceli oyunlar sana yardımcı olacak.', 0, '9786050940954', 1869, 22, 2),
