(10841, 'tr-tr', 810, 1, '9789750719387', '10672479', 'Hayvan Çiftliği George Orwell', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Orijinal Dil: İngilizce<br>Basım Yeri: Türkiye<br>Sayfa Sayısı: 152<br>En / Boy: 12,50 / 19,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Mart 2020<br><br>Kitabın Özeti: İngiliz yazar George Orwell, ülkemizde daha çok Bin Dokuz Yüz Seksen Dört adlı kitabıyla tanınır. Hayvan Çiftliği, onun çağdaş klasikler arasına girmiş bir diğer çok ünlü eseridir. 1940\'lardaki \"reel sos­yalizm\"in eleştirisi olan bu roman, dünya edebiyatında yergi türünün başyapıtlarından biri olarak kabul edilir. <br>Hayvan Çiftliği\'nin başkişileri hayvanlardır. Bir çiftlikte yaşayan hayvanlar, kendilerini sömüren insanlara başkaldırıp çiftliğin yönetimini ele geçirir. Amaçları daha eşitlikçi bir topluluk oluşturmaktır. Aralarında en akıllı olan domuzlar, kısa sürede önder bir takım oluşturur; ama devrimi de yine onlar yolundan saptırır. Ne yazık ki insanlardan daha baskıcı, daha acımasız bir diktatörlük kurulmuştur artık. George Orwell, bu romanında tarihsel bir gerçeği eleştirmektedir. Romandaki önder domuzun, düpedüz Stalin\'i simgelediği açıktır. Diğer kahramanlar gerçek kişileri çağrıştırmasalar da, bir diktatörlük ortamında olabilecek kişilerdir.', 0, '9789750719387', 1869, 11, 2),
(10842, 'tr-tr', 514, 1, '9789752888371', '11183678', 'English Grammer Today Türkçe Açıklamalı', 'English Grammar Today Türkçe Açıklamalı İngilizce Gramer Kitap Açıklaması: <br> Konular kolaydan zora doğru sıralanmıştır. Türkçe açıklamalı olduğu için özellikle her örnekte mümkün olduğunca farklı kelimelere yer verilerek çalışırken farkında olmadan kelime hazinenizin de gelişmesi amaçlanmıştır. Konuların anlatım başarısı, sadeliği ve bol alıştırmaları English Grammar Today’i hem öğrenciler hem de öğretmenler için çok popüler bir kitap haline getirmiştir. <br><br>Kitap Hakkında: <br>Hamur Tipi: 1. Hamur<br>Ebat: 16 x 23,5<br>İlk Baskı Yılı: 2019<br>Dil: Türkçe - İngilizce', 0, '9789752888371', 1869, 55, 2),
(10843, 'tr-tr', 514, 1, '9789759894184', '11183679', 'İngilizce Zamanlar-Murat Kurt', 'İngilizce\'de Zamanlar Kitap Açıklaması: <br>Öğretmenler, öğrenciler ve İngilizce öğrenenler için vazgeçilmez bir kaynak olan bu kitabın içeriği oldukça zengin ve öğreticidir. Binlerce örnek ve alıştırma, sorular, tüm cümlelerin Türkçe karşılıkları ile Irregular Verbs, Elementary, Pre-Intermediate ve Intermediate ve Upper Intermediate seviyesinde sınavlar bulunmaktadır. <br><br>Kitap Hakkına: <br>Baskı Yılı: 2008<br>Dili: Türkçe / İngilizce<br>Yayınevi: MK Publications<br>Hamur Tipi: 1. Hamur<br>İlk Baskı Yılı: 2019<br>Dil: Türkçe – İngilizce', 0, '9789759894184', 1869, 55, 2),
(10844, 'tr-tr', 514, 1, '9786059533171', '11183778', 'Klasik Roman Dracula', 'Dracula - İngilizce Roman Kitap Açıklaması: <br>“That is good image,” he said. “Well, I shall tell you. My thesis is this: I want you to believe.” To believe what? “To believe in things that you cannot. Let me illustrate. I heard once of an American who so defined faith: ‘that faculty which enables us to believe things which we know to be untrue.’ For one, I follow that man. He meant that we shall have an open mind, and not let a little bit of truth check the rush of a big truth, like a small rock does a railway truck. We get the small truth first. Good! We keep him, and we value him; but all the same we must not let him think himself all the truth in the universe.” <br><br>Kitap Hakkında:<br>Hamur Tipi: 2. Hamur<br>Ebat: 10,5 x 18<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz<br>Dili: İngilizce', 0, '9786059533171', 1869, 17.5, 2),
(10845, 'tr-tr', 514, 1, '9786059533188', '11183780', 'Klasik Roman Emma', 'Emma - İngilizce Roman Kitap Açıklaması: <br>“Oh! I always deserve the best treatment, because I never put up with any other; and, therefore, you must give me a plain, direct answer. Are you quite sure that you understand the terms on which Mr. Martin and Harriet now are?” I am quite sure,” he replied, speaking very distinctly, “that he told me she had accepted him; and that there was no obscurity, nothing doubtful, in the words he used; and I think I can give you a proof that it must be so. He asked my opinion as to what he was now to do. He knew of no one but Mrs. Goddard to whom he could apply for information of her relations or friends. Could I mention any thing more fit to be done, than to go to Mrs. Goddard? I assured him that I could not. Then, he said, he would endeavour to see her in the course of this day.” <br><br>Kitap Hakkında: <br>Hamur Tipi: 2. Hamur<br>Ebat: 10,5 x 18<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786059533188', 1869, 17.5, 2),
(10846, 'tr-tr', 514, 1, '9786059533164', '11183783', 'Klasik Roman Alice In Wonderland', 'Alice\'s Adventures In Wonderland - İngilizce Roman Kitap Açıklaması: <br>“I’m sure those are not the right words,” said poor Alice, and her eyes filled with tears again as she went on, “I must be Mabel after all, and I shall have to go and live in that poky little house, and have next to no toys to play with, and oh! ever so many lessons to learn! No, I’ve made up my mind about it; if I’m Mabel, I’ll stay down here! It’ll be no use their putting their heads down and saying, ‘Come up again, dear!’ I shall only look up and say, ‘Who am I then? Tell me that first, and then, if I like being that person, I’ll come up: if not, I’ll stay down here till I’m somebody else’—but, oh dear!” cried Alice, with a sudden burst of tears, “I do wish they would put their heads down! I am so very tired of being all alone here!” <br><br>Kitap Hakkında: <br>Hamur Tipi: 2. Hamur<br>Ebat: 10,5 x 18<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 2. Basım<br>Medya Cinsi: Ciltsiz<br>Dili: İngilizce', 0, '9786059533164', 1869, 17.5, 2),
(10847, 'tr-tr', 514, 1, '9786059533157', '11183786', 'Klasik Roman A Christmas Carol', 'A Christmas Carol - İngilizce Roman Kitap Açıklaması: <br>“I wear the chain I forged in life,” replied the Ghost. “I made it link by link, and yard by yard; I girded it on of my own free will, and of my own free will I wore it. Is its pattern strange to you?” Scrooge trembled more and more.“Or would you know,” pursued the Ghost, “the weight and length of the strong coil you bear yourself? It was full as heavy and as long as this, seven Christmas Eves ago. You have laboured on it, since. It is a ponderous chain!”Scrooge glanced about him on the floor, in the expectation of finding himself surrounded by some fifty or sixty fathoms of iron cable: but he could see nothing. <br><br>Kitap Hakkında: <br>Hamur Tipi: 2. Hamur<br>Ebat: 10,5 x 18<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 2. Basım<br>Medya Cinsi: Ciltsiz<br>Dili: İngilizce', 0, '9786059533157', 1869, 17.5, 2),
(10848, 'tr-tr', 514, 1, '9786059533263', '11183787', 'Klasik Roman Dr. Jekyll And Mr. Hyde', 'The Strange Case Of Dr. Jekyll and Mr. Hyde - İngilizce Roman Kitap Açıklaması: <br>”Ah, that’s not Jekyll’s voice—it’s Hyde’s!’’ cried Utterson. ‘‘Down with the door, Poole.”Poole swung the axe over his shoulder; the blow shook the building, and the red baize door leaped against the lock and hinges. A dismal screech, as of mere animal terror, rang from the cabinet. Up went the axe again, and again the panels crashed and the frame bonded; four times the blow fell; but the wood was tough and the fittings were of excellent workmanship; and it was not until the fifth, that the lock burst in sunder and the wreck of the door fell inwards on the carpet. <br><br>Kitap Hakkında: <br>Hamur Tipi: 2. Hamur<br>Ebat: 10,5 x 18<br>Baskı Sayısı: 2. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786059533263', 1869, 17.5, 2),
(10849, 'tr-tr', 514, 1, '9786059533287', '11183788', 'Klasik Roman The Trail', 'The Trial - İngilizce Roman Kitap Açıklaması: <br>The novel opens with Josef K.’s sudden arrest in his room at his lodging house on the morning of his birthday. Two guards inform him that he is under arrest, but they don’t tell him on what charges, nor do they know what the charges are. K. is then taken next door to the room of another tenant, Fraülein Bürstner, who happens to be absent at the time. There, he is subjected to an equally puzzling and brief interrogation by the inspector. The inspector informs K. that he is under arrest, but is free to go to work at his bank and otherwise live life as usual. <br><br>Kitap Hakkında: <br>Hamur Tipi: 2. Hamur<br>Ebat: 10,5 x 18<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786059533287', 1869, 17.5, 2),
(10850, 'tr-tr', 514, 1, '9786059533195', '11183789', 'Klasik Roman Frankenstein', 'Frankenstein - İngilizce Roman Kitap Açıklaması: <br><br>The monster saw my determination in my face and gnashed his teeth in the impotence of anger. “Shall each man,” cried he, “find a wife for his bosom, and each beast have his mate, and I be alone? I had feelings of affection, and they were requited by detestation and scorn. Man! You may hate, but beware! Your hours will pass in dread and misery, and soon the bolt will fall which must ravish from you your happiness forever. Are you to be happy while I grovel in the intensity of my wretchedness? You can blast my other passions, but revenge remains—revenge, henceforth dearer than light or food! I may die, but first you, my tyrant and tormentor, shall curse the sun that gazes on your misery. Beware, for I am fearless and therefore powerful. I will watch with the wiliness of a snake, that I may sting with its venom. Man, you shall repent of the injuries you inflict.” <br>Kitap Hakkında: <br>Hamur Tipi: 2. Hamur<br>Ebat: 10,5 x 18<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786059533195', 1869, 17.5, 2),
(10851, 'tr-tr', 514, 1, '9786059533249', '11183790', 'Klasik Roman The Jungle Book', 'The Jungle Book - İngilizce Roman Kitap Açıklaması: <br>“Now, don’t be angry after you’ve been afraid. That’s the worst kind of cowardice,” said the troop-horse. “Anybody can be forgiven for being scared in the night, I think, if they see things they don’t understand. We’ve broken out of our pickets, again and again, four hundred and fifty of us, just because a new recruit got to telling tales of whip snakes at home in Australia till we were scared to death of the loose ends of our head-ropes.” “That’s all very well in camp,” said Billy. “I’m not above stampeding myself, for the fun of the thing, when I haven’t been out for a day or two. But what do you do on active service?” <br><br>Kitap Hakkında: <br>Hamur Tipi: 2. Hamur<br>Ebat: 10,5 x 18<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786059533249', 1869, 17.5, 2),
(10852, 'tr-tr', 514, 1, '9786059533256', '11183791', 'Klasik Roman The Metamorphosis', 'The Metamorphosis - İngilizce Roman Kitap Açıklaması: <br>Poor Gregor Samsa. This guy wakes up one morning to discover that he’s become a “monstrous vermin”As he struggles to come to terms with his new body, he realizes that he’s (gasp!) late for his job as a traveling salesman. First his mother, then his father and sister, knock on his bedroom door in an effort to get him out of bed. His supervisor, the office manager, arrives to inquire about his absence. With his parents pleading with the office manager outside his bedroom door and his sister sobbing in another room—they’re upset because they think he’s sick or shirking his responsibilities—Gregor manages to crawl to his bedroom door, open it, and reveal to everyone his shocking new buggy form. <br><br>Kitap Hakkında: <br>Hamur Tipi: 2. Hamur<br>Ebat: 10,5 x 18<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786059533256', 1869, 17.5, 2),
(10853, 'tr-tr', 514, 1, '9786059533218', '11183803', 'Klasik Roman Notes From Underground', 'Notes From Underground - İngilizce Roman Kitap Açıklaması: <br>Every man has reminiscences which he would not tell to everyone, but only to his friends. He has other matters in his mind which he would not reveal even to his friends, but only to himself, and that in secret. But there are other things which a man is afraid to tell even to himself, and every decent man has a number of such things stored away in his mind. The more decent he is, the greater the number of such things in his mind. Anyway, I have only lately determined to remember some of my early adventures. Till now I have always avoided them, even with a certain uneasiness. Now, when I am not only recalling them, but have actually decided to write an account of them, I want to try the experiment whether one can, even with oneself, be perfectly open and not take fright at the whole truth. I will observe, in parenthesis, that Heine says that a true autobiography is almost an impossibility, and that man is bound to lie about himself. <br><br>Kitap Hakkında: <br>Hamur Tipi: 2. Hamur<br>Ebat: 10,5 x 18<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 2. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786059533218', 1869, 17.5, 2),
(10854, 'tr-tr', 514, 1, '9786059533225', '11183804', 'Klasik Roman Persuasion', 'Persuasion - İngilizce Roman Kitap Açıklaması: <br>“I can listen no longer in silence. I must speak to you by such means as are within my reach. You pierce my soul. I am half agony, half hope. Tell me not that I am too late, that such precious feelings are gone for ever. I offer myself to you again with a heart even more your own, than when you almost broke it eight years and a half ago. Dare not say that man forgets sooner than woman, that his love has an earlier death. I have loved none but you.” <br><br>Kitap Hakkında:<br>Hamur Tipi: 2. Hamur<br>Ebat: 10,5 x 18<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi : Ciltsiz', 0, '9786059533225', 1869, 17.5, 2),
(10855, 'tr-tr', 514, 1, '9786059533232', '11183805', 'Klasik Roman The Great Gatsby', 'The Great Gatsby - İngilizce Roman Kitap Açıklaması: <br>His heart beat faster and faster as Daisy’s white face came up to his own. He knew that when he kissed this girl, and forever wed his unutterable visions to her perishable breath, his mind would never romp again like the mind of God. So he waited, listening for a moment longer to the tuning fork that had been struck upon a star. Then he kissed her. At his lips’ touch she blossomed for him like a flower and the incarnation was complete. Through all he said, even through his appalling sentimentality, I was reminded of something—an elusive rhythm, a fragment of lost words, that I had heard somewhere a long time ago. For a moment a phrase tried to take shape in my mouth and my lips parted like a dumb man’s, as though there was more struggling upon them than a wisp of startled air. But they made no sound and what I had almost remembered was uncommunicable forever. <br><br>Kitap Hakkında: <br>Hamur Tipi: 2. Hamur<br>Ebat: 10,5 x 18<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786059533232', 1869, 17.5, 2),
(10856, 'tr-tr', 514, 1, '9786059533294', '11183808', 'Klasik Roman The Picture of Dorian Gray', 'The Picture Of Dorian Gray - İngilizce Roman Kitap Açıklaması: <br>Then he looked at Lord Henry. “Dorian Gray is my dearest friend,” he said. “He has a simple and a beautiful nature. Your aunt was quite right in what she said of him. Don’t spoil him for me. Don’t try to influence him. Your influence would be bad. The world is wide, and has many marvellous people in it. Don’t take away from me the one person that makes life absolutely lovely to me, and that gives to my art whatever wonder or charm it possesses. Mind, Harry, I trust you.” He spoke very slowly, and the words seemed wrung out of him almost against his will. <br><br>Kitap Hakkında: <br>Hamur Tipi: 2. Hamur<br>Ebat: 10,5 x 18<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786059533294', 1869, 17.5, 2),
(10857, 'tr-tr', 514, 1, '9786059533270', '11183810', 'Klasik Roman The Time Machine', 'The Time Machine - İngilizce Roman Kitap Açıklaması: <br>Now, it is very remarkable that this is so extensively overlooked,’ continued the Time Traveller, with a slight accession of cheerfulness. ‘Really this is what is meant by the Fourth Dimension, though some people who talk about the Fourth Dimension do not know they mean it. It is only another way of looking at Time. There is no difference between Time and any of the three dimensions of Space except that our consciousness moves along it. But some foolish people have got hold of the wrong side of that idea. You have all heard what they have to say about this Fourth Dimension?’ <br><br>Kitap Hakkında: <br>Hamur Tipi: 2. Hamur<br>Ebat: 10,5 x 18<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786059533270', 1869, 17.5, 2);
