(10858, 'tr-tr', 514, 1, '9786059533201', '11183811', 'Klasik Roman Heart Of Darkness', 'Heart Of Darkness - İngilizce Roman Kitap Açıklaması: <br>I heard her weeping; she had hidden her face in her hands. It seemed to me that the house would collapse before I could escape, that the heavens would fall upon my head. But nothing happened. The heavens do not fall for such a trifle. Would they have fallen, I wonder, if I had rendered Kurtz that justice which was his due? Hadn’t he said he wanted only justice? But I couldn’t. I could not tell her. It would have been too dark—too dark altogether.” Marlow ceased, and sat apart, indistinct and silent, in the pose of a meditating Buddha. Nobody moved for a time. “We have lost the first of the ebb,” said the Director suddenly. I raised my head. The offing was barred by a black bank of clouds, and the tranquil waterway leading to the uttermost ends of the earth flowed sombre under an overcast sky—seemed to lead into the heart of an immense darkness. <br><br>Kitap Hakkında: <br>Hamur Tipi: 2. Hamur<br>Ebat: 10,5 x 18<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786059533201', 1869, 17.5, 2),
(10859, 'tr-tr', 514, 1, '9786059533089', '11183855', 'Hikaye Kitabı Treasure Island Stage 2', 'Treasure Island - Stage 2 - İngilizce Hikaye Kitap Açıklaması: Jim Hawkins is a young boy. He has a very calm and normal life. He works at his parents’ inn called ‘Admiral Benbow’. One day, an old seaman with a secret past comes to stay in the inn for some months. And from that day on, Jim’s life changes once and for all. Jim finds himself in the center of dangerous and awful events. As a result, he has a map which leads to the biggest pirate treasure in the world – Flint’s treasure on the Skeleton Island. Jim entrusts Doctor Livesey and Mr Trelawney with a secret at once. They decide to go to sea within a very short time. Captain Smollett and John Silver find a good ship and a strong crew for the oncoming voyage. And so Jim and his friends set sail in search of Flint’streasure. On their way, Jim faces an unbelievable treason, mutiny, death, greed and loss of human values. He fights for his life and takes the most serious decisions in order to live… Who will lay hold of the bloody treasure? Will justice triumph over greed? This amazing story is full of bravest adventures and unexpected turn of events. <br><br>Kitap Hakkında: <br>Hamur Tipi: 1. Hamur<br>Ebat: 13x19<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786059533089', 1869, 10, 2),
(10860, 'tr-tr', 514, 1, '9786054441877', '11183856', 'Hikaye Kitabı Robin Hood Stage 1', 'Robin Hood - Stage 1 - İngilizce Hikaye Kitap Açıklaması: <br>Robin Hood is a well-known hero from Sherwood Forest. He robs the rich and helps the poor. He meets many loyal friends: Little John, Friar Tuck, Will Scarlet, Alan-A-Dale and so on. He forms his own merry band of skillful archers in Sherwood Forest. Robin Hood and his men fight against injustice and cruelty. Robin Hood does his best to put his enemies out of temper and to take their money right away. At the same time, he finds his true love, Maid Marian. His life is full of dangerous adventures, amazing acts of bravery, funny moments, and generous actions. This story will make you surprised at its martial spirit, real adventure and strong love. Get ready and start your adventures with Robin Hood and his merry men. <br><br>Hamur Tipi: 1. Hamur<br>Ebat: 13x19<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım', 0, '9786054441877', 1869, 10, 2),
(10861, 'tr-tr', 514, 1, '9786054441884', '11183858', 'Hikaye Kitabı Peter Pan', 'Peter Pan - Stage 1 - İngilizce Hikaye Kitap Açıklaması: <br>Peter Pan is a boy who never grows up. He lives with his band on the fabulous island called Neverland. There he has a complete freedom, eternal childhood, and an absolute absence of parental control. One day he takes Wendy, John and Michael to the Neverland, where they face many thrilling adventures. Their life is full of joy and cheerful games. But soon everything turns upside down. Captain Hook kidnaps Peter’s friends and carries them to his pirate ship. Peter knows that there will be a fight for life with only one winner. Peter or Hook this time? Will Peter rescue his friends, or will he die in this dreadful fight? Peter’s brave and impudent heart knows no fear, as even ‘to die would be such a big adventure’ for him…<br><br>Hamur Tipi: 1. Hamur<br>Ebat: 13x19<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım', 0, '9786054441884', 1869, 10, 2),
