(10863, 'tr-tr', 514, 1, '9786054441655', '11183860', 'Hikaye Kitabı Heidi Stage 1', 'Kitap Özeti: <br><br>Heidi is an orphan girl. She lives with her aunt Dete. Soon her life changes forever. Aunt Dete brings Heidi to her grandfather who lives high on the Swiss mountain. Then her aunt goes away to Frankfurt where she found a good job. Amazingly, Heidi and her grandfather find common ground at once. The grandfather loves his granddaughter with all his heart. Heidi makes friends with one young shepherd and his goats. She lives on the mountain happily and light-heartedly. But suddenly her aunt Dete comes back and brings her to Frankfurt. She wants Heidi to live with rich family and play with an invalid girl. Heidi likes her new friend Clara. But she does not like to live in a big city: stony houses, strict rules and lack of freedom. Heidi wants to come back to the mountain and live with her grandfather again. She gets homesick so much that she starts to walk in her sleep every night. Soon the chance of going home came. But what about Clara? Heidi has to make her own decision... <br><br>Kitap Hakkında: <br>Hamur Tipi: 1. Hamur<br>Ebat: 13x19<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786054441655', 1869, 10, 2),
