(10884, 'tr-tr', 514, 1, '9786059533065', '11185496', 'Hikaye Kitabı The Call Of Wild Stage 3', 'The Call of the Wild - Stage 3 - İngilizce Hikaye Kitap Açıklaması: <br>Buck lived a comfortable life in California at Judge Miller’s house. But, all of a sudden, he was stolen and sold to a dog trader. The Gold Rush needed strong and fast dogs. That is why Buck goes to the North and becomes a sledge dog unwillingly. He finds himself in a new life full of different dangers. He faces hard work, unbearable cold, huge hunger, and cruel enemies. Buck has to follow the law of club and fang so that to survive among dogs and men in the North. He almost forgot the notion of friendship and mercy in the hard conditions of his new life. Soon Buck’s life changes once and for all. He meets his true master whom he loves with all his heart. Buck has many adventures with his master all over the North. Is Buck’s love stronger than his old instincts? Will he follow the wild call in the forest? Or will he stay with his master? This is an amazing story about the dog’s will-power and loyal heart. <br><br>Kitap Hakkında: <br>Hamur Tipi: 1. Hamur<br>Ebat: 13 x 19,5<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Medya Cinsi: Ciltsiz', 0, '9786059533065', 1869, 10, 2),
(10885, 'tr-tr', 514, 1, '9786059533041', '11185497', 'Hikaye Kitabı Anne Of Green Gables Stage 3', 'Anne of Green Gables - İngilizce Roman Kitap Açıklaması: <br>Anne reveled in the world of color about her. “Oh, Marilla,” she exclaimed one Saturday morning, coming dancing in with her arms full of gorgeous boughs, “I’m so glad I live in a world where there are Octobers. It would be terrible if we just skipped from September to November, wouldn’t it? Look at these maple branches. Don’t they give you a thrill—several thrills? I’m going to decorate my room with them.” “Messy things,” said Marilla, whose aesthetic sense was not noticeably developed. “You clutter up your room entirely too much with out-of-doors stuff, Anne. Bedrooms were made to sleep in.” <br><br>Kitap Hakkında: <br>Hamur Tipi: 2. Hamur<br>Sayfa Sayısı: 324<br>Ebat: 13 x 19<br>İlk Baskı Yılı: 2017<br>Baskı Sayısı: 1. Basım<br>Dil: İngilizce', 0, '9786059533041', 1869, 10, 2),
