(10888, 'tr-tr', 394, 1, '9786053606604', '11015130', 'Bilinmeyen Bir Kadının Mektubu - Stefan Zweig', 'Kitabın Özellikleri: <br>Basım Dili: Türkçe<br>Orijinal Dil: Almanca<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 68<br>En / Boy: 12,50 / 20,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ocak 2020<br><br>Kitabın Özeti: Stefan Zweig Bilinmeyen Bir Kadının Mektubu (Brief einer Unbekannten) adlı uzun öyküsünü 1920’li yılların ilk yarısında kaleme aldı. Bilinmeyen Bir Kadının Mektubu’nun kadın kahramanını sadece uzun bir mektubun yazarı olarak tanıyoruz. Kadının hayatı boyunca sevmiş olduğu erkek için kaleme aldığı bu mektubun \"gönderen\"inin adı yoktur. Mektubun başında tek bir hitap vardır: \"Sana, beni asla tanımamış olan sana\". Kadın büyük tutkusunu hep bir \"bilinmeyen\" olarak, yani tek başına yaşamaya razıdır, bu aşk öyküsünde \"taraflar\" değil, sadece tek bir \"taraf\" vardır. Böylesine, gerçek anlamda aşk denilebilir mi? Zweig okurunu, bir kez daha, insan psikolojisinde eşine pek rastlanmayan bir yolculuğa davet ediyor. Bu yeni yolculuğun sonunda \"mutlak aşk\" kavramının şimdiye kadar bilinmeyen kıyılarına varmayı amaçlamış olması da bir ihtimal!', 0, '9786053606604', 1869, 6, 2),
(10889, 'tr-tr', 219, 1, '9786050939828', '11074845', 'Huzursuzluk - Zülfü Livaneli', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 154<br>En / Boy: 13,50 / 19,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Şubat 2020<br><br>Kitabın Özeti: İstanbul’un kargaşası içinde sıradan bir yaşam süren İbrahim, çocukluk arkadaşı Hüseyin’in ölüm haberi üzerine doğduğu kadim kent Mardin’e gider. Onun, önce sevdaya sonra ölüme yazılmış, Mardin’de başlayıp Amerika’da sona ermiş hayatını araştırmaya koyulur. Böylece âdeta bir girdabın içine çekilir, tutkuyla ve hırsla gizemli bir kadının peşine düşer.<br> Harese nedir, bilir misin? Develerin çölde çok sevdiği bir diken var. Deve dikeni yedikçe ağzı kanar. Tuzlu kanın tadı dikeninkiyle karışınca bu, devenin daha çok hoşuna gider. Kanadıkça yer, bir türlü kendi kanına doyamaz… Orta Doğu’nun adeti budur, tarih boyunca birbirini öldürür ama aslında kendini öldürdüğünü anlamaz. Kendi kanının tadından sarhoş olur. <br>Mardinli Hüseyin ile IŞİD zulmünü misliyle yaşamış Ezidi kızı Meleknaz’ın ve kelamın çocuklarının hikayesi... Livaneli okuru, sevda ile acının iç içe geçtiği bir Orta Doğu gerçeğiyle buluşturuyor.', 0, '9786050939828', 1869, 24, 2),
