(10891, 'tr-tr', 394, 1, '9786053326090', '11156383', 'Olağan Üstü Bir Gece - Stefan Zweig', 'Kitabın Özellikleri: <br>Basım Dili: Türkçe<br>Orijinal Dil: Almanca<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 80<br>En / Boy: 12,50 / 20,00 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ocak 2020<br><br>Kitabın Özeti: Olağanüstü Bir Gece, seçkin bir burjuva olarak rahat ve tasasız varoluşunu sürdürürken giderek duyarsızlaşan bir adamın hayatındaki dönüştürücü deneyimin hikâyesidir. Sıradan bir Pazar gününü at yarışlarında geçirirken, belki de ilk kez burjuva ahlakından saparak “suç” işler. Böylece yeniden “hissetmeye” başladığını, kötücül ve ateşli hazları olan gerçek bir insan olduğunu fark eder. İçindeki haz dolu esrime, aynı günün akşamında onu gece aleminin son atıklarının arasına, “hayatın en dibindeki lağımlara” sürükleyecek, varış noktası ise ruhani bir uyanış olacaktır.', 0, '9786053326090', 1869, 8, 2),
