(10928, 'tr-tr', 262, 1, '9789944824620', '10065122', 'Saftirik Film Günlüğü', 'Kitabın Özellikleri:<br> Basım Dili: Türkçe<br>Orijinal Dil: İngilizce<br>Basım Yeri: Türkiye<br>Sayfa Sayısı: 231<br>En / Boy: 14,00 / 21,50 cm<br>Kağıt Cinsi: 1. Hamur<br>Basım Tarihi: Ağustos 2013<br><br>Kitabın Özeti: Jeff Kinney ile birlikte kamera arkasına geç ve Saftirik Greg\'in Günlüğü filminin çekimlerine katıl! Bir filmin nasıl çekildiğini merak ediyorsan, yalnız değilsin! Yazar ve illüstratör Jeff Kinney de bunu bilmiyordu! Ancak çok satan serisi Saftirik Greg\'in Günlüğü 20th Century Fox tarafından filme uyarlanınca, Jeff de bir kitabın nasıl dev bir sinema yapımına dönüştüğünü öğenmiş oldu. Fotoğraflara, senaryo sayfalarına, storyboard eskizlerine, kostüm tasarımlarına ve Jeff Kinney\'in orijinal çalışmalarına yer verilen Film Günlüğü serinin diğer kitaplarına mükemmel bir şekilde eşlik ediyor!', 0, '9789944824620', 1869, 36, 2),
