(10930, 'tr-tr', 219, 1, '9786050904222', '10065565', 'Engereğin Gözü Zülfü Livaneli', 'Kitabın Özeti: Yıllardır Topkapı Sarayı’ndaki hücresinde kapalı tutulan Şehzade, hiç beklemediği bir anda tahta çıkarılır, böylece iktidarın tek sahibi olur. Haremağası Süleyman ise Habeşistan’dan koparılıp hadım edilerek saraya getirildiğinden beri onun en sadık kulu ve \"iktidarsızlığına rağmen\" Harem’in tek hâkimidir. Valide Sultan’ın iktidar hesaplarıyla oğlunu yeniden hapsettirmesi, ilişkileri iyice içinden çıkılmaz bir hale sokacaktır. Engereğin Gözü, Haremağası ile Padişah arasındaki köle-efendi ilişkisi aracılığıyla, \"bakışıyla her canlıyı kımıltısız hale getiren bir engereğin bile gözünü kamaştıran\" iktidarın büyüleyiciliği üzerine alegorik bir roman. Bir yanıyla da bir \"dil şöleni\": Zülfü Livaneli, Evliya Çelebi’nin, Naimâ’nın ve Türkçenin büyük dil ustalarının izini sürüyor.', 0, '9786050904222', 1869, 25, 2),
(10931, 'tr-tr', 219, 1, '9786050906486', '10065593', 'Leylanın Evi Zülfü Livaneli', 'Kitabın Özeti: Boğaziçi’nde Bosnalılar Yalısı’nda doğup büyümüş paşa torunu Leyla Hanım, yalının yeni sahibi Ömer Cevheroğlu tarafından sokağa atılır ve mahallenin çocuklarından gazeteci Yusuf’un Cihangir’deki bekâr evine sığınmak zorunda kalır. Yusuf’un sevgilisi Rukiye (\"sahne adı\"yla Roxy), Almanya’da peep show’larda modellik yapmış, hip-hop tarzı müzik yaparak \"yırtmaya\" uğraşan bir Almancı kızıdır. Leyla Hanım, yalının yeni sahipleriyle görüşmeye çalıştığı bir gün, Ömer Bey’in babası, Kadızade Konağı’nın emektar vekilharcı, dört kuşaktır konaklarda hizmetkârlık yapan bir aileden gelen Ali Yekta Bey ile tanışır. Her biri ayrı bir dünyadan gelen bu insanların hayatlarının kesişmesi, onları hem kendilerini hem de birbirlerini değiştirecekleri, kimi zaman acılı kimi zaman eğlenceli bir sürece sokacaktır. Leyla’nın Evi, bir yanıyla da \"ev\" üstüne bir roman: \"Çünkü imparatorluk yıkılırken bütün Osmanlı tebaası acı çekti ve herkes birbirinin evine yerleşti.\"', 0, '9786050906486', 1869, 31, 2),
(10932, 'tr-tr', 219, 1, '9786050919387', '10065677', 'Kocan Kadar Konuş Şebnem Burcuoğlu', '', 0, '9786050919387', 1869, 9.9, 2),
(10933, 'tr-tr', 791, 1, '9789753638029', '10065794', 'Kürk Mantolu Madonna - Sabahattin Ali', 'Kitabın Özellikleri:<br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 160<br>En / Boy: 13,50 / 21,00 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ocak 2020 <br><br>Kitabın Özeti: \"Her gün, daima öğleden sonra oraya gidiyor, koridorlardaki resimlere bakıyormuş gibi ağır ağır, fakat büyük bir sabırsızlıkla asıl hedefine varmak isteyen adımlarımı zorla zapt ederek geziniyor; rastgele gözüme çarpmış gibi önünde durduğum \'Kürk Mantolu Madonna\'yı seyre dalıyor, ta kapılar kapanıncaya kadar orada bekliyordum.\" Kimi tutkular rehberimiz olur yaşam boyunca. Kollarıyla bizi sarar. Sorgulamaktan peşlerinden gideriz ve hiç pişman olmayacağımızı biliriz. Yapıtlarında insanların görünmeyen yüzlerini ortaya çıkaran Sabahattin Ali, bu kitabında güçlü bir tutkunun resimini çiziyor. Düzenin sildiği kişiliklere, yaşamın uçuculuğuna ve aşkın olanaksızlığına dair, yanıtlanması zor sorular soruyor.', 0, '9789753638029', 1869, 7.5, 2),
(10934, 'tr-tr', 539, 1, '9786054737345', '10066054', 'Bana Seni Seviyorum Deme Hissettir Miraç Çağ', '', 0, '9786054737345', 1869, 9.9, 2),
(10935, 'tr-tr', 219, 1, '9786050926316', '10066129', 'Konstantiniyye Oteli Zülfü Livaneli', 'Kitabın Özellikleri: <br>Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 476<br>En / Boy: 13,50 / 19,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ocak 2020<br><br>Kitabın Özeti: 2014 yılı Aralık ayının son günleri… Yedi yıldızlı Konstantiniye Oteli’nin açılış günü ve erken bir yılbaşı kutlaması… İstanbul’un seçkin, kalburüstü simaları, Sultanahmet’teki eski Bizans sarayının kalıntıları üzerine yapılan otelde bir araya geliyor. Aralarında kimler yok ki? Politikacılar, belediye başkanları, Amerikan büyükelçisi, Fener Rum patriği, ünlü gazeteciler, gazete patronları, televizyon “yıldızlar”ı, eski ve yeni zenginler, büyük işadamları… İstanbul’un yüzlerce yıldır yeraltında yatan ölüleri de davete çağrılmadıkları halde arzı endam etmekte sakınca görmeyip bu cümbüşe dahil oluyorlar. Ve elbette, bir otelin olmazsa olmaz çalışanları, garsonları, komileri, güvenlik görevlileri…\"Zülfü Livaneli, zengin bir insan panoramasıyla İstanbul’un derinliklerine inerken şehrin büyülü, ama bir o kadar da acımasız atmosferiyle buluşturduğu okuru sıra dışı yolculuğa çıkarıyor.\"', 0, '9786050926316', 1869, 37, 2),
(10936, 'tr-tr', 96, 1, '9789752202474', '10066219', 'Diriliş Çanakkale 1915 Turgut Özakman', '', 0, '9789752202474', 1869, 50, 2),
(10937, 'tr-tr', 96, 1, '9789752203631', '10066245', 'Cumhuriyet İkinci Kitap Turgut Özakman', '', 0, '9789752203631', 1869, 55, 2),
(10938, 'tr-tr', 219, 1, '9786050900286', '10066261', 'Serenad - Zülfü Livaneli', 'Kitabın Özellikleri:<br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 481<br>En / Boy: 13,50 / 19,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ocak 2020<br><br>Kitabın Özeti: Roman okumak istiyorsanız... Her şey, 2001 yılının şubat ayında soğuk bir gün, İstanbul Üniversitesi’nde halkla ilişkiler görevini yürüten Maya Duran’ın (36) ABD’den gelen Alman asıllı Profesör Maximilian Wagner’i (87) karşılamasıyla başlar. 1930’lu yıllarda İstanbul Üniversitesi’nde hocalık yapmış olan profesörün isteği üzerine, Maya bir gün onu Şile’ye götürür. Böylece, katları yavaş yavaş açılan dokunaklı bir aşk hikâyesine karışmakla kalmaz, dünya tarihine ve kendi ailesine ilişkin birtakım sırları da öğrenir. Serenad, 60 yıldır süren bir aşkı ele alırken, ister herkesin bildiği Yahudi Soykırımı olsun isterse çok az kimsenin bildiği Mavi Alay, bütün siyasi sorunlarda asıl harcananın, gürültüye gidenin hep insan olduğu gerçeğini de göz önüne seriyor. Okurunu sımsıkı kavrayan Serenad’da Zülfü Livaneli’nin romancılığının en temel niteliklerinden biri yine başrolde: İç içe geçmiş, kaynaşmış kişisel ve toplumsal tarihlerin kusursuz dengesi.', 0, '9786050900286', 1869, 40, 2),
(10939, 'tr-tr', 791, 1, '9789750823596', '10066276', 'Çiplak Deniz Bir Ada Hikayesi 4 Yaşar Kemal', '', 0, '9789750823596', 1869, 28, 2),
(10940, 'tr-tr', 219, 1, '9786050914443', '10066334', 'Kardeşimin Hikayesi Zülfü Livaneli', 'Kitabın Özeti: Serenad fırtınasından sonra Livaneli\'den nefes kesen bir roman…Sakin bir balıkçı köyünde genç bir kadının cinayete kurban gitmesiyle başlar her şey. Dünyadan elini eteğini çekmiş emekli inşaat mühendisiyle genç, güzel ve meraklı gazeteci kızın tanışmasına da bu cinayet vesile olur. Kurguyla gerçeğin karıştığı, duyguların en karanlık, en kuytu bölgelerine girildiği hikaye, daha doğrusu hikâye içinde hikaye de böylece başlar. Modern bir Binbir Gece Masalı\'nın kapıları aralanır. Ancak bu kez Şehrazad erkektir. Kardeşimin Hikayesi aşkın mutlulukta ulaşılacak son nokta olduğuna inananları bir kez daha düşünmeye davet eden, aşka, aşkın karmaşıklığına ve tehlikelerine dair nefes kesen bir roman. Her sayfada yeni bir gerçekliği keşfedecek, kuşku ile kesinliğin sınırlarında dolaşacaksınız. Mantıksız gibi geliyor ama o sabah uyandığımda tuhaf bir haber alacağımı biliyordum. Karadeniz\'in lacivert dalgalarıyla baş başa kalmış olan bu ıssız köyde geçen her gün birbirinin aynısı olduğu için burada insanların heyecanla konuşacağı olaylara pek sık rastlanmazdı. O günün de ötekiler gibi sessizce akıp gitmesi gerekirdi ama galiba başka şeyler olacaktı. O mahmur sabah saatlerinde bir cinayet haberi alacağımı bilmiyordum elbette ama bir haber gelecekti. Daha yataktan çıkmamıştım, gözlerim kapalıydı, arkalarında fosforlu çizgiler bırakarak yıldırım hızıyla hareket eden mor tavşanları izliyordum.', 0, '9786050914443', 1869, 32, 2),
(10941, 'tr-tr', 254, 1, '9789756093627', '10066464', 'Süpermen Türk Olsaydı Pelerinini Annesi Bağlardi', '', 0, '9789756093627', 1869, 18.51, 2),
(10942, 'tr-tr', 96, 1, '9789752201279', '10066983', 'Şu Çılgın Türkler Turgut Özakman', 'Kitabın Özellikleri:<br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye<br>Sayfa Sayısı: 752<br>En / Boy: 13,50 / 19,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Eylül 2016<br><br>Kitabın Özeti: 80 yıldır beklenen kitap… Dünyadaki en meşru, en ahlaklı, en haklı, en kutsal savaşlardan birinin, emperyalizme karşı verilmiş ve kazanılmış ilk kurtuluş savaşının, bir millileşme ihtilalinin romanı, şaşırtıcı bir yakın zaman destanı... Tüm yeni nesillere eşi olmayan bir armağan.', 0, '9789752201279', 1869, 50, 2),
