(10955, 'tr-tr', 810, 1, '8680018824939', '12021277', 'Kral Şakir Metalik Sticker', 'Eğlenceli Kral Şakir Metalik Sticker, çocukların istediği her yeri süslüyor. Metalize malzemeye uygulandığı için daha parlak ve daha canlı görünüme sahip olan bu ürün, kendine yapışkanlı ve uzun ömürlüdür. Üretimde sağlığa zararlı olabilecek boyalar kullanılmamaktadır.', 0, '8680018824939', 1870, 2.9, 2),
(10956, 'tr-tr', 810, 1, '8680018818945', '12027540', 'Kral Şakir Fosforlu Sticker, Karanlıkta Parlayan Sticker', 'Kendinden yapışkanlı PVC malzeme üzerine UV ofset basım tekniği ile basılan bu ürün, baskı sonrası ürün üzerine karanlıkta parlama efekti sağlayan Glow boya denilen malzeme kaplanmıştır. Kullanılan Glow boya uluslararası olan SGS firması tarafından EN71/3 testine tabi tutularak sağlığa zararlı olmadığı konusunda onay almıştır. Kullanılan PVC malzeme de test raporlu olup ağır metal ve fitalat içermemektedir. Fosfor olarak adlandırılan özel ve sağlığa zararı olmayan bir madde ile arkası kaplanarak ışık saçması sağlanan bu ürünle çocuk odasını uzun yıllar süsleyebilirsiniz. Duvar stickeri ürünlerimiz tamamen ilgili lisansların onayı ile Türkiye\'de tasarlanarak üretilmiştir. Ürünün boyutu ise 19 cm’dir.', 0, '8680018818945', 1870, 7.9, 2),
