(11173, 'tr-tr', 810, 1, '8682190041135', '12252011', 'Çift Tarafalı Yazı Tahtası Bemi', '%100 ahşaptan üretilmiştir. Boya ve kimyasal içermez, natüreldir. Yazı tahtasının bir tarafı beyaz, diğer tarafı ise kara tahtadır ve sadece beyaz tarafı manyetiktir. Beyaz yüzey için yazı tahtası kalemi kullanılması gerekirken kara tahta kısmında tebeşir ya da sıvı tebeşir kalemi kullanılması gerekmektedir. Her iki yüzeyin temizliği oldukça basittir. Nemli bir bez yardımıyla rahatça temizlenebilir. Ürünün alt kısmında bulunan tepsi kalem, tebeşir vb. birçok araç ve gereç için ideal bir saklama alanı oluşturur. Tepsi kapatılarak yazı tahtası kapanabilir ve böylece kullanılmadığında yer kaplamaz. Ürün beraberinde tebeşir, tahta kalemi ve yazı tahtası silgisi hediye olarak gönderilmektedir. Çevre ve sağlığa zararsız maddeler kullanılarak üretilmiştir. Ürün görsellerindeki renkler dijital ortam ile gerçek ortam arasındaki ufak farklılıklar içerebilir. Ağaç yapısından kaynaklı leke, budak ve dokular farklılık gösterebilir. <br><br>3 yaşından küçük çocuklar için uygun değildir.', 0, '8682190041135', 1870, 99.9, 2),
