(11256, 'tr-tr', 810, 1, '3026980509422', '11902034', 'Elmer\'s Siirli Sıvı 258 Ml', 'Okul döneminin vazgeçilmezi olan kırtasiye alışverişleri, ofis ve çalışma hayatının da vazgeçilmezi…İş hayatınızı kolaylaştıracak ofis ve kırtasiye malzemelerinizi Özdilekteyim.com’dan güvenli ve hızlı bir şekilde sitemizden satın alabilirsiniz.', 0, '3026980509422', 1870, 34.95, 2),
