(12455, 'tr-tr', 592, 1, '8695614711200', '12229160', 'Pirge Ecco Kıyma Bıçağı 26 Cm', 'Etleri, sebzeleri ve baharatları ince ince doğrayıp harmanlayabilir, en lezzetli köfteleri, kebapları hazırlamanıza yüksek ölçüde yardımcı olacaktır. Buzul ısıl işlem ile optimum sertlik, bilenmiş ve parlatılmış kesici ağız, hijyenik, PP plastik enjeksiyon, ergonomik sap yapısı ve hafif yapısı ile uzun süreli kullanım kolaylığı özelikleriyle uzun yıllar güvenle kullanılabilir. <br>Ebat Bilgileri: Uzunluk: 255 mm - Kalınlık: 2 mm - Genişlik: 50 mm', 0, '8695614711200', 1875, 99.95, 2),
(12456, 'tr-tr', 810, 1, '8695614380604', '12229161', 'Pirge Ecco Soğan Bıçağı 19 cm', 'İç ve Doğu Anadolu bölgelerinin olmazsa olmaz bıçağını, soğan doğramak dışında da salata, ezme yapımı ve kokoreç doğrama gibi işlerle kullanabilirsiniz.<br>Ebat Bilgileri: Uzunluk: 190 mm - Kalınlık: 2 mm - Genişlik: 70 mm', 0, '8695614380604', 1875, 49.95, 2),
(12457, 'tr-tr', 810, 1, '8695614490075', '12232812', 'Classic Biftek Bıçağı 12 Cm', 'Pişmiş etlerinizi keyifle dilimleyebileceğiniz klasik biftek bıçağı, mutfaktaki işlerinizi kolaylaştırmada da yardımı olacak. Sıcak dövme ve yüksek karbonlu Alman paslanmaz çeliği, mükemmel denge, parlatılmış kesici ağız ve alüminyum perçinlerle sağlamlaştırılmış POM plastik ergonomik sap yapısıyla güvenle uzun yıllar kullanılabilir. <br>Ebat Bilgileri: Uzunluk: 120 mm - Kalınlık: 3 mm - Genişlik: 19 mm', 0, '8695614490075', 1875, 159, 2),
(12458, 'tr-tr', 810, 1, '8695614490021', '12232813', 'Classic Fileto Bıçağı 16 Cm', 'Esnek yapısı sayesinde et ve balık filetolarınızı kolaylıkla pişirilebilir hale getirmenize yardımcı olur. Sıcak dövme ve yüksek karbonlu Alman paslanmaz çeliği, mükemmel denge, parlatılmış kesici ağız ve alüminyum perçinlerle sağlamlaştırılmış POM plastik ergonomik sap yapısıyla güvenle uzun yıllar kullanılabilir.<br>Ebat Bilgileri: Uzunluk: 160 mm - Kalınlık: 1,5 mm - Genişlik: 30 mm', 0, '8695614490021', 1875, 219, 2),
