(13282, 'tr-tr', 810, 1, '8680215123507', '12197735', 'Panther Mıknatıslı El Feneri PT-1032', 'Materyal: Plastik<br>Teslimat ve Kurulum Bilgileri:<br>Ürün resimlerindeki aksesuarlar teşhir amaçlı olup, fiyata dahil değildir.<br>Ürün demonte olarak gönderilmektedir.<br>Kurulum müşteriye aittir. <br>Basit el aletleri ile kolayca kurulum yapabilirsiniz. <br>Kargonuz teslim edildiğinde, ürünün paketinde deformasyon veya ürüne zarar verebilecek bir durum söz konusu ise kargo görevlisi ile birlikte paketi açarak ürünlerinizin durumunu kontrol ediniz. <br>Ürünlerinizde bir hasar gördüğünüz takdirde, kargo yetkilisinden tutanak tutmasını isteyiniz ve paketi teslim almayınız. <br>Tutanak tutulan ürünler kargo firması tarafından bize ulaştırılacak ve ürünlerin değişimi yapılacaktır.', 0, '8680215123507', 1877, 9.95, 2),
(13283, 'tr-tr', 810, 1, '8680215119951', '12197738', 'Panther El Feneri PT-1816', 'Ürün Özellikleri: <br>16 Süper Parlak LED<br>1 watt LED<br>8 saat aydınlatma<br>3 renk yeşil - kırmızı - turuncu<br>3xaa 1.5v pil kullanılır (Pil dahil değildir.)', 0, '8680215119951', 1877, 14.95, 2),
(13284, 'tr-tr', 810, 1, '8680215123477', '12339274', 'Panther El Feneri PT-1915', 'Ürün Özellikleri: <br>1watt LED<br>2 adet 5W COB LED<br>Mıknatıslı<br>Ergonomik yapısı kolay kullanım sağlar. <br>Ürünü kancası sayesinde rahatça taşıyabilir ve dilediğiniz yere asabilirsiniz. <br>3 X AAA 1.5 V pil ile çalışır.', 0, '8680215123477', 1877, 29.95, 2),
(13285, 'tr-tr', 810, 1, '8680215124221', '12339275', 'Panther El Feneri PT-915', 'Ürün Özellikleri:<br>2 faklı yanma konumlu<br>Ön tarafta COB LED<br>1 W Yan LED<br>3 adet AA PİL ile çalışır.<br>Piller dahil değildir.', 0, '8680215124221', 1877, 19.95, 2),
(13286, 'tr-tr', 810, 1, '8680215123521', '12339276', 'Panther Anahtarlık El Feneri pt-1840', 'Ürün Özellikleri: <br>COB LED<br>Plastik Gövde<br>Ergonomik yapısı kolay kullanım sağlar. <br>Ürün aynı zamanda anahtarlık olduğu için cepte taşınabilir.<br>On/Off düğmesine bir kere basıldığında çok ışık, iki kere basıldığında az ışık, üçüncü kere basıldığında flaşör yanar. <br>3 x AAA 1,5V Pil ile çalışır. <br><br>Kullanım Önerileri: Işık seviyesi azalmaya başladığında ürünün pilini değiştiriniz. <br>Ürünü parçalarına ayırmayınız. <br>Doğrudan göze tutmayınız. Aksi takdirde göz hasarına yol açabilir. <br>Dışarıda kullanırken yağmur ve kardan koruyunuz. <br>Yüksek ısı kaynakları yanında ve direkt güneş ışığına maruz bırakmayınız. <br>Ürünün bakımı nemli bezle yapılmalı, plastik kısımlara zarar vereceğinden dolayı asla güçlü kimyasallar kullanmayınız. <br>Çocukların oynamasına asla izin vermeyiniz. <br>Şarj edilebilir değildir, sadece pil ile çalışır.', 0, '8680215123521', 1877, 6.95, 2),
(13287, 'tr-tr', 810, 1, '2220111902651', '12124694', 'Briteman Uzaktan Kumandalı Renkli Ampul', 'Eğlenceli ve her yerde kullanılabilir olan bu ürün, son derece pratiktir. Retro tarzında olan ampul aynı zamanda işlevsel olmasıyla ışık ihtiyacınız olan her yere sabitlenebilir. Dolap, garaj, kamp çadırı gibi alanlarda rahatlıkla kullanabileceğiniz ampul, serin çalışır ve uzun ömürlüdür. <br>Özellikleri: <br>12 farklı renk seçeneği ve beş metreye kadar uzaktan kumanda kontrolü vardır. <br>Karartma ve zamanlayıcı fonksiyonları bulunur. <br>3 x AAA pil ile çalışır (dahil değildir). <br>Uzaktan Kumanda 1 x 2025 pil ile çalışır (dahildir).', 0, '2220111902651', 1877, 39.95, 2),
(13288, 'tr-tr', 810, 1, '2220111902668', '12124696', 'Briteman Bendy Boy Kitap Okuma Lambası ve Cihaz Tutucu', 'Ebat: 8,1 x 16,1 cm<br>Malzeme: Kauçuk<br><br>Kolayca şekil alabilen çok amaçlı kitap lambası ve cihaz tutucuyla telefon ve tablet gibi ürünlerinizi de rahatlıkla kullanabilirsiniz. 2 adet cr1220 pil ile çalışır (dahildir). 2 LED’lidir.', 0, '2220111902668', 1877, 29.95, 2),
(13289, 'tr-tr', 810, 1, '2220111902675', '12124697', 'Briteman Bendy Girl Kitap Okuma Lambası ve Cihaz Tutucu', 'Ebat: 8,1 x 16,1 cm<br>Malzeme: Kauçuk<br><br>Kolayca şekil alabilen çok amaçlı kitap lambası ve cihaz tutucuyla telefon ve tablet gibi ürünlerinizi de rahatlıkla kullanabilirsiniz. 2 adet cr1220 pil ile çalışır (dahildir). 2 LED’lidir.', 0, '2220111902675', 1877, 29.95, 2),
(13290, 'tr-tr', 810, 1, '2220111902682', '12124698', 'Briteman Çalışma Lambası', 'Mıknatıslı özelliği ve kanca aparatıyla çok amaçlı kullanabileceğiniz bu ürün, 3W COB LED özelliklidir. 3 x AA pil ile çalışmaktadır (dahil değildir).', 0, '2220111902682', 1877, 49.95, 2),
(13291, 'tr-tr', 810, 1, '2220111902699', '12124699', 'Briteman USB Led Lamba', 'Masa ve bilgisayarınıza takarak kullanabileceğiniz bu ürün, USB olarak da kullanılmaktadır. 3 LED ampul özelliklerine sahip ve 10x17 cm ebatlarındadır.', 0, '2220111902699', 1877, 39.9, 2),
(13292, 'tr-tr', 810, 1, '2220111902705', '12124700', 'Briteman Fener', 'Katlanabilir özelliğiyle yerden tasarruf eden bu ürün, masa lambası, gece lambası ve taşınabilir lamba olarak kullanılabilir. Ayarlanabilir askı aparatı bulunmaktadır. Dokunmatik açma kapama düğmesi mevcuttur. Açma kapama düğmesi ile ışık ayarı yapılabilmektedir. 3 x AAA pil ile çalışmaktadır (dahil değildir).', 0, '2220111902705', 1877, 89.9, 2),
(13293, 'tr-tr', 810, 1, '2220111902729', '12124702', 'Briteman Retro Avize Ampul', 'Mutfak, oturma odası, dolaplarınızda rahatlıkla kullanabileceğiniz ürünü aydınlatmanın ötesinde dekoratif amaçlarla da kullanabilirsiniz. Askı aparatıyla dilediğiniz yere asabileceğiniz ürünün vida dahil askı aparatı vardır. 1 LED (80 Lümen) ve 3 x AAA pil ile çalışmaktadır (dahil değildir).', 0, '2220111902729', 1877, 39.95, 2),
(13294, 'tr-tr', 810, 1, '2220111902736', '12124703', 'Briteman Retro Musluk Ampul', 'Banyolarınızda, dolap içlerinizde ve garajlarınızda rahatlıkla kullanabileceğiniz bu ürün, 3 x AAA pil ile çalışmaktadır (dahil değildir). Açma kapama düğmesi ve yüzeylere yapıştırmak için bant ya da asmak için vida delikleri mevcuttur (vida dahil değildir). 13x9,7 cm ebatlarındadır.', 0, '2220111902736', 1877, 39.95, 2),
