(13330, 'tr-tr', 810, 1, '5000394118461', '11571532', 'Duracell Şarj Aleti CEF 14', '15 dakika şarj = 4 saate kadar kullanım (2 AA pil şarj edilirken, sonuçlar cihaza ve kullanım şekillerine göre değişebilir). Her zaman hareket halindeyseniz, pillerinizin şarj olmasını beklemek için zamanınız yoktur. Konu ister tamamen şarj edilmiş bir bilgisayar oyunu konsolu ile çocuklarınızı eğlendirmek, isterse de heyecan verici yaşamınızın sayısız fotoğrafını çekmek olsun, gittiğiniz her yerde güvenebileceğiniz pillere ihtiyacınız var. Duracell Gelişmiş Şarj Cihazı, boş piller yüzünden durmak zorunda kalmak yerine devam etmenizi sağlayan hızlı ve taşınabilir çözümünüzdür. Bu yüksek hızlı şarj cihazı, 2 Aa pili yalnızca 45 dakikada şarj edebilir (Duracell 1,300 mAh AA NiMH piller kullanılırken yaklaşık %85 şarj). Pillerinizin hazır olması gereken o anlarda, size yalnızca 15 dakika şarjla 4 saate kadar kullanım imkanı sağlar (AA piller şarj edilirken; sonuçlar cihaza ve kullanım şekline göre değişebilir). 9 güvenlik özelliği hiçbir endişe duymadan devam etmenizi sağlar ve piller dolduktan sonra şarj cihazı aşırı ısınmayı önlemek için otomatik olarak kapanabilir. Bu şarj cihazı, Duracell’in uzun ömürlü gücüne her gün güvenebilmeniz için 10 yıllık Duracell garantisine sahiptir. Siz hızlı yaşamaya devam edin ve nerede olursanız olun pilleriniz yanınızda olsun', 0, '5000394118461', 1877, 139, 2),
(13331, 'tr-tr', 810, 1, '4008496525157', '10101273', 'Varta Longlife Alkalin 4\'Lü Kalem Pil', 'Sürekli ve düşük enerji ihtiyacı olan cihazlarda; örneğin TV ve müzik sistemlerinin uzaktan kumandalarında, duvar saatlerinde veya radyolarda çok verimlidir. <br>Piktogramlar ile en doğru yönlendirme<br>En yüksek kaliteyi sunduğumuzun kanıtı olarak “Made in Germany” ibaresi<br>Kullanılmamış pillerin daha iyi saklanması için blisterden tek tek çıkarabilme<br>10 yıl raf ömrü garantisi<br>DETAYLAR<br>VARTA Model 4106<br>IEC referansı LR6<br>Pil ölçüsü AA (kalem) <br>Çap 14.5 mm<br>Yükseklik 50.5 mm<br>Ağırlık 23.2 g<br>Elektrokimyasal sistem Alkalin manganez bazlı (ZN/MNO2) <br>Voltaj 1.5 V<br>', 0, '4008496525157', 1877, 17.9, 2),
(13332, 'tr-tr', 810, 1, '4008496525423', '10101287', 'Varta Pil Longlife Alkalin 9V', '(1,5 volt) Yüksek akım gerektiren cihazlar için tercih edilir fakat tek kullanımlık pillerdir esas amacı acil enerji ihtiyacınızı gidermektir, Örneğin bir digital fotoğraf makinesi için tercih edilebilir ancak sürekli fotoğraf çekmek isterseniz 1-2 günlük ihtiyacınıza cevap verebilir. Sürekli kullanım için ekonomik olmayabilirler. Ancak bir kol saati veya araç kumandası için çok uygun bir pil modelidir aylarca veya yıllarca kullanabilirsiniz. Çinko pillere göre yaklaşık 10 kata kadar daha fazla enerji depolayabilirler. Halk arasında akmayan pil denilmesine rağmen herhangi model şarj edilemeyen bir pili cihaz içerisinde bekletmeyiniz tavsiye edilmez aksi halde cihaz içerisinde bekletilen her türlü şarj edilemeyen pil akmaya başlar ve hem cihazınıza zarar verir hem de ortaya çıkan kimyasallar sağlık sorunları yaratabilir. Başlıca çeşitleri, AAA ince kalem pil, AA Kalem pil, C orta boy pil, D büyük boy pil, 9 volt pildir ve daha birçok ara çeşitleri mevcuttur.', 0, '4008496525423', 1877, 17.9, 2),
(13333, 'tr-tr', 810, 1, '4008496525072', '10101323', 'Varta Longlife 4\'Lü İnce Alkalin Pil', 'Piktogramlar ile en doğru yönlendirme<br>En yüksek kaliteyi sunduğumuzun kanıtı olarak “Made in Germany” ibaresi<br>Kullanılmamış pillerin daha iyi saklanması için blisterden tek tek çıkarabilme<br>10 yıl raf ömrü garantisi<br>DETAYLAR<br>VARTA Model 4103<br>IEC referansı LR03<br>Pil ölçüsü AAA (ince kalem) <br>Çap 10.5 mm<br>Yükseklik 44.5 mm<br>Ağırlık 11.3 g<br>Elektrokimyasal sistem Alkalin manganez bazlı (ZN/MNO2) <br>Voltaj 1.5 V<br>', 0, '4008496525072', 1877, 17.9, 2),
