(13614, 'tr-tr', 574, 1, '8681692100043', '11157428', 'Pawpaw Köpek Maması 15 Kg Kuzu Pirinç', 'İçindekiler: Kurutulmuş dana eti, pirinç, mısır, irmik altı un (ya da buğday),tavuk yağı, bira mayası, balık yağı, kurutulmuş şeker pancarı, vitaminler, mineraller. <br><br>Sağlıklı deri ve parlak tüylerin korunması ve oluşmasına yardımcı olur. Balık yağının içerdiği Omega-3 ve tavuk yağının içerdiği Omega-6 ile sağlıklı deri ve parlak tüy oluşumuna katkı sağlar.', 0, '8681692100043', 1881, 99.95, 2),
(13615, 'tr-tr', 810, 1, '5900951017261', '11170581', 'Pedigree Pouch Köpek Maması Etli 100 Gr', 'Uzun yıllar yapılan araştırmalardan sonra anlaşıldı ki, sağlıklı ve lezzetli yemeğin/mamanın sırrı iyi, doğal ve kaliteli malzeme kullanmak. Bizim reçetelerimizde taze etin kullanılmasının, etin hiçbir şekilde dondurulmamasının veya işlenmemesinin sebebi de bu. Köpeğinize kaliteli, lezzetli ve doğal beslenme imkanı sunmak. Köpeğinizin ergen yıllarında seçtiğiniz mama onun sağlığında önemli rol oynar. Pedigree® ona bütün ihtiyacı olan, sağlıklı ve neşeli bir köpek olmasını sağlayan temel besinleri verir. <br> Bileşenler: Et ve hayvansal yan ürünler (%39, %4 sığır eti içerir), mineraller, sebze kaynaklı ürünler (%0.5 kurutulmuş pancar küspesi içerir), bitkisel ve hayvansal yağlar (%0.5 ayçiçek yağı içerir), sebze protein ekstraktları. <br>Analitik Bileşenler (%): protein: 7; yağ içeriği: 6; inorganik madde: 2; ham selüloz: 0.3; nem: 82.5; kalsiyum: 0.35. <br>Kg Başına Katkı Maddeleri: Besinsel katkılar: Vitamin D₃: 150 IU, Vitamin E: 50 mg, Kalsiyum iyodat anhidre: 0.39 mg, Bakır sülfat pentahidrat: 5.7 mg, Demir sülfat monohidrat: 10 mg, Mangan sülfat monohidrat: 5.6 mg, Çinko sülfat monohidrat: 107 mg / Teknolojik katkılar: Çin tarçını zamkı (1 E 499): 2100 mg. <br><br>Ürün Özellikleri<br>Tahıllı – İthal – Yetişkin – Sığır Aroması - Sınıf: Premium - Cinsi: Jöle, Parça Etli <br>', 0, '5900951017261', 1881, 4.95, 2),
