(13626, 'tr-tr', 339, 1, '8697460311313', '10101910', 'Goody Yüksek Enerjili Yetişkin Köpek Maması 2.5Kg', 'GOODY YÜKSEK ENERJİLİ KÖPEK MAMASI 2.5 KG 1 yaş üzeri fazla enerji harcayan aktif köpeklerin tüm besin ihtiyaçlarını karşılayacak şekilde özel olarak tasarlanmış 100 doğal içerikli yetişkin köpek mamasıdır. Yüksek performanslı köpekler için gerekli yüksek kalitede proteinler içerir. Dengeli Omega 6 ve Omega 3 içeriği ile sağlıklı tüyler ve güçlü bir bağışıklık sistemi oluşmasını sağlar. Sindirim sistemi için gerekli olan lif oranı dengelenerek hazırlanmıştır. 25 vitamin ve mineral içeriği ile metabolizma işleyişinin sağlıklı ve dengeli olmasını sağlar. Sindirim oranı yüksek karbonhidrat kaynakları içerir. İçeriğindeki vitaminler, mineraller ve çinko, sağlıklı ve parlak tüyler, fiziksel strese karşı yüksek direnç sağlar. Besleyici ve lezzetlidir. Özel Şekil ve yoğunluğu ile sağlıklı dişler ve stressiz bir sindirim sistemi faliyeti sağlar. A, D, E ve C vitamini ilavesi ile daha geç yaşlanma ve güçlü bir bağışıklık sistemi oluşumunu destekler. Mamanın İçeriği; Tahıl ürünleri, et ve et yan ürünleri tavuk, koyun, sığır eti, bitkisel protein kaynakları, hayvansal yağlar, tuz, vitamin ve mineraller. Beslenme Tavsiyesi; Yukarıdaki günlük beslenme miktarları, köpeğinizin aktivitesine, egzersiz durumuna, çevre şartlarına, mizacına ve strese bağlı olarak değişiklik gösterir. Yukarıdaki miktarlar optimal vücut ağırlığı sağlamaya yönelik olarak gerektiğinde arttırılabilir veya azaltılabilir.', 0, '8697460311313', 1881, 36.9, 2),
(13627, 'tr-tr', 339, 1, '8697460311115', '10101920', 'Goody Yavru Köpek Maması 2.5Kg', 'Dengeli kalsiyum ve fosfor içeriği sağlıklı diş ve kemik oluşumunu destekler. Sindirim oranı yüksek protein içeriği ile sağlıklı vücut gelişimine ve güçlü kas yapısına destek olur. İçeriğindeki aminoasit ve vitaminler güçlü bağışıklık sisteminin gelişmesini sağlar. Kaliteli yağ içeriği dostunuza ihtiyaç duyduğu yeterli enerjiyi verir.', 0, '8697460311115', 1881, 36.9, 2),
