(13631, 'tr-tr', 339, 1, '8697460311214', '10101949', 'Goody Yetişkin Köpek Maması 2.5 Kg', 'GOODY YETİŞKİN KÖPEK MAMASI 2.5 KG Günlük beslenme miktarları, köpeğinizin aktivitesine, egzersiz durumuna, çevre şartlarına, mizacına ve strese bağlı olarak değişiklik gösterir. Miktarlar optimal vücut ağırlığı sağlamaya yönelik olarak gerektiğinde arttırılabilir veya azaltılabilir. 1 yaş üzeri köpeklerin tüm besin ihtiyaçlarını karşılayacak şekilde özel olarak tasarlanmış 100 doğal içerikli yetişkin köpek mamasıdır. Yetişkin köpekler için gerekli yüksek kalitede proteinler içerir. Dengeli Omega 6 ve Omega 3 içeriği ile sağlıklı tüyler ve güçlü bir bağışıklık sistemi oluşmasını sağlar. Sindirim sistemi için gerekli olan lif oranı dengelenerek hazırlanmıştır. 25 vitamin ve mineral içeriği ile metabolizma işleyişinin sağlıklı ve dengeli olmasını sağlar. Sindirim oranı yüksek karbonhidrat kaynakları içerir. İçeriğindeki vitaminler ve çinko, sağlıklı ve parlak tüyler sağlar. Besleyici ve lezzetlidir. Özel şekil ve yoğunluğu ile sağlıklı dişler ve stressiz bir sindirim sistemi faliyeti sağlar. A, D, E ve C vitamini ilavesi ile daha geç yaşlanma ve güçlü bir bağışıklık sistemi oluşumunu destekler. Mamanın İçeriği; Tahıl ürünleri, et ve et yan ürünleri tavuk, koyun, sığır eti, bitkisel protein kaynakları, hayvansal yağlar, tuz, vitamin ve mineraller.', 0, '8697460311214', 1881, 36.9, 2),
(13632, 'tr-tr', 810, 1, '5998749120927', '10101965', 'Pedigree Biftek Ve Sebzeli Kuru Köpek Maması 2 Kg', 'Yetişkin köpekler için üretilen, <span style=\"font-weight:bold;\">Pedigree Kuru Biftek ve Sebzeli Köpek Maması 2 Kg</span>\'ı ve diğer evcil hayvan ürünlerini, ozdilekteyim.com\'dan anında temin edebilirsiniz. <br><br><span style=\"font-weight:bold;\">Pedigree Kuru Biftek ve Sebzeli Köpek Maması 2 Kg</span>, harika çıtır bir atıştırmalıktır. ', 0, '5998749120927', 1881, 59.95, 2),
(13633, 'tr-tr', 810, 1, '5998749110409', '10101974', 'Pedigre Jumbone Biftekli Köpek Ödül Bisküvisi 160 Gr', 'Sevimli dostunuzu ödüllendirirken bakım da yapmanızı sağlayan bu mama, 4 kg üzeri yetişkin köpekler için kullanıma uygundur. Diş eti hastalığı, plak ve tartar oluşumunun yoğun olduğu öğütücü dişlerin arka yüzeylerinde derinlemesine temizlik sağlar. Özel formülü sayesinde çiğneme sırasında dişlerin ve dişetlerinin sağlıklı kalmasına yardımcı olur. <br>Ürün İçeriği: Tahıllar, çeşitli şekerler, et ve et ürünleri (% 4,00 sığır eti), bitkisel menşeli ürünler (soya, bezelyeler), mineraller, tohumlar.', 0, '5998749110409', 1881, 11.95, 2),
(13634, 'tr-tr', 810, 1, '5998749120811', '10101977', 'Pedigree Kümes Hayvanlı Ve Biftekli Köpek Maması 2.6Kg', 'Köpeğinizin 4 temel ihtiyacına yönelik tasarlanan yeni Pedigree, köpeğinizin ağız sağlığını korumaya yardımcıdır. Sağlıklı sindirim sistemi ve optimal besin emilimine destek olur. Köpeğinizin deri ve tüylerinin daha iyi görünmesini sağlayacak ayçiçek yağı ve çinko içerir. E vitamini içerir. E vitamini antioksidandır ve içerdiği mineraller bağışıklık sistemini güçlendirmeye yardımcı olur. <br>İçindekiler: Tahıllar, et ve et türevleri (kahverengi parçalar % 4 sığır eti içerir, bej renkli parçalar %4 kümes hayvanı içerir), bitkisel ve hayvansal yağlar (% 0.5 ayçiçek yağı), mineraller, sebze kaynaklı ürünler. (%0.5 şeker pancarı posası, %0.2 hindiba karışımı)<br>Kilogram Başına Katkı Maddeleri: Antioksidanlar Besin: Katkı Maddeleri: A vitamini: 8500 IU/kg, D3 vitamini: 940 IU/kg, E vitamini: 270 mg/kg, Bakır sülfat pentahidrat 11 mg/kg, Mangan sülfat monohidrat 100 mg/kg, Potasyum iyodür 1 mg/kg, Çinko sülfat monohidrat 450 mg/kg.', 0, '5998749120811', 1881, 66.95, 2),
(13635, 'tr-tr', 810, 1, '5998749108147', '10101989', 'Pedigree Dentastix Köpek Ödül Bisküvisi 110Gr', 'Yetişkin köpekler için üretilen, <span style=\"font-weight:bold;\">Pedigree Dentastix Köpek Ödül Bisküvisi 110 Gr.</span> ve diğer <span style=\"font-weight:bold;\">evcil hayvan ürünleri</span>ni, <span style=\"font-weight:bold;\">ozdilekteyim.com</span>\'dan anında temin edebilirsiniz.<br><br>', 0, '5998749108147', 1881, 16.95, 2),
(13636, 'tr-tr', 810, 1, '5900951015830', '10102007', 'Pedigree Sığır Etli Konserve Köpek Maması 400Gr', '1 yaş üzeri tüm ırk, yetişkin köpekler için sağlıklı ve dengeli beslenmeye uygun, jöle içerisinde sığır etli köpek konservesidir. Pedigree Select Cuts With Beef Biftekli Yetişkin Köpek Maması, köpeğinizin yetişkin döneminde, sağlıklı bir form yakalaması için fazlasıyla tavsiye edilen bir köpek mamasıdır. <br>&nbsp; Mamanın İçeriği: Et ve et yan ürünleri %4 sığıreti,%4 taze et, bitkisel ve Hayvansal yağlar, sebze kaynaklı ürünler, mineraller. <br>Mamanın Analizi: Ham protein %8,ham yağ %5.50,ham selüloz %0,30,ham kül %3,nem %80,E vitamini 50 mg,d3 vitamini 150 IU, kalsiyum 0,40mg,bakır sülfat 6mg,demir sülfat 10mg,mangan sülfat 6mg,çinko sülfat 107mg. <br> * Açıldıktan sonra buzdolabında muhafaza edilmeli, maksimum 3 gün içerisinde tüketilmelidir.', 0, '5900951015830', 1881, 12.95, 2),
(13637, 'tr-tr', 810, 1, '7613031395484', '10102048', 'Friskies Etli Köpek Maması 10 kg', 'Friskies Etli Aktif Köpek Maması, enerjisi asla bitip tükenmeyen sevimli dostlarınız için tercih edebileceğiniz lezzetli ve besleyicidir. Köpeklerin çok sevdiği bu etli köpek maması, onlara gün içinde ihtiyaç duydukları enerjiyi sağlar.', 0, '7613031395484', 1881, 109.95, 2),
