(13639, 'tr-tr', 294, 1, '7613037346053', '12223310', 'Felix Pouch Yavru Yaş Kedi Maması Etli 100 gr', 'Yavru kediler için jöle içerisinde gerçek sığır eti parçacıkları içeren, lezzetli konserve, yaş kedi mamasıdır. Vitamin, mineral ve omega 6 içermektedir. Tazeliğini koruyan alüminyum folyo poşet içerisinde, tek kullanımlıktır. <br><br>İçindekiler: Et ve et ürünleri (% 4 sığır eti), bitkisel protein ekstratları, balık ve balık ürünleri, mineraller, çeşitli şekerler. Konservenin Analizi;Ham protein % 15,4, ham yağ % 3,6, ham selüloz % 0,1, su % 75,00, omega 6 % 0,2, demir 13,5 IU/kg, iyot 0,5 IU/kg, bakır 1,3 IU/kg, manganez 2,4 IU/kg, A vitamini 1415 IU/kg, D3 vitamini 195 IU/kg, E vitamini 16 mg/kg, çinko 36,5 IU/kg, selenyum 0,03 IU/kg. <br><br>Beslenme Tavsiyesi: 1,5 -3 aylığa kadar olan yavru kediler için, günlük 2 - 3 öğün olarak 1 - 4 paket, 3 - 6 aylığa kadar olan yavru kediler için günlük 2 öğün olarak 2 - 4,5 paket, 6 - 12 aylığa kadar olan yavru kediler için günlük 2 öğün olarak 4,5 - 5 paket verilmesi tavsiye edilmektedir.', 0, '7613037346053', 1882, 4.95, 2),
(13640, 'tr-tr', 810, 1, '7613036964043', '12233821', 'Friskies Pouch Yaş Kedi Maması Tavuklu 85 gr', 'Friskies konserve ürünleri doğal ve katkısızdır, yapay renklendirici ve aroma içermez, sağlıklı kedi beslenmesi için yapılan son bilimsel bulgulara uygun olarak üretilir. İçindekiler Kedi Konservesi yüksek protein ve dengeli yağar ile tam bir besin deposudur. İlave olarak koruyucu veya kedinizin sindirimini zorlaştıracak katkı maddesi bulunmamaktadır.<br><br>İçindekiler: Et ve hayvansal türevler (%4\'ü tavuk) Tahıllar, Balık ve balık türevleri, Mineraller, Çeşitli şekerler Bileşenleri Nem 82.5%, Protein: 7.4%, Yağ içeriği: 3,5%, Ham kül: 2,2%, Ham selüloz: 0,07%', 0, '7613036964043', 1882, 3.75, 2),
