(13649, 'tr-tr', 149, 1, '8681749191215', '11587637', 'Catwalk Kedi Kumu 10 L', 'Catwalk Premium Cat Litter kedi kumu bentonit kumundan üretilmiş olup kedinizin sağlığına zarar verebiIecek hiçbir madde içermez. Anında topaklanır ve sıvıyı kısa sürede absorbe eder. İdeal bir topaklanma özelliğine sahiptir. Sıkı ve çabuk topaklar oluşturur. Catwalk Premium Cat Litter kedi kumu içeriğinde bulunan doğal minaraller sayesinde kediniz için bir anti-stres ortamı sağlanır. Kediniz tarafından yanIışlıkla yutulması durumunda dahi metabolizmasına zarar vermez.', 0, '8681749191215', 1882, 26.9, 2),
(13650, 'tr-tr', 149, 1, '8681749191246', '11866639', 'Catwalk Kedi Kumu Baby Powder 5 L', 'Catwalk Premium Cat Litter kedi kumu bentonit kumundan üretilmiş olup kedinizin sağlığına zarar verebiIecek hiçbir madde içermez. <br>Anında topaklanır ve sıvıyı kısa sürede absorbe eder. İdeal bir topaklanma özelliğine sahiptir. Sıkı ve çabuk topaklar oluşturur. <br><br>ANTI - STRESS<br>Catwalk Premium Cat Litter kedi kumu içeriğinde bulunan doğal mineraller sayesinde kediniz için bir anti-stres ortamı sağlanır. <br>Kediniz tarafından yanIışlıkla yutulması durumunda dahi metabolizmasına zarar vermez. <br><br>YÜKSEK EMİŞ GÜCÜ<br><br>Ham maddesinde kullanılan doğal minerallerin moleküler yapıları çok yüksek sıvı emiş gücüne sahiptir. <br>Bu sayede su ve koku emiş kapasitesi oldukça yüksektir. Uzun süreli kullanımlarda dahi mükemmel bir kuruluk sağlayarak kedinize sağlıklı ve hijyenik tuvalet ortamı sunar. <br><br>EV DOSTU<br><br>Bentonit madenden çıkarıldıktan sonra herhangi bir kimyasal işlem görmeden doğal hali ile kullanıma sunar. <br>Bu sayede ev dostu ve insan sağlığına zararsızdır. <br>', 0, '8681749191246', 1882, 16.9, 2),
