(13654, 'tr-tr', 615, 1, '7613035614482', '11529184', 'Purina One Junior Kedi Maması Tavuklu 800 Gr', 'İçindekiler: Tavuk eti (%17), kurutulmuş kanatlı proteini, mısır glüten unu, tam buğday (%12), hayvansal yağ, soya unu, buğday glüten unu, mısır nişastası, bezelye proteini konsantresi, kurutulmuş hindiba kökü (%2), mineraller, mısır, sakatat, maya (%1), balık yağı. <br><br>Kullanımı: Günlük beslenme miktarları için tabloya bakınız. Bu değerler tavsiye olup, kedinizin ideal vücut kondisyonunu korumak için, aktivite seviyesine, çevre koşullarına ve yaşına göre değişkenlik gösterebilir. Başlangıçta yavru kedinizin ürünü daha kolay yemesini sağlamak amacıyla su ile nemlendirerek verebilirsiniz ve kediniz büyüdükçe, daha kolay yemeye başladıkça mamayı ıslattığınız su miktarını azaltabilirsiniz. Kedinizin sağlığı için onu düzenli olarak veteriner hekime götürünüz. Purina One yavru kedi maması ile kedinizi ilk defa beslemeye başladığında, kullandığınız mama ile birlikte karıştırarak kedinize vermenizi tavsiye eder, 7 günlük bir süre içerisinde mevcut mamanızdan tamamıyla Purina One kedi mamasına geçişi sağlıklı bir şekilde gerçekleştirmenizi öneririz. Kuru ve serin yerde muhafaza ediniz.', 0, '7613035614482', 1882, 50.95, 2),
(13655, 'tr-tr', 615, 1, '7613033635571', '11529185', 'Purina One Sterilcat Kedi Maması Somonlu 800 Gr', 'Veteriner hekimleri ve beslenme uzmanları tarafından kısırlaştırılmış kedinizin sağlıklı bir metabolizmaya sahip olmasını sağlamak ve idrar yolları sağlığını korumak amacıyla özenle formüle edilmiştir.', 0, '7613033635571', 1882, 50.95, 2),
(13656, 'tr-tr', 615, 1, '7613031384600', '11529186', 'Purina One Sterilcat Kedi Maması Sığır Etli 800 Gr', 'Özellikler: <br><br>Özel formülü sayesinde kedinizin savunma mekanizmasının güçlendirilmesine destek olur. Kısırlaştırılmış kedinizin sağlıklı bir metabolizmaya sahip olmasını sağlamak için özel olarak formüle edilmiştir. Yüksek protein içeriği sayesinde kilo kontrolü sağlar. (yetişkin formülasyonlara oranla %15 daha fazla) Dengeli mineral içeriği sayesinde idrar yolları sağlığını destekler. Yüksek kaliteli içerikler sayesinde yüksek besinsel emilim ve yüksek sindirilebilirlik düzeyine sahiptir. Dişlerde tartar oluşumunu %40’a kadar azalttığı kanıtlanmıştır.', 0, '7613031384600', 1882, 50.95, 2),
(13657, 'tr-tr', 615, 1, '8002205319903', '11529187', 'Purina One Adult Kedi Maması Tavuklu 800 Gr', 'Özellikler: <br><br>Özel formülü sayesinde kedinizin savunma mekanizmasının güçlendirilmesine destek olur. Kısırlaştırılmış kedinizin sağlıklı bir metabolizmaya sahip olmasını sağlamak için özel olarak formüle edilmiştir. Yüksek protein içeriği sayesinde kilo kontrolü sağlar. (yetişkin formülasyonlara oranla %15 daha fazla) Dengeli mineral içeriği sayesinde idrar yolları sağlığını destekler. Yüksek kaliteli içerikler sayesinde yüksek besinsel emilim ve yüksek sindirilebilirlik düzeyine sahiptir. Dişlerde tartar oluşumunu %40’a kadar azalttığı kanıtlanmıştır.', 0, '8002205319903', 1882, 50.95, 2),
