(13659, 'tr-tr', 615, 1, '7613035511774', '11529189', 'Purina One Sterilcat Kedi Maması Somonlu 1.5 Kg', 'Purina One ürünlerini kullanmaya başladıktan sonra kedinizde gözle görülür bir değişim göreceğinizden eminiz! <br>Purina One kısır kedi mamaları uzman veteriner hekimler tarafından değerlendirilmiş ve kullanımına onay verilmiştir. Kedinizin sağlıklı bir metabolizmaya sahip olması ve idrar yollarını koruması yönünde formülize edilmiştir. <br>Yüksek protein içeriği, düşük yağ oranı ve ortalama oranda karbonhidrat içeriği sayesinde kısır kedilerinizin daha sağlıklı bir metabolizmaya sahip olmasını desteklicek ve kilo kontrolünü kolaylaştırabilmek için özel bir formülasyona sahiptir. <br>Özel formülü sayesinde kedinizin savunma mekanizmasını da güçlendirmektedir. <br>*Kısırlaştırılmış kedinizin sağlıklı bir yapıya sahip olması için özel olarak formülize edilmiştir. <br>*Yüksek protein içeriği sayesinde kilo kaybını engeller. <br>*Dengeli mineral içeriği sayesinde idrar yolları sağlığını destekler. <br>*Dişlerde tartar oluşumunu %40\'a kadar azalttığı kanıtlanmıştır.<br>', 0, '7613035511774', 1882, 86.95, 2),
(13660, 'tr-tr', 615, 1, '7613035614437', '11529190', 'Purina One Adult Kedi Maması Tavuklu 1.5 Kg', 'Özellikler: <br><br>Özel formülü sayesinde kedinizin savunma mekanizmasının güçlendirilmesine destek olur. Kısırlaştırılmış kedinizin sağlıklı bir metabolizmaya sahip olmasını sağlamak için özel olarak formüle edilmiştir. Yüksek protein içeriği sayesinde kilo kontrolü sağlar. (yetişkin formülasyonlara oranla %15 daha fazla) Dengeli mineral içeriği sayesinde idrar yolları sağlığını destekler. Yüksek kaliteli içerikler sayesinde yüksek besinsel emilim ve yüksek sindirilebilirlik düzeyine sahiptir. Dişlerde tartar oluşumunu %40’a kadar azalttığı kanıtlanmıştır.', 0, '7613035614437', 1882, 86.95, 2),
(13661, 'tr-tr', 615, 1, '7613034765239', '11529191', 'Purina One Sterilcat Kedi Maması Somonlu 200 Gr', 'Purina One ürünlerini kullanmaya başladıktan sonra kedinizde gözle görülür bir değişim göreceğinizden eminiz!<br>Purina One kısır kedi mamaları uzman veteriner hekimler tarafından değerlendirilmiş ve kullanımına onay verilmiştir. Kedinizin sağlıklı bir metabolizmaya sahip olması ve idrar yollarını koruması yönünde formülize edilmiştir.<br>Yüksek protein içeriği, düşük yağ oranı ve ortalama oranda karbonhidrat içeriği sayesinde kısır kedilerinizin daha sağlıklı bir metabolizmaya sahip olmasını desteklicek ve kilo kontrolünü kolaylaştırabilmek için özel bir formülasyona sahiptir. Özel formülü sayesinde kedinizin savunma mekanizmasını da güçlendirmektedir. <br>*Kısırlaştırılmış kedinizin sağlıklı bir yapıya sahip olması için özel olarak formülize edilmiştir. <br>*Yüksek protein içeriği sayesinde kilo kaybını engeller. <br>*Dengeli mineral içeriği sayesinde idrar yolları sağlığını destekler. <br>*Dişlerde tartar oluşumunu %40\'a kadar azalttığı kanıtlanmıştır.', 0, '7613034765239', 1882, 17.5, 2),
(13662, 'tr-tr', 615, 1, '7613034552051', '11529612', 'Purina One Adult Kedi Maması Tavuklu 200 Gr', 'Purina One yetişkin kedi maması, kedinizde gözle görülür bir değişim yaratacaktır. Yüksek sindirilebilir özelliğinden dolayı kedinizin dışkısında herhangi bir bozukluk ya da aşırı katılaşma olmaz. <br>Purinanın tüm ürünleri uzman veteriner hekimler tarafından onaylanmıştır. Bir numaralı içeriği yüksek kaliteli protein kaynağı olan gerçek ettir. <br>Özel eşsiz formülasyonu sayesinde kedinizin doğal savunma mekanizmasının güçlendirilmesine destek sağlar. <br>*Dişlerde tartar oluşumunu engelleme oranı %40 oranındadır ve bu bilimsel olarak kanıtlanmıştır.<br>*Dengeli mineral içeriği sayesinde idrar yolları sistemi sağlığını destekler. <br>*Yüksek kaliteli içerikler sayesinde oldukça yüksek sindirilebilme düzeyine sahiptir. <br>*Mineraller ve D vitamini içeriği sayesinde sağlıklı ve güçlü kemik oluşumuna yardımcı olmaktadır. <br>', 0, '7613034552051', 1882, 17.5, 2),
(13663, 'tr-tr', 615, 1, '7613034552488', '11529613', 'Purina One Junior Kedi Maması Tavuklu 200 Gr', 'Gözle görünür bir sağlık için yavruluk dönemine özel beslenme formülasyonu PURINA ONE Junior, gelişim evresindeki yavru kedilerin özel besinsel ihtiyaçlarına uygun olarak özenle formüle edilmiştir ve yavru kedilerin yaşamsal fonksiyonlarının sağlıklı gelişimine yardımcı olur. <br> Yüksek protein (%41) ve dengelenmiş mineral içeriğine sahiptir. Böylece yavru kedilerin besinsel ihtiyaçlarını karşılayarak, sağlıklı kas kütlesi ve güçlü kemik gelişimini destekler; sağlıklı büyümeye katkı sağlar. Özel formülü sayesinde kedinizin doğal savunma mekanizmasının güçlendirilmesine destek olur. <br>İleri derecede sindirilebilir olduğu ve iyi bir dışkı kalitesini destekleyen, sindirim sistemi tarafından emilmeye hazır yüksek kaliteli besinsel içerikler ile formüle edildiği Purina veteriner hekimleri ve beslenme uzmanları tarafından onaylanmıştır. Bir numaralı içeriği yüksek kaliteli protein kaynağı olan gerçek ettir. <br>Anne sütünde de doğal olarak bulunan ve doğal kaynaklardan sağlanan DHA içeriği sayesinde yavru kedilerin beyin ve göz sağlığının gelişimini desteklediği ispatlanmıştır. <br>Yüksek düzeyde protein içeriği ile birlikte dengeli mineral içeriği sayesinde kas kütlesi ve iskelet sisteminin sağlıklı gelişimini destekler. <br>Büyüme dönemine özel olarak uyarlanmış beslenme içeriği sayesinde hayati fonksiyonların sağlıklı gelişimine yardımcıdır. <br>Yüksek kaliteli içerikler sayesinde yüksek sindirilebilirlik düzeyine sahiptir. <br>Esansiyel besleyiciler ve kıtır mama taneleri sayesinde diş ve diş eti sağlığını destekler. <br>', 0, '7613034552488', 1882, 17.5, 2),
(13664, 'tr-tr', 615, 1, '7613034552372', '11529614', 'Purina One Sterilcat Kedi Maması Sığır Etli 200 Gr', 'Purina One kısır kedi mamaları uzman veteriner hekimler tarafından değerlendirilmiş ve kullanımına onay verilmiştir. Kedinizin sağlıklı bir metabolizmaya sahip olması ve idrar yollarını koruması yönünde formülize edilmiştir. <br>Yüksek protein içeriği, düşük yağ oranı ve ortalama oranda karbonhidrat içeriği sayesinde kısır kedilerinizin daha sağlıklı bir metabolizmaya sahip olmasını destekleyecek ve kilo kontrolünü kolaylaştırabilmek için özel bir formülasyona sahiptir. <br>Özel formülü sayesinde kedinizin savunma mekanizmasını da güçlendirmektedir. <br>*Kısırlaştırılmış kedinizin sağlıklı bir yapıya sahip olması için özel olarak formülize edilmiştir. <br>*Yüksek protein içeriği sayesinde kilo kaybını engeller. <br>*Dengeli mineral içeriği sayesinde idrar yolları sağlığını destekler. <br>*Dişlerde tartar oluşumunu %40\'a kadar azalttığı kanıtlanmıştır. <br>', 0, '7613034552372', 1882, 17.5, 2),
(13665, 'tr-tr', 149, 1, '8681749191208', '11568314', 'Catwalk Kedi Kumu 5 L', 'Catwalk Premium Cat Litter kedi kumu bentonit kumundan üretilmiş olup kedinizin sağlığına zarar verebiIecek hiçbir madde içermez. <br>Anında topaklanır ve sıvıyı kısa sürede absorbe eder. İdeal bir topaklanma özelliğine sahiptir. Sıkı ve çabuk topaklar oluşturur. <br><br> ANTI - STRESS<br><br>Catwalk Premium Cat Litter kedi kumu içeriğinde bulunan doğal minaraller sayesinde kediniz için bir anti-stres ortamı sağlanır. <br>Kediniz tarafından yanIışlıkla yutulması durumunda dahi metabolizmasına zarar vermez. <br><br>YÜKSEK EMİŞ GÜCÜ<br><br>Ham maddesinde kullanılan doğal minerallerin moleküler yapıları çok yüksek sıvı emiş gücüne sahiptir. <br>Bu sayede su ve koku emiş kapasitesi oldukça yüksektir. Uzun süreli kullanımlarda dahi mükemmel bir kuruluk sağlayarak kedinize sağlıklı ve hijyenik tuvalet ortamı sunar. <br>', 0, '8681749191208', 1882, 16.9, 2),
(13666, 'tr-tr', 175, 1, '8697353425165', '11375386', 'Cronypet Kedi Maması 100 Gr', 'İçindekiler: Kurutulmuş tavuk eti, pirinç, mısır, irmik altı unu (ya da buğday) tavuk yağı, bira mayası, balık yağı, vitaminler ve mineraller.<br>CronyPet bir Özdilek markasıdır ve Özdilek adına özel olarak üretilmiştir.', 0, '8697353425165', 1882, 2.25, 2),
