(13678, 'tr-tr', 294, 1, '3222270125154', '10699549', 'Felix Pouch Morina ve Ton Balıklı Kedi Maması 4 lü Paket', '1 yaş üzeri tüm kedi ırkları için ihtiyaç duyduğu bütün besin maddelerini içeren, tam ve dengeli bir gelişme sağlamanın yanı sıra kolay sindirilebilir konserve kedi maması. Vitamin, mineral ve Omega 6 içermektedir. Paket içerisinde, tavuk etli ve sığır etli olmak üzere 2 farklı konserve mama bulunmaktadır. Tazeliğini koruyan alüminyum folyo poşet içerisinde, tek kullanımlıktır. <br><br>Ürünün İçeriği: Et ve et ürünleri, sebze protein ekstratları, balık ve balık ürünleri (% 4 ton balığı, % 4 morina balığı), mineraller, çeşitli şekerler.', 0, '3222270125154', 1882, 16.75, 2),
