(13780, 'tr-tr', 810, 1, '5010993461301', '11551103', 'Baby Alive Doğum Günü Bebeğim E0596', 'Ürün Özellikleri:<br><br>Doğum Günü Bebeğim’i partiye hazırlayıp onunla birlikte harika bir doğum günü kutlayın! Parti davetiyelerini gönderip arkadaşlarını doğum günü partisine çağırabilir ve minik pastalar hazırlıyor gibi yapıp mum üfleyebilirsiniz.<br><br>Set içerisinde bulunan sevimli ayıcığı hediye kutusunun içerisine koyup doğum günü prensesine hediye edebilirsiniz!<br><br>Kutu içerisinde 1 adet Baby Alive bebeği, parti kıyafeti, 1 adet taç, 2 adet süsleme parçasıyla minik pasta, 1 adet minik ayıcık, 2 adet davetiye ve 1 adet hediye kutusu bulunmaktadır.<br><br>Kızlar Baby Alive bebeği ve doğum günü aksesuarlarına bayılacaklar ve istedikleri oyunları oynayabilecekler!<br><br>Kutu Ölçüsü: 10 x 23 x 35 cm', 0, '5010993461301', 1886, 179, 2),
(13781, 'tr-tr', 810, 1, '5010993580538', '11975922', 'Baby Alive Lily İle Mama Eğlencesi E5841', 'Ürün Özellikleri:<br><br>Minikler, tekrar kullanılabilen ve kalıplarla şekil verilebilen Baby Alive oyuncak bebek mamasıyla Lily için birbirinden yaratıcı ve leziz oyuncak mamalar hazırlayabilecek. Bunları özel kaşığıyla Lily\'e yedirip sonra da bebeğin altını temizleyebilecekler.<br><br>Yemek Yiyen Oyuncak Bebek<br>Bu sevimli Baby Alive Super Snacks oyuncak bebeğini özel kaşığıyla (kutuya dahildir) beslediğinizde mamasını yer.<br><br>Mamasını Hazırlayın<br>Çocukların eğlenceli mamalar hazırlayabilmesi için iki kutu tekrar kullanılabilir ve kalıplarla şekil verilebilen Baby Alive oyuncak bebek maması kutuya dahildir.<br><br>Oyuncak Bebek Altını Kirletir ve Mamasını Yer<br>Bebeğinize bezini takın. Lily yemeğini yedikten sonra altını kirletir. Çocuklar, bebeğin bezini değiştirip onunla annesi ya da babasıymış gibi ilgilenerek eğlenebilir.<br><br>Oyuncak Bebek Aksesuarları İçerir<br>Kutuya, oyuncak bebek, giysi, kaşık, kalıp, kase, 2 kutu tekrar kullanılabilir Baby Alive oyuncak bebek maması, bir bebek bezi ve kullanım kılavuzu dahildir.<br>Minikler bebeklerini besleyerek eğlenebilir. 3 yaş ve üzeri kız ve erkek çocuklar için harika bir oyuncak bebektir.<br><br>İçindekiler: Baby Alive oyuncak bebek, giysi, 1 bebek bezi, tekrar kullanılabilir 28 gramlık iki kutu oyuncak bebek maması, 3 aksesuar ve kullanım kılavuzu.<br><br>Yaş: 3 yaş ve üzeri<br><br>Paket Ebat: 10 x 23 x 36 cm<br><br>Not: Baby Alive tekrar kullanılabilir oyuncak bebek maması, toksik madde içermez, ancak insanlar tarafından tüketilmemelidir. Super Snacks oyuncak bebek serisiyle yalnızca Baby Alive tekrar kullanılabilir oyuncak bebek maması kullanın. Son kullanma tarihi yoktur. Hazırlanan mamalar, yaşa ve beceri seviyesine göre farklılık gösterebilir.Bez Dolgu Malzemesi: Tamamıyla Yeni Materyaller: Yumuşak Ağaç Hamuru.<br><br>UYARI:<br>BOĞULMA TEHLİKESİ: Küçük parçalar. 3 yaşından küçük çocuklar için uygun değildir.', 0, '5010993580538', 1886, 219, 2),
