(14012, 'tr-tr', 810, 1, '8698540308223', '12223577', 'Kanz Eğitici Kartlar Hayvanları Tanıyalım KNZ-30822', 'Ürün Özellikleri: <br>Kutu Ölçüsü: 23,5 x 5 x 16,5 cm<br>25 Kart, 50 Görsel<br> Türkçe - İngilizce<br>Kullanım Yaş Aralığı: 24 Ay+ <br><br>Çocuklarınızın görsel ve düşünce becerilerini geliştirerek, hayvanları tanımasının ve sevmesinin yanı sıra erken yaşta İngilizce öğrenmelerine de destek sağlayacaktır.', 0, '8698540308223', 1888, 16.95, 2),
