(14015, 'tr-tr', 810, 1, '8698540308285', '12223581', 'Kanz Mevsimler Puzzle KNZ-30828', 'Ürün Özellikleri: <br>Kutu Ölçüsü: 23,5 x 5 x 16,5 cm<br>1 Puzzle 16,5 x 11 cm<br> 36 Parça<br>4 Mevsim<br><br>36 parça 4 değişik mevsim görselinden oluşan yapboz kartları, çocukların parça - bütün algısı, görsel algı becerisi ve düşünme becerilerinin gelişimine katkı sağlar. El-göz koordinasyonunu geliştirir. İklimleri tanımasına yardımcı olur ve el becerilerini geliştirir. Ayrıca mevsimler ve özelliklerini tanıyarak iklim yapımız hakkında bilgi sahibi olur.', 0, '8698540308285', 1888, 16.95, 2),
