(14061, 'tr-tr', 810, 1, '8056379083207', '12043257', 'L.O.L Kar Tatili Simli FSDU20 LLU8', 'Kışın en güzel partisi L.O.L. Surprise Winter Disco partisi! Her bir L.O.L. Surprise Kar Tatili Glitter Globe içerisinde keşfedilmeyi bekleyen tam 8 sürpriz ve birbirinden tarz 12 L.O.L. Bebek\'ten biri L.O.L. Surprise hayranları ile buluşmak için sabırsızlanıyor. Önceki simli serilerden farklı olarak bu seride L.O.L. Bebekler\'in saçlarının içi simleniyor ve kafaları tıpkı bir kar küresine dönüşüyor. Bu muhteşem sürprizi keşfetmek için yapılması gereken L.O.L. Bebek\'i baş aşağı tutmak ve şişe yardımıyla su ile beslemek. Suyun dışarı sızmaması için ise baloncuk şeklindeki emziği L.O.L. Bebek\'in ağzına takmak yeterli. Üstelik simlenen sadece L.O.L. Bebekler\'in saçları da değil. L.O.L. topunun tepesindeki kapak açılıp topun içi su ile doldurulduğunda L.O.L. topunun içerisinde renk değişimi gerçekleşiyor ve çocuklar göz alıcı bir kar küresine sahip oluyor!', 0, '8056379083207', 1889, 59.95, 2),
