(14159, 'tr-tr', 810, 1, '5011666731455', '12346284', 'Şakacı Korsan Gold 73145', 'Şakacı Korsan şimdi 45. yılına özel sınırlı sayıda GOLD versiyonuyla sizlerle! Korsanı fıçının içine yerleştir ve kılıçları saplamaya sırayla başla. İçlerinde bir kılıç korsanın hava fırlamasına sebeple olur. Korsanı fırlatan siz olun ve oyunu kazanın!', 0, '5011666731455', 1891, 94.95, 2),
(14160, 'tr-tr', 810, 1, '8681049091550', '11721807', 'Renkli Bardaklar Bemi', 'Oyuncuların analitik düşünme becerisini geliştirmeye yönelik olan bu ürün, odaklanma ve dikkat süresinin uzamasına yardımcı olur. Görsel ve uzamsal zeka gelişimine katkı sağladığı gibi ince motor becerilerin de gelişmesine yardımcı olur. En az iki kişi ile oynanan oyun, oyuncuların sosyal becerilerinin de gelişmesini sağlar.', 0, '8681049091550', 1891, 29.95, 2),
