(14187, 'tr-tr', 810, 1, '5010993513253', '11696851', 'Hot Tub High Dive Kutu Oyunu E1919', 'Ürün Özellikleri:<br><br>Hot Tub High Dive ile eğlenceli bir köpük banyosuna hazır olun!<br><br>Kutu içerisinde bulunan demo baloncuk solüsyonunu havuza dökün, çarkı çevirin, sonra dalgıcı merdiven üzerinde yukarı aşağı hareket ettirmek için kırmızı butona basın. Dalgıç, merdivenin en tepesine ulaştığında havuza düşer ve köpük uçar. Köpüğü uçurmadan oyunda kalan son oyuncu ise oyunu kazanır!<br><br>Kutu içerisinde havuz ünitesi ve çıkarılabilir kumaş paravan, dalgıç figürü, merdiven, platform, çark çıkartması, çark için ok, demo olarak 30 ml’lik şişede baloncuk solüsyonu ve oyun kılavuzu yer almaktadır.<br><br>Oyuncu Sayısı: 2 veya daha fazla<br><br>Havuz Ünitesi Uzunluğu: 21 cm<br><br>Kutu Ölçüsü: 8 x 27 x 27 cm', 0, '5010993513253', 1891, 89.95, 2),
