(14189, 'tr-tr', 810, 1, '5010993578030', '11863794', 'Tabu Aile Boyu Eğlence', 'Ürün Özellikleri:<br><br>Aileler için yasaklar hiç bu kadar eğlenceli olmamıştı. Çocuklar, anne ve babalar Tabu’nun bu yeni versiyonuyla çok eğlenecek.<br><br>Tabu Aile Boyu Eğlence oyununda çocuklar ve anne babalar için farklı kartlar var. Çocukların kartlarında bir soru kelimesi ama sadece 2 Tabu kelimesi yer alıyor. 260 kartta 1000’den fazla soru kelimesi bulunuyor.<br><br>Oyuncular zamana karşı yarışırken takımlarına yasak kelimeleri kullanmadan soru kelimelerini anlatmaya çalışıyor. En çok kelimeyi anlatmayı başaran takım oyunu kazanıyor.<br><br>Kutu içerisinde 260 kart, (çocuklar için 130 adet &amp; anne ve babalar için 130 adet) Tabu düdüğü, kum saati, puan defteri ve oyun kılavuzu bulunmaktadır.<br><br>Kutu Ölçüsü: 20 x 5 x 27 cm', 0, '5010993578030', 1891, 169, 2),
