(14204, 'tr-tr', 810, 1, '3760145061560', '12061725', 'Oyuncu Kurbağa Oyunu 36171', 'Ürün Özellikleri:<br><br>Arkadaşlarınızı toplayın ve eğlenmeye başlayın!<br>O ne söylerse onu yapın! Oyuncu kurbağa ile enerji harcamak çok keyifli olacak. Bir uçakmış gibi davranın, en sevdiğiniz hayvanı taklit edin.<br>Tek ayaküstünde zıplayın ve daha birçok eğlenceli aktiviteyi arkadaşlarınızla birlikte bu kutu oyunu le yapın.<br>Gong sesini duyunca hemen bir yaprağın üstüne çıkın ve damga kazanın.<br>Oyunun sonunda en çok damgası olan oyunu kazanır.<br>Bu oyunda eğlenmeniz, hayal gücünüzü kullanmanız ve enerji harcamanız için 50’den fazla aktivite yer alıyor.<br><br>Ürün Ölçüsü; 11 x 8,6 x 13,9 cm.<br><br>2 x AA Pil ile çalışmaktadır. Piller kutuya dahildir.<br><br>Çocuk sağlığına uygun, kaliteli ve güvenilir malzemeden üretilmiştir.', 0, '3760145061560', 1891, 59.95, 2),
(14205, 'tr-tr', 810, 1, '8697418011319', '12067842', 'Secret Words Kutu Oyunu T131 Ks Games', 'Ürün Özellikleri:<br><br>Secret Words kelime oyununun amacı takım arkadaşlarınıza \'\'anahtar\'\' kelimeleri kullanmadan gizli kelimeyi anlatıp oyun tablasında ilerleyerek finişe en önce ulaşan takım olmaktır.<br><br>Arkadaşlarınızla toplanın, rahat bir masa karşısına geçip Secret Words kelime oyununu açın. Takımınızı seçin ve siz gizli kelimeleri anlatmaya çalışın.<br><br>Takım arkadaşlarınız da bol bol tahmin yapıp bulmaya çalışsınlar anlatırken anahtar kelimeleri \'\'sakın\'\' kullanmayın, yoksa rakip takım büyük bir zevkle ortalığı inletirler.<br><br>Anlatırken uymanız gereken kurallar ve kısıtlı zamanınız var. Rakiplerinizin gözü kartlarda, kulakları sizde... Rakipleriniz en ufak bir hatanızda \'\'alarm\'\' çalmak için bekliyorlar.<br><br>Oyuncu Sayısı: 4 - 8<br>8 yaş ve üzeri çocukların kullanıma uygundur.<br><br>Kutu içerisinde 180 adet kelime kartı (720 adet gizli kelime, 3600 adet anahtar kelime) 1 adet oyun tahtası, 1 adet kum saati, 1 adet uyarı zili ve 2 adet piyon bulunmaktadır.<br><br>Kutu Ölçüsü: 19 x 7 x 27,3 cm', 0, '8697418011319', 1891, 59.95, 2),
