(14212, 'tr-tr', 810, 1, '5010993638314', '12185852', 'Monopoly Speed E7033&nbsp;', 'Ürün Özellikleri:<br><br>Pek vaktiniz yok mu? Sorun değil! Monopoly Speed\'i 10 dakikadan kısa bir sürede oynayabilirsiniz!<br><br>Monopoly\'nin bu versiyonunda herkes aynı anda zar atıp mülk satın alabilir yani oyuncuların sıralarını beklemesine gerek kalmaz. 4 tur boyunca oyuncular hiç olmadığı kadar hızlı bir şekilde mülk satın almak, takas etmek ve satmak için zamanlayıcıya karşı yarışır.<br><br>Zamanlayıcı, her satın alma ve takas aşamasında geriye doğru sayar ve aşamalar arasında ara verilmez. Oyun alanında iki başlangıç noktası vardır ve oyuncular her seferinde Kodes\'ten ücretsiz olarak çıkabilir. Monopoly Speed kutu oyunu ailelerin oyun gecesi, arkadaşlarla yapılan partiler ve gün içindeki molalar için harika bir seçimdir.<br><br>Set içerisinde oyun alanı, 4 piyon, 4 zar, 28 tapu senedi kartı, 16 şans kartı, 12 kamu fonu kartı, para destesi (150 adet M1000\'lik banknot) ve oyun kılavuzu yer almaktadır.<br><br>• Süreli Turlarla Oynanır: Bu hızlı Monopoly kutu oyunu turlar halinde oynanır. Zamanlayıcı, her turun satın alma ve takas aşamasında geriye doğru sayar.<br><br>• Herkes Aynı Anda Satın Alır: Sıranızı beklemenize gerek yok! Her oyuncunun bir piyonu ve bununla eşleşen zarı vardır. Satın alma aşamalarında herkes aynı anda zar atıp mülk satın alır.<br><br>• Süper Hızda Takas: Şans kartları, ticaret aşamasında oyunculara yardımcı olur. Kamu fonu kartlarıyla oyunun sonunda bonus kazanın.<br><br>• Eğlenceli Aile Oyunu: Hızlı bir oyun oynamak istediğinizde Monopoly Speed oynayın! Bu harika oyunla, vaktiniz kısıtlı olduğunda bile ailenizi ve arkadaşlarınızı bir araya getirebilirsiniz.<br><br>3 x 1,5V AAA pil ile çalışmaktadır. Piller kutuya dahil değildir.<br><br>Oyuncu Sayısı: 2 - 4<br><br>Kutu Ölçüsü: 40 x 4 x 27 cm', 0, '5010993638314', 1891, 149, 2),
(14213, 'tr-tr', 810, 1, '5010993675128', '12190783', 'Connect 4 Blast E9122', 'Ürün Özellikleri:<br><br>Connect 4 Blast, oyuncuların pakete dahil Nerf dart tabancaları ve özel süngerden Nerf dartlarını kullanarak renkli disklere stratejik olarak atış yaptığı heyecan verici ve hareketli bir oyun!<br><br>Oyuncular seçtikleri renkteki 4 diski bir sıraya dizmek için başa baş kapışıyor. Nerf dart tabancalarıyla disklere atış yaparak vurduğunuz kırmızı veya sarı diskleri bir daha atış yapmadan önce yükleme tepsisindeki herhangi bir sütuna yeniden yerleştirin ve diskler düştükçe oynamaya devam edin.<br><br>Çocukların el ve göz koordinasyonlarını, konsantrasyon ve hayal güçlerini geliştirir. 2 kişiyle oynanan bu oyun ile çocuğunuz arkadaşlarıyla sosyalleşme imkanı bulur, rekabet kavramını öğrenir.<br><br>İçindekiler: Yükleme tepsisiyle birlikte oyun alanı, 2 kule parçası, 2 Nerf dart tabancası, 8 dart, 40 disk (20 mavi, 10 kırmızı, 10 sarı) ve oyun kılavuzu.<br><br>Oyuncu Sayısı: 2 kişi<br><br>Kutu Ölçüsü: 40 x 6 x 28 cm', 0, '5010993675128', 1891, 149, 2),
(14214, 'tr-tr', 810, 1, '5010993460922', '11518886', 'Hasbro Doğum Günü Eğlencesi', '\"En çok mumu söndüren oyunu kazanıyor. Kutuda pasta şeklinde elektronik oyun ünitesi ve nefesle aktive olan 5 plastik mum yer alıyor. Doğum günlerinde mum üflemeye doyamayan minikler bu oyuna bayılacak! Çocuklar müzik durmadan önce pastadaki mumları üfleyip söndürmek için yarışıyor; bazı şakacı mumlar söndükten sonra tekrar yanabiliyor. <br><br>\r\n3 kalem pil ile çalışır. (Piller kutuya dahil değildir.)\"', 0, '5010993460922', 1891, 69.95, 2),
