(14456, 'tr-tr', 810, 1, '5010993555970', '11863801', 'Play Doh Donut Eğlencesi E3344', 'Ürün Özellikleri:<br><br>Çocuklar, sette bulunan en çılgın donut\'ları kalıplar ve aletlerle hazırlayıp, sonra da onları diledikleri gibi süsleyebilecek. Ayrıca; üzerinde minik yarım kalıpların da olduğu servis standıyla bu eğlenceli ve renkli donut\'ları sunabilecekler.<br><br>Oyun hamurları, çocuklarınızı yaratıcı oyunlarla öğrenmeye teşvik eder, hayal güçlerini, el becerilerini ve pratik zekasını geliştirmesine yardımcı olur.<br><br>Kutu içerisinde monte edilmemiş stand, şekil verme ve süsleme aletleri, 4 donut kalıbı, çay fincanı, 4 renk Play-Doh oyun hamuru (224 g), 2 Hamurdan Fikirler kartı ve kullanım kılavuzu bulunmaktadır.<br><br>Sağlık Bakanlığı onaylı ve kanserojen madde içermeyen malzemelerden imal edilmiştir.<br><br>Kutu Ölçüsü: 20 x 7 x 22 cm', 0, '5010993555970', 1895, 64.95, 2),
(14457, 'tr-tr', 810, 1, '5010993555956', '11863802', 'Play Doh Çalışkan Buldozer Ve Kepçe Oyun Hamuru Seti E4294', 'Ürün Özellikleri:<br><br>Çocuklar iki güçlü iş makinesiyle ve oyun hamurları ile kendi inşaat alanlarını kendileri yaratacaklar.<br><br>Çalışkan Buldozer ve Çalışkan Kepçe ile hem taş, kask, kürek, boru gibi inşaat malzemelerini oluşturabilecek, hem de yaptıkları malzemeleri iş makineleriyle taşıyıp ezebilecekler.<br><br>Kutu içerisinde iş makinaları, aksesuarları, turuncu, metalik gri Play-Doh oyun hamuru ve kum renkli Play-Doh inşaat hamuru olmak üzere 3 farklı rengi bulunmaktadır.<br><br>Oyun hamurları çocuklarınızı yaratıcı oyunlarla öğrenmeye teşvik eder, hayal güçlerini, el becerilerini ve pratik zekasını geliştirmesine yardımcı olur.<br><br>Sağlık Bakanlığı onaylı ve kanserojen madde içermeyen malzemelerden imal edilmiştir.<br><br>Kutu Ölçüsü: 6 x 28 x 22 cm', 0, '5010993555956', 1895, 64.95, 2),
