(14605, 'tr-tr', 72, 1, '8680838502772', '10096130', 'Galatasaray Balon 6 Adet', 'Ürün Özellikleri:<br><br>Paket içerisinde 6 adet Galatasaray logolu, baskılı balon bulunmaktadır.', 0, '8680838502772', 1898, 8.95, 2),
(14606, 'tr-tr', 810, 1, '8680838527645', '11894325', 'Metalik Balon 20\'li', 'Ürün Özellikleri:<br><br>Metalik Renkli Balon çocuklar özel günlerinizi renklendirin!<br><br>Parti, doğum günü veya oda süslemelerinde kullanabileceğiniz rengarenk balonlara bayılacaksınız.<br><br>Metalik balonlar dekoratif anlamda kullanılabileceği gibi, çocuklar için büyük bir eğlence kaynağı da olacak.<br><br>Paket içerisinde 20 adet metalik renkli balon bulunmaktadır.<br><br>Paket Ölçüsü: 22 x 1 x 15,5 cm', 0, '8680838527645', 1898, 15.95, 2),
(14607, 'tr-tr', 810, 1, '8680838527539', '11894326', 'Doğum Günü Baskılı Balon 16lı', 'Ürün Özellikleri:<br><br>Paket içerisinde 16 adet doğum günü baskılı renkli balon bulunmaktadır.<br><br>Paket Ölçüsü: 21,5 x 1 x 21,5 cm', 0, '8680838527539', 1898, 15.95, 2),
