INSERT INTO `products` (`ID`, `LanguageCode`, `BrandID`, `UnitID`, `Barcode`, `SKU`, `Name`, `Description`, `State`, `Code`, `CategoryID`, `Price`, `Source`) VALUES
(14619, 'tr-tr', 716, 1, '8698532599356', '11559586', 'Taktik 40\'lı Körüklü Pipet', '\"', 0, '8698532599356', 1898, 7.45, 2),
(14620, 'tr-tr', 810, 1, '8692534442573', '12225368', 'Automix Magic Hava Ferahlatıcı Okyanus Esintisi', '', 0, '8692534442573', 1900, 5, 2),
(14621, 'tr-tr', 810, 1, '8692534442580', '12225369', 'Automix Magic Hava Ferahlatıcı Bahar Çiçekleri', '', 0, '8692534442580', 1900, 5, 2),
(14622, 'tr-tr', 810, 1, '5160724910179', '12200248', 'Carub Hava Kompresörü 12V', 'Yanında gönderilen uçlarla kolay kullanım sunar. Araç lastiği, motosiklet lastiği, bisiklet lastiği, top vb. birçok şişirme işleminde kullanılır. Güçlü performansını kuvvetli motorundan almaktadır. Kompresör 300 PSI hava basar. Çakmaklık girişinden kolayca gücünü alıp çalışır. <br><br>Kullanım Alanı: 300 Psi Hava Kompresörü, üniversal bir üründür. 12V olan tüm marka ve model araçlarda çalışır. <br><br>Kullanım Talimatı: Kompresörün arkasında bulunan hazneden kabloyu çıkartınız. Kablonun ucundaki soketi çakmaklığa takınız. Kompresörün üstündeki hortumu lastiğinizin sibobuna takınız ve butonuna basınız.', 0, '5160724910179', 1900, 99, 2),
(14623, 'tr-tr', 810, 1, '5032227900356', '12200946', 'Pas Sökücü WD-40 150 ml', 'Metal ile nem arasına girerek koruyucu bir tabaka oluşturur. Paslı ve aşınmış yüzeylere nüfus ederek aşınmayı ortadan kaldırarak, parçaların çalışmasına olanak sağlar. Çok hafif, karakteristik bir kokuya sahiptir. İçinde silikon, toz ve kir toplayıcı herhangi bir katkı maddesi içermediği için yüzeyde kir tabakası oluşturmaz.', 0, '5032227900356', 1900, 19.9, 2),
(14624, 'tr-tr', 810, 1, '8697409602892', '12185890', 'Autokit Süper Parlatıcı Sıvı Cila 300 Ml', 'Aracınızın boyasını korur ve yeni gibi görünmesini sağlar. Güneş ışınlarından korur. Kullanımı kolay ve pratiktir, kolay parlatma sağlar. Aracınıza uygun renkte cila kullanmanızı tavsiye ederiz. <br><br>Kullanım Talimatı: Kullanmadan önce çalkalayınız. Aracınızı yıkadıktan sonra cilanın uygulanacağı yüzeyin temiz ve kuru olduğuna emin olun. Ufak parçalar halinde yüzeyin farklı yerlerine sürünüz ve dairesel hareketler ile kaportaya uygulayınız. Uygulama yapılmayacak bölgelere bulaşmaması için önleyici maddeler ile kapatınız.', 0, '8697409602892', 1900, 19.95, 2),
(14625, 'tr-tr', 479, 1, '8697409601734', '10103137', 'Magic Dose Hava Tazeleyici 200 ml', 'İstenmeyen kokulara karşı etkili olan ürünü odanızda ve aracınızda kalıcı bir ferahlık için kullanabilirsiniz. Kumaş yüzeylerde rahatlıkla kullanılabilir.', 0, '8697409601734', 1900, 9.95, 2),
(14626, 'tr-tr', 143, 1, '8693699480011', '10103917', 'Carpex Yazlık Cam Suyu 1000 ml', 'Ürün Özellikleri:<br><br>Carpex Yazlık Oto Cam Suyu (1 litre).<br><br>Yağ, is, toz, böcek ve sinek kalıntılarını ve egzoz gazlarını gidermek üzere özel olarak formüle edilmiştir. Doğaya zarar vermez. Silecek lastiklerinin daha rahat ve sessiz çalışmasını sağlar. Dört mevsim kullanılabilen cam suyudur. Camları aşırı derecede eğimli olan araçlarda dahi görüşün açık ve net kalmasını sağlar.<br><br>Kullanım Talimatı:<br><br>Cam sileceklerinin deposuna ilave edilerek kullanılır.', 0, '8693699480011', 1900, 7.95, 2),
(14627, 'tr-tr', 810, 1, '8680751060670', '11978152', 'Carpex Pasta Cila 275 ml', 'Ürün Özellikleri:<br><br>Carpex Pasta Cila (275 ml).<br><br>Özel cila harmanları (Brezilya Camauba cilası) ile parlak bir sonuç sağlayacak temizleyicilerin ve cilaların mükemmel bir karışımıdır. Her türlü aracın boyasını parlatmak ve korumak için mükemmeldir. Derinlemesine parlaklık sağlar. Cilalar, parlatır ve korur. Uzun süre etkilidir. Kiri, oksidasyonu giderir. Paket içeriğine uygulama süngeri dahildir.<br><br>Kullanım Talimatı:<br><br>Aracınızı yıkayıp duruladıktan sonra, pamuklu yumuşak bir bez ile cilayı otonuzun yüzeyine dairesel hareketle sürünüz. Kurumasını bekleyiniz. Temiz yumuşak bir bez ile parlatınız.', 0, '8680751060670', 1900, 29.95, 2),
(14628, 'tr-tr', 810, 1, '8693699160555', '12097002', 'Gojo Sprey Cila 750 ml', 'Ürün Özellikleri:<br><br>Gojo Sprey Cila (750 ml)<br><br>Özel formülü ile aracınızın yüzeyinde derin parlaklık oluşturan bir formüle sahiptir. Su kaydırıcı etki eden formülü aynı zamanda UV ışınlarına ve diğer çevresel etmenlere karşı uzun süren koruma sağlar. Uygulaması son derece kolaydır.<br><br>Kullanım Talimatı:<br><br>Aracınızı önce yıkayınız ve kurulayınız. Şişeyi çalkalayınız ve uygulanacak alana püskürtünüz. Temiz bir mikrofiber bez ile siliniz. Ardından son parlaklığı vermek için bezin diğer tarafı ile tekrardan siliniz. Direkt güneş ışığı altında ve yüzey sıcakken uygulamayınız.', 0, '8693699160555', 1900, 24.95, 2),
(14629, 'tr-tr', 810, 1, '8693699160869', '12097003', 'Gojo Jant Temizleyici 750 ml', 'Ürün Özellikleri:<br><br>Gojo Jant Temizleyici &amp; Parlatıcı 750 (ml)<br><br>Gojo Jant Temizleyici, her türlü alaşımlı jant için kullanılabilen özel formüle sahiptir. Kir, kum, fren &amp; balata tozu, asfalt ve diğer türlü kirleri kolayca temizleyen bir üründür. Özel alkali formülü kirli yüzeye tutunarak, yüzeyde oluşan kirleri çözer ve parlaklık sağlar.<br><br>Kullanım Talimatı:<br><br>Şişeyi iyice çalkalayınız.<br><br>Öncesinde jantlarınızı yıkayınız ve çamuru atınız.<br><br>Ürünü püskürtüp 1 dakika bekleyiniz.<br><br>Ardından temiz bir mikrofiber bez ya da fırça yardımı ile ürünü uygulayınız.<br><br>Sonrasında temiz bir bez ile jantlarınıza son parlaklığı veriniz.<br><br>Güneş ışı altında ve jant sıcak iken uygulama yapmayınız.', 0, '8693699160869', 1900, 24.95, 2),
(14630, 'tr-tr', 810, 1, '8693699160968', '12097004', 'Gojo Lastik Parlatıcı ve Koruyucu 750 ml', 'Ürün Özellikleri:<br><br>Gojo Lastik Temizleyici &amp; Parlatıcı (750 ml)<br><br>Gojo Lastik Parlatıcı lastiklerinizin parlak görünmesini sağlayan özel bir formüle sahiptir. Lastik yanaklarını ıslak bir görünüme kavuşturur. Koruma sağlar. Uygulandığı yerde özel bir katman oluşturarak lastiklerinizi UV ışınları nedeniyle solmasından, fren tozundan ve yol kirlerinden korur. Lastiklerinizin solmasını engeller, leke ve akmalara engel olur.<br><br>Kullanma Talimatı:<br><br>Şişeyi iyice çalkalayınız.<br>Öncesinde lastiklerinizi yıkayınız ve çamuru atınız.<br>Orijinal görünüm için yüzeye püskürtüp 1 dakika bekleyin. Ardından temiz bir mikrofiber bez ile siliniz.<br>Daha parlak bir görünüm için tekrar uygulama yapınız.<br>Güneş ışığı altında ve lastikler sıcak iken uygulama yapmayınız.', 0, '8693699160968', 1900, 24.95, 2),
(14631, 'tr-tr', 810, 1, '8692768021315', '10104454', 'Castrol Power 1 Racing 10 W-50 1lt', 'Castrol Power 1 Racing 4T, modern, yüksek performanslı ve 4 zamanlı motosikletler ve sürüş keyfini zirvede yaşamak isteyen motosiklet kullanıcıları için özel olarak tasarlanmıştır. <br>Sert kullanımla oluşan basınç, motorda daha fazla sürtünme kayıplarına yol açar. Castrol\'un başarılarla dolu yarış tecrübesine dayanan teknolojisini kullanan bu tam sentetik 4 zamanlı yağın, yarış pistindeki şartlarda da mükemmel ivmelenme ve güç sağladığı kanıtlanmıştır. <br><br>ONAY VE SPESİFİKASYONLAR: <br><br>API SN<br>JASO MA-2<br>TÜR: Tam Sentetik<br>', 0, '8692768021315', 1900, 49.95, 2),
(14632, 'tr-tr', 810, 1, '8693699500047', '10104575', 'Gojo Oto Cam Suyu 2.35 lt -30', 'Ürün Özellikleri:<br><br>Gojo Antifirizli Cam Suyu (2350 ml)<br><br>Kış aylarında aracınızın cam suyu deposunun donmasını engeller ve kışın zorlu şartlarında araç ve sürüş güvenliğinizi sağlar. Sulandırma derecesine göre 4 mevsim kullanılabilir. Yağ, toz, kir ve çevresel kirleri araç camında oluşan buzlanmayı çözer.', 0, '8693699500047', 1900, 23.9, 2),
(14633, 'tr-tr', 810, 1, '8693699290085', '11997480', 'Gojo Alüminyum Saplı Toz Alıcı', 'Ürün Özellikleri:<br><br>Gojo Alüminyum Saplı Toz Alıcı, statik tüyleri sayesinde tüm tozları tüylerine yapıştırarak alır. Püskülü 24 cm, alüminyum sapı 16 cm\'dir.', 0, '8693699290085', 1900, 11.95, 2),
(14634, 'tr-tr', 810, 1, '8693699010102', '12097005', 'Gojo Sentetik Güderi Bezi 50x70 cm', 'Ürün Özellikleri:<br><br>Gojo Sentetik Güderi (50 x 70 cm)<br><br>Mikrofilament teknolojisi ile yüksek emiş gücüne sahiptir. Özel iplik yapısı sayesinde toz ve kiri hapseder. Çamaşır makinesinde 30 - 60 °C de yıkanabilir ve hızlı kurur. Oto iç ve dış temizliğinde kullanılabilir. Parlatır ve yüzeyde çizmeden derinlemesine temizlik sağlar.<br><br>Kullanım Talimatı:<br><br>İlk kullanımdan önce ılık su ile durulayınız. Sıcak suda yumuşak deterjan ile yıkayınız. Ağartıcı veya yumuşatıcı kullanmayınız. Düşük ısıda makinede kurutunuz.', 0, '8693699010102', 1900, 29.95, 2),
(14635, 'tr-tr', 810, 1, '8697409606005', '10103233', 'Oto 4\'lü Bijon Anahtarı FA3002', 'Autokit bijon anahtarı paslanmaz krom kaplama ve güçlendirilmiş çelikten üretilmiştir. Tüm araçlarda lastik bijonlarının kolay sökülmesi için kullanılır. Daha dayanıklı olabilmesi için birleşim yerleri güçlendirilmiştir.', 0, '8697409606005', 1900, 54.95, 2),
(14636, 'tr-tr', 810, 1, '8693699010027', '11917054', 'Gojo Mikrofiber Oto Yıkama Eldiveni', 'Ürün Özellikleri:<br><br>Gojo Mikrofiber Oto Yıkama Eldiveni<br><br>Mikrofiber teknolojisi ile yüksek emiş gücüne sahiptir. Çift taraflı yapısı ile toz ve kirleri kolayca hapseder. İnatçı kirleri kolayca ve yüzeye zarar vermeden temizler. Özel iç astar sayesinde eliniz kuru kalır ve zarar görmez. Çamaşır makinesinde yıkanabilir ve hızlı kurur. Hassas yüzeyleri leke, iz bırakmaksızın çizmeden temizler.<br><br>Kullanım Talimatı:<br><br>Makine veya elde ile yıkamaya uygundur.<br>40 °C yıkama yapınız.<br>Mikrofiber yapısının uzun ömürlü kalması için çamaşır suyu ve ağartıcı kullanmamanız tavsiye edilir.', 0, '8693699010027', 1900, 24.95, 2),
(14637, 'tr-tr', 810, 1, '8693699001360', '11997479', 'Mikrofilament Çok Amaçlı Temizlik Bezi 2 li', 'Mikrofilament teknolojisi ile yüksek emiş gücüne sahiptir. Özel iplik yapısı sayesinde toz ve kiri hapseder. Oto, ev, cam, mobilya ve mutfak temizliğinde kullanılabilir. Çamaşır makinesinde 30-60 °C yıkanabilir ve hızlı kurur. Zor ve Hassas yüzeylerde çiziksiz ve lekesiz temizlik sağlar. Parlatıcı özelliğe sahiptir.', 0, '8693699001360', 1900, 12.95, 2),
(14638, 'tr-tr', 810, 1, '8693699290153', '12075257', 'Gojo Mini Teleskopik Çekçek Oynar Başlık', '52 - 82 cm ebatlarındaki bu ürün, oynar başlı tasarımıyla erişilmesi zor alanlarda dahi kolay kullanım sunar. Camlarınızı çizmez ve zarar vermez. Teleskopik sap hafif ve sağlamdır.', 0, '8693699290153', 1900, 34.95, 2),
(14639, 'tr-tr', 479, 1, '8697409601994', '10103733', 'Autokit Bor Dizel Enjektör Temizleyici 250 ml FA1-199', 'Düzensiz çalışmayı önler. Motor gücü ve ivmeyi artırır. Akaryakıt alınmadan önce şişenin tamamı yakıt deposuna boşaltılır. Her depoda 1 şişe kullanılması tavsiye edilir. Yanıcı ve patlayıcı değildir. İçindeki bulunan nanoteknolojik formül sayesinde depo içerisinde buharlaşan suyu içine alarak tam yanma sağlayan üstün özellikli bir formül olup yakıt sistemini depodan enjektöre kadar tamamını temizler.', 0, '8697409601994', 1900, 19.95, 2),
(14640, 'tr-tr', 479, 1, '8697409602007', '10103922', 'Autokit Bor Benzin Enjektör Temizleyici 250 ml FA1-200', 'Düzensiz çalışmayı önler. Motor gücü ve ivmeyi artırır. Akaryakıt alınmadan önce şişenin tamamı yakıt deposuna boşaltılır. Her depoda 1 şişe kullanılması tavsiye edilir. Yanıcı ve patlayıcı değildir. İçindeki bulunan nanoteknolojik formül sayesinde depo içerisinde buharlaşan suyu içine alarak tam yanma sağlayan üstün özellikli bir formül olup yakıt sistemini depodan enjektöre kadar tamamını temizler.', 0, '8697409602007', 1900, 19.95, 2),
(14641, 'tr-tr', 810, 1, '8697409603028', '10546096', 'Magic Dose Oktan Yükseltici FA1-302', 'Kurşunsuz ve normal benzinin oktan seviyesini yükseltir. Motor verimini artırır, hızlanmayı geliştirir. Kurşunlu ve kurşunsuz benzin ile kullanılabilir. Katalıitik konvertörlere zarar vermez. Güç kaybını engeller. Karbon monoksit ve hidrokarbon çıkışını azaltır. Ateşlemeyi geliştirir. Motor gücünü artırır. Emisyonu azaltır. Yakıt ekonomisini sağlar.', 0, '8697409603028', 1900, 14.95, 2),
(14642, 'tr-tr', 479, 1, '8697409601420', '11540950', 'Magic Dose Silikonlu Genel Temizleyici 750 ml', '', 0, '8697409601420', 1900, 8.95, 2),
(14643, 'tr-tr', 810, 1, '8693699160012', '11723002', 'Gojo Koltuk Döşeme Temizleyici 750 ml', 'Gojo kumaş döşeme temizleyici aracınızda, evinizde ve daha birçok alanda güçlü formülü ile her amaca uygun bir temizleyicidir. Kir, gres, yağ atıklarını sökmek için koltuk, halı, döşeme, vinil, kumaş, yer paspasları, lastik, torpido, plasik gibi yüzeylerde güvenle kullanılır.', 0, '8693699160012', 1900, 16.9, 2),
(14644, 'tr-tr', 810, 1, '8693699160081', '11723003', 'Gojo Torpido Temizleyici ve Koruyucu 750 ml', 'Gojo torpido temizleyici ve koruyucu, aracınızın torpidosunu temizler, yeniler ve korur. Aynı zamanda torpidonuzun orjinal görünümünü geri kazandırır. UV ışıklarının zararlı etkilerine karşı torpidonuzu korur. Aracınızın içindeki plastik, vinil, kauçuk alanlarında kullanılabildiği gibi dış aksamda tampon ve plastik parçaları temizlemek için kullanılabilir. Torpidonuz üzerindeki çatlama ve eskimelere karşı korur, yağlı tabaka oluşturmaz.', 0, '8693699160081', 1900, 16.9, 2),
(14645, 'tr-tr', 810, 1, '8697471616001', '11187886', 'Nem Alıcı 450 gr', 'Havalandırmanın az ya da yetersiz olduğu yerlerde nemi ve rutubeti dengeler, küf oluşumunu ve bayat kokuyu engeller. Nem, rutubet ve küf kokusu ile mücadele eder. Az ya da hiç havalandırılmayan mekanlarda havadaki nemi azaltarak, nemden etkilenen eşya ve makinelerinizi korur. Bulunduğu ortamdaki nem oranını %40 - %60 arasında sabit tutar. Miss flora nem alıcı yaklaşık olarak 35 m3\"lük hacim için yeterlidir. Nemin yoğunluğuna bağlı olarak 2-3 aylık bir süre boyunca etkisini devam ettirir. Mutfak dolapları, tezgah, lavabo altları, elektrik panoları, dolaplar, bodrum katları, yatak odaları, garaj, depo, kiler, yazlık evler, karavan ve teknelerde kullanılır.<br>', 0, '8697471616001', 1900, 24.95, 2),
(14646, 'tr-tr', 810, 1, '8697471616025', '11187887', 'Nem Alıcı Yedek 450 gr', 'Havalandırmanın az ya da yetersiz olduğu yerlerde nemi ve rutubeti dengeler, küf oluşumunu ve bayat kokuyu engeller. Nem, rutubet ve küf kokusu ile mücadele eder. Az ya da hiç havalandırılmayan mekanlarda havadaki nemi azaltarak, nemden etkilenen eşya ve makinelerinizi korur. Bulunduğu ortamdaki nem oranını %40 - %60 arasında sabit tutar. Miss flora nem alıcı yaklaşık olarak 35 m3\"lük hacim için yeterlidir. Nemin yoğunluğuna bağlı olarak 2-3 aylık bir süre boyunca etkisini devam ettirir. Mutfak dolapları, tezgah, lavabo altları, elektrik panoları, dolaplar, bodrum katları, yatak odaları, garaj, depo, kiler, yazlık evler, karavan ve teknelerde kullanılır. <br>', 0, '8697471616025', 1900, 11.95, 2),
(14647, 'tr-tr', 810, 1, '8693699162009', '11574058', 'Gojo Genel Amaçlı Makine Yağı 80 ml', 'Aşınmalara karşı korur. Oksidasyon direnci sağlar. Makine ömrünü uzatır. Mükemmel sonuç verir. Yalnızca makinede değil gıcırtı yapan kapı menteşe gibi bölgelerde de kullanılabilir.', 0, '8693699162009', 1900, 7.95, 2),
(14648, 'tr-tr', 810, 1, '8693699050016', '10104481', 'Gojo Spreyli Camsil Çekçek', 'Gojo spreyli camsil sünger, camsil ve spreyi 3\'ü bir arada. Kullanımı çok kolay, süngeri ve kauçuğu özel madden yapılmıştır.', 0, '8693699050016', 1900, 19.9, 2),
(14649, 'tr-tr', 810, 1, '8693699290146', '11997502', 'Gojo Cam Çekçek Teleskopik Saplı Süngerli 130 cm', '73x130 cm boyutunda olan çekçek, ev ve oto camı temizlemek için idealdir. Yüksek ve büyük camlı ev, ofis, rezidans ve plazalar için idealdir. Oynar başlıklı yapısı ile erişilmesi zor yerlerde dahil kolayca kullanılabilir. Teleskopik sap sağlam ve hafiftir.', 0, '8693699290146', 1900, 59.95, 2),
(14650, 'tr-tr', 810, 1, '2228013000253', '10103182', 'Autokit Torpido Parlatıcı Mango', 'Aracınızın ön konsolunu, göstergelerini, kapı döşemelerini, plastik aksamlarını parlatır ve koruyucu bir tabaka oluşturur. Parlatacağınız yüzeyin temiz ve kuru olmasını sağladıktan sonra 15-20 cm uzaklıktan ürünü dikey olacak şekilde püskürtünüz. Kuru bezle iyice yayınız. Parlaklığı anında göreceksiniz. <br><br>Kullanım Uyarıları: Kutu basınçlıdır. 50 derece üzerindeki sıcaklıklara maruz bırakmayınız. Kutuyu delmeyiniz, bitse bile ateşe atmayınız. Açık alevlerin ya da kor halindeki materyallerin yakınında kullanmayınız. Yeterli havalandırma olan yerlerde kullanınız. Göz ve deri temasından kaçınınız. Çocukların ulaşamayacağı yerlerde muhafaza ediniz.', 0, '2228013000253', 1900, 9.95, 2),
(14651, 'tr-tr', 810, 1, '8692534443594', '11929062', 'Automix Kemer Rahatlatıcı Carbon', 'Tüm yerli ve yabancı araç tiplerine uygun olan kemermatiğin görevi aracınızın kemer makarası ile askı kısmındaki gerginliği azaltmaya yarar. Araçlardaki emniyet kemerlerinin boyun ile göğüs kısmında elbiselerinizin kırışmasını engeller. Aracınızla sürüş halindeyken ise emniyet kemerinin boyun kısmını rahatsız etmemesini engelleyerek konfor sağlar.', 0, '8692534443594', 1900, 24.95, 2),
(14652, 'tr-tr', 810, 1, '8692534441163', '11929066', 'Automix Detay Havlusu 50x70 cm', 'Automix Detay Havlusu, %100 mikrofiber özelliktedir. Cam yüzeylerin lekesiz temizliği için çok sık dokunmuş mikrofiber dokusu sayesinde yüzeyde leke bırakmaz. Cam vitrinler, büyük yekpare camlar için idealdir. Özel dokulu mikrofiber yüzeyi sayesinde cam, krom ve ayna gibi parlak yüzeylerde kiri, yağlı lekeleri ve parmak izlerini kolaylıkla temizler. Emici özelliğiyle yüzeyi anında kurular. Kolay sıkılır ve çabuk kurur. Rengini ve şeklini uzun süre korur. Kuru ve nemli kullanım için idealdir. Kirlerin hızlı ve kesin bir şekilde temizlenmesini sağlar. Hologram oluşturmaz, son derece yüksek parlaklık sağlar. Temizlik maddesi olmadan temizler. Statik etkisiyle yüzeydeki tozları toplar. Yıpranmadan defalarca yıkanıp kullanılabilir. Otomobil ve evde yüzeylerin kusursuz bir şekilde temizlenmesine yardımcı olur.', 0, '8692534441163', 1900, 19.95, 2),
(14653, 'tr-tr', 810, 1, '8697409608887', '11977719', 'Autokit Sentetik Güderi Bez', 'Kir ve lekeleri kolayca temizler. Araçlarda, evlerde, işyerlerinde kullanım için idealdir. <br><br>Kullanım şekli: Kullandıktan sonra sabunla yıkayın. Daima kutu içinde nemli kalmasına özen gösterin. Eğer kuruyup sertleşirse bir müddet su içinde bekletin. İlk kullanımdan önce temiz su ile iyice durulayın.', 0, '8697409608887', 1900, 12.95, 2),
(14654, 'tr-tr', 810, 1, '869253411007', '12047516', 'Automix Kapı Koruyucu Şerit', 'Automix kapı koruyu şerit, şeffaf olarak tasarlanmıştır her renk araca uygundur. Sadece araçlar için değil ev kapılarınıza, motorlarınızın çizilmesini ufak göçüklerin oluşmak istemediğiniz alanlara da uygulayabilirsiniz. Üzerindeki yapışkanı sayesinde kuvvetli bir yapışma sağlar.', 0, '869253411007', 1900, 10, 2),
(14655, 'tr-tr', 810, 1, '8697409600843', '10103851', 'Autokit Benzin Bidonu 5 lt Ekonomik', '5 litre kapasite. Aracınızda her zaman bulunması gerekli bir üründür. Zor durumda kaldığınızda benzin ve yanıcı maddeleri taşıyabilmeniz için tasarlanmıştır. Fonksiyonel hortumu ile kolay kullanımlıdır. Yer kaplamaz.', 0, '8697409600843', 1900, 11.95, 2),
(14656, 'tr-tr', 810, 1, '8697409605480', '11540951', 'Autokit Profesyonel Hızlı Yapıştırıcı 200 ml', 'Güvenlik Talimatı: Gözleri tahriş edicidir. Buharı, uyuşukluğa ve baş dönmesine yol açabilir. Çocuklardan uzak tutunuz. Ateşe yaklaştırmayınız. Buharı solumayınız. Göz ile temasından kaçınınız. Teması durumunda bol su ile yıkayınız ve doktora başvurunuz. Bu madde ve kabı güvenli bir şekilde imha edilmelidir. Sadece iyi havalandırılmış alanlarda kullanınız. Çıplak ateşe ya da kor halindeki maddelere püskürtmeyiniz. Basınçlı kutu: Güneş ışığından koruyunuz. 40 derecenin üzerindeki sıcaklıklara maruz bırakmayınız. Kullandıktan sonra bile delmeyiniz ya da yakmayınız. Boşken lütfen geri dönüştürünüz. Üretim tarihi, son kullanma tarihi ve seri numaraları kutunun altındadır. Yapıştırıcı genel kullanım içindir. <br><br>Kullanma Talimatı: Yapıştırılacak yüzeylerden birine yeterli miktarda aktivatörü püskürtünüz. Kısa bir süre buharlaşmasını bekleyiniz. Diğer yüzeye hızlı yapıştırıcıdan sürünüz. İki yüzeyi hemen birleştiriniz ve 10 saniye bekletiniz. İyi havalandırılan ortamda kullanınız. Serin ve kuru yerde muhafaza ediniz. İlk yardım: Cildi saniyeler içinde yapıştırır. Cilt ve göz temasından kaçınınız. Göze veya cilde teması halinde bol su ile yıkayınız ve tıbbi yardım isteyiniz.', 0, '8697409605480', 1900, 14.95, 2),
(14657, 'tr-tr', 810, 1, '8692534412859', '11730111', 'Automix JVS Beyaz Renkli Cila 300 ml', 'Beyaz renk araçlar için özel olarak üretilmiştir ve tüm beyaz tonlarına uygundur. Nanoteknoloji sayesinde tüm solmuş, matlaşmış ve ince çizik alanları doldurur. Aracınızı ilk günkü rengine kavuşturur. Daha parlak ve daha zengin renkli bir görünüm sağlar. Aracınızı yıkayıp kuruladıktan sonra uygulama yapınız.', 0, '8692534412859', 1900, 49.95, 2),
(14658, 'tr-tr', 810, 1, '8692534412835', '11730213', 'Automix JVS Gri Renkli Cila 300 ml', 'Gri renk araçlar için özel olarak üretilmiştir ve tüm gri tonlarına uygundur. Nanoteknoloji sayesinde tüm solmuş, matlaşmış ve ince çizik alanları doldurur. Aracınızı ilk günkü rengine kavuşturur. Daha parlak ve daha zengin renkli bir görünüm sağlar. Aracınızı yıkayıp kuruladıktan sonra uygulama yapınız.', 0, '8692534412835', 1900, 49.95, 2),
(14659, 'tr-tr', 810, 1, '8692534412828', '11730214', 'Automix JVS Kırmızı Renkli Cila 300 ml', 'Kırmızı renk araçlar için özel olarak üretilmiştir ve tüm kırmızı tonlarına uygundur. Nanoteknoloji sayesinde tüm solmuş, matlaşmış ve ince çizik alanları doldurur. Aracınızı ilk günkü rengine kavuşturur. Daha parlak ve daha zengin renkli bir görünüm sağlar. Aracınızı yıkayıp kuruladıktan sonra uygulama yapınız.', 0, '8692534412828', 1900, 49.95, 2),
(14660, 'tr-tr', 810, 1, '8692534412842', '11730215', 'Automix JVS Siyah Renkli Cila 300 ml', 'Siyah renk araçlar için özel olarak üretilmiştir ve tüm siyah tonlarına uygundur. Nanoteknoloji sayesinde tüm solmuş, matlaşmış ve ince çizik alanları doldurur. Aracınızı ilk günkü rengine kavuşturur. Daha parlak ve daha zengin renkli bir görünüm sağlar. Aracınızı yıkayıp kuruladıktan sonra uygulama yapınız.', 0, '8692534412842', 1900, 49.95, 2),
(14661, 'tr-tr', 810, 1, '8697409605992', '12062611', 'Benzinli Yakıt Sistemi Enjektör Temizleyici FA-599', 'Benzinle çalışan enjeksiyonlu ve karbüratörlü tüm araçlarda kullanılabilir. Enjektör ve karbüratörde yakıt akış yolları ve depoda biriken karbon kirliliğini ve suyu temizler. Yakıtın iyi yanmasını sağlar. Oktanı artırır. Yakıttan tasarruf sağlar. LPG sistemli araçlarda oluşan rölanti motoru kurumu arızası oluşumunu engeller. Kalkış problemine yol açan tortuları temizler. Kirlilikten ve sudan oluşan güç kaybını azaltır. Rölantiyi düzenler. Motorun soğukta daha kolay çalışmasına yardımcı olur. Egzoz dumanı ve kirliliği azaltır.', 0, '8697409605992', 1900, 29.95, 2),
(14662, 'tr-tr', 810, 1, '8692768037811', '10560513', 'Castrol Edge 5W-30 M Motor Yağı 1 lt', 'Castrol EDGE serisi, üst sınıf araç üreticileri tarafından belirlenen yüksek standartları karşılamak üzere geliştirilmiş en iyi tam sentetik motor yağıdır. Kritik Motor Parçaları üzerinde yüksek koruma ve performans sağlayan Castrol EDGE, uzun yağ değişim aralıkları boyunca üstün dayanıklılık sağlamak üzere geliştirilmiş bir formülasyona sahiptir. Referans alınan rakip sentetik yağına göre, aracınıza %10\'a kadar yakıt tasarrufu sağlar. Yüksek basınç, sıcaklık ve zorlu şartlar altında bile sorunsuz turbo performansı sağlar. Yüksek performanslı araçlar için üst sınıf araç üreticilerin şartnamelerini karşılar. Sentetik teknolojisi ile standart yağlara göre üstün performans sağlar.', 0, '8692768037811', 1900, 79.9, 2),
(14663, 'tr-tr', 810, 1, '8697409602403', '10732112', 'Autokit Kırmızı Antifriz 1,5 lt FA1-240', 'Yüksek teknolojili, tüm dizel ve benzinli motorların soğutma sistemlerinde uzun ömürlü kullanılan antifirizdir. Sistemdeki alüminyum, dökme demir veya metal alaşımları korozyona karşı korur, pas ve sızıntıları önler, soğutma suyunun soğukta donmasını, sıcakta kaynamasını engeller. <br><br>Kullanma Talimatı: Radyatörü boşaltıp temiz su ile yıkayınız. Radyatöre önerilen miktarda antifiriz ve temiz su koyunuz. Karışması için motoru çalıştırınız. <br><br>Uyarı: Kullanılmış ürün ile uzun süreli temastan kaçınınız, boş ambalajları içme suyu kabı olarak kullanmayınız. Yutulması zararlıdır. Yutulursa hemen bir doktora başvurunuz. Çocuklardan uzak tutunuz.', 0, '8697409602403', 1900, 39.95, 2),
(14664, 'tr-tr', 810, 1, '8697409605961', '11540983', 'Autokit Fren Balata Temizleme Spreyi', 'Fren sistemlerinde yer alan kaliper ve balatalar, diskler, debriyaj parçalarını temizler. Tutma özelliğini artırır. Özel formülü sayesinde gres, katran ve diğer yağların kolayca temizlenmesini sağlar.', 0, '8697409605961', 1900, 16.9, 2),
(14665, 'tr-tr', 810, 1, '8697409602687', '11663753', 'Autokit İç Cila Vanilya 250 ml FA1-268', 'Kutuyu iyice çalkalayınız. Yeterli miktarda cilayı parlatılacak yüzeye püskürtünüz. Bir müddet bekledikten sonra temiz bir bez veya sünger ile silerek parlatınız. Aşırı uygulamadan kaçınınız. Gerektiğinde tekrar uygulanabilir. <br><br>Özellikleri: Torpido, plastik, deri, vinil ve kauçuk yüzeyleri parlatır ve rengini yeniler. Güneşin zararlı UV ışınlarına karşı tam bir koruma sağlar. Yüksek performanslı silikon formülü eskime ve çatlakları önler. Yağlı tabaka oluşturmaz. Yeni formülü ile uzun süre etkilidir.', 0, '8697409602687', 1900, 6.95, 2),
(14666, 'tr-tr', 810, 1, '8697409602694', '11663754', 'Autokit İç Cila New Car 250 ml FA1-269', 'Kutuyu iyice çalkalayınız. Yeterli miktarda cilayı parlatılacak yüzeye püskürtünüz. Bir müddet bekledikten sonra temiz bir bez veya sünger ile silerek parlatınız. Aşırı uygulamadan kaçınınız. Gerektiğinde tekrar uygulanabilir. <br><br>Özellikleri: Torpido, plastik, deri, vinil ve kauçuk yüzeyleri parlatır ve rengini yeniler. Güneşin zararlı UV ışınlarına karşı tam bir koruma sağlar. Yüksek performanslı silikon formülü eskime ve çatlakları önler. Yağlı tabaka oluşturmaz. Yeni formülü ile uzun süre etkilidir.', 0, '8697409602694', 1900, 6.95, 2),
