(14670, 'tr-tr', 810, 1, '8697409602649', '11977717', 'Autokit Renkli Cila Siyah FA1-264', 'Aracınızın boyası Autokit renkli cila ile yeni gibi görünmesini sağlayabilirsiniz. Her türlü aracın boyasını parlatmak ve korumak için idealdir. Uzun süre maruz kalan güneş ışınlarından korur. Kullanım esnasında ekstra performans gerektirmez, kolay parlatılır. Aracınıza uygun renkte cila kullanmanızı öneririz. <br><br>Kullanma Talimatı: Kullanmadan önce çalkalayınız. Aracınızı yıkadıktan sonra cilanın uygulanacağı yüzeyin temiz ve kuru olduğuna emin olunuz. Ufak parçalar halinde yüzeyin farklı yerlerine sürünüz ve dairesel hareketler ile kaportaya uygulayınız. Uygulama yapılmayacak bölgelere bulaşmaması için engelleyici maddeler ile kapatınız.', 0, '8697409602649', 1900, 19.95, 2),
