(14672, 'tr-tr', 810, 1, '8692768033820', '10104427', 'Castrol GTX Ultraclean A3/B4 10W-40 Motor Yağı 4 lt', 'Yoğun trafik, kötü yakıt kalitesi, zorlu sürüş koşulları ve yağ değişim aralıklarının uzaması gibi zorlu koşullar, çamur adı verilen yoğun, katran gibi bir maddenin birikmesine neden olabilir. <br>Çamur, motorunuzun hayati yağ kanallarını kolesterol gibi tıkayabilir ve arıtılmadığı takdirde motorun gücünü ve sonunda ömrünü kısaltabilir. <br>Castrol GTX Çift Etkili formülü eski çamuru temizler ve sıkı endüstri standartlarından daha iyi bir şekilde yeni çamur oluşmasına karşı koruma sağlar*. <br><br>ONAY VE SPESİFİKASYONLAR: <br><br>ACEA A3/B3, A3/B4<br>API SL/CF<br>MB-Onayı 229.1, VW 501 01/ 505 00, Fiat 9.55535-D2/G2’yi karşılar<br><br>SAĞLADIĞI FAYDALAR: <br><br>Zorlu endüstri standartlarına göre çamurlaşmaya karşı %50’ye kadar daha iyi koruma sağlar*<br>Viskozite kaybı ve yüksek sıcaklıklarda yağın bozulmasına karşı ileri düzeyde koruma sağlar. <br>Yüksek sıcaklıklarda depozit oluşumuna karşı üstün koruma sağlar. <br>Birinci kalite baz yağlar ve aşınma önleyici katkı maddeleri sayesinde motor ömrünün uzamasına yardımcı olur. <br>*API SL Seq. VG çamurlaşma testinde ölçülen endüstri standartlarına göre %50’ye kadar daha temiz motor. <br>TÜR: Yarı Sentetik<br>', 0, '8692768033820', 1900, 129, 2),
(14673, 'tr-tr', 810, 1, '8692768002215', '10104463', 'Castrol 2T Motorsiklet Yağı 1 lt', 'Sentetik ve 2 zamanlı motosiklet yağı, hızlı yanan ve ekstra koruma sağlayan formülü sayesinde daha yüksek ivmeleme gücüne sahiptir. Motor temizliğinde etkin olan bu ürün, krapaj arızasına karşı üstün dayanıklılık sağlar. Hem yağ enjeksiyonlu hem de karışımlı sistemlerde 50:1 oranına kadar kullanılabilecek şekilde formüle edilmiştir. Castrol Power 1 Racing - olağanüstü ivmelenme gücü, maksimum performans sunar. Castrol Power 1 Racing 2T, modern, yüksek hız ve performanslı 2 zamanlı motosikletler için geliştirilmiş son teknolojilere sahip, tam sentetik bir motor yağıdır. Hızlı yanan ve ekstra koruma sağlayan formülü modifiye edilmiş motosiklet motorlarının potansiyelini tam olarak ortaya çıkarmak için özel olarak geliştirilmiştir.', 0, '8692768002215', 1900, 24.95, 2),
(14674, 'tr-tr', 810, 1, '8692768033813', '10104467', 'Castrol GTX Ultraclean A3/B4 10W-40 Motor Yağı 1 lt', 'Yoğun trafik, kötü yakıt kalitesi, zorlu sürüş koşulları ve yağ değişim aralıklarının uzaması gibi zorlu koşullar, çamur adı verilen yoğun, katran gibi bir maddenin birikmesine neden olabilir. <br>Çamur, motorunuzun hayati yağ kanallarını kolesterol gibi tıkayabilir ve arıtılmadığı takdirde motorun gücünü ve sonunda ömrünü kısaltabilir. <br>Castrol GTX Çift Etkili formülü eski çamuru temizler ve sıkı endüstri standartlarından daha iyi bir şekilde yeni çamur oluşmasına karşı koruma sağlar*. <br><br>ONAY VE SPESİFİKASYONLAR: <br><br>ACEA A3/B3, A3/B4<br>API SL/CF<br>MB-Onayı 229.1, VW 501 01/ 505 00, Fiat 9.55535-D2/G2’yi karşılar<br><br>SAĞLADIĞI FAYDALAR: <br><br>Zorlu endüstri standartlarına göre çamurlaşmaya karşı %50’ye kadar daha iyi koruma sağlar*<br>Viskozite kaybı ve yüksek sıcaklıklarda yağın bozulmasına karşı ileri düzeyde koruma sağlar. <br>Yüksek sıcaklıklarda depozit oluşumuna karşı üstün koruma sağlar. <br>Birinci kalite baz yağlar ve aşınma önleyici katkı maddeleri sayesinde motor ömrünün uzamasına yardımcı olur. <br>*API SL Seq. VG çamurlaşma testinde ölçülen endüstri standartlarına göre %50’ye kadar daha temiz motor. <br>TÜR: Yarı Sentetik <br>', 0, '8692768033813', 1900, 39.95, 2),
(14675, 'tr-tr', 810, 1, '8692768037828', '10560514', 'Castrol Edge 5W-30 M Tam Sentetik Motor Yağı 4 lt', 'Sıvı Titanyum içeren Castrol EDGE 5W-30 M, günümüz modern araçlarının ihtiyaç duyduğu yüksek performansı sunarken maksimum motor performansı isteyen sürücülerin de doğal tercihidir. <br><br>SAĞLADIĞI FAYDALAR: Basıncın en yüksek olduğu anlarda güçlü kalmak için dönüşerek motorun performansını korur. Motor hızı ve şartları nasıl olursa olsun performans kaybına neden olan sürtünmeyi azaltır. Performansını kanıtlamak için en zorlu şartlarda bağımsız olarak test edilmiştir. Dünyanın önde gelen araç üreticilerinin tercihidir. Yağ değişim aralığı boyunca motorun performansını korur. <br>TÜR: Tam Sentetik FAYDALI KAYNAKLAR: Ürün Bilgi Formları - Malzeme Güvenlik Bilgi Formu', 0, '8692768037828', 1900, 279, 2),
(14676, 'tr-tr', 810, 1, '8692768038221', '10560515', 'Castrol Edge 5W-30 Ll Motor Yağı 1 lt', 'Sıvı Titanyum içeren Castrol EDGE 5W-30 LL, günümüz modern araçlarının ihtiyaç duyduğu yüksek performansı sunarken maksimum motor performansı isteyen sürücülerin de doğal tercihidir. <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br>ONAY VE SPESİFİKASYONLAR: <br><br>ACEA C3<br>MB-Onayı 229.31/ 229.51<br>Porsche C30<br>VW 504 00/ 507 00<br>SAĞLADIĞI FAYDALAR: <br>Basıncın en yüksek olduğu anlarda güçlü kalmak için dönüşerek motorun performansını korur. <br>Motor hızı ve şartları nasıl olursa olsun performans kaybına neden olan sürtünmeyi azaltır. <br>Performansını kanıtlamak için en zorlu şartlarda bağımsız olarak test edilmiştir. <br>Dünyanın önde gelen araç üreticilerinin tercihidir. <br>Yağ değişim aralığı boyunca motorun performansını korur. <br>TÜR: Tam Sentetik<br>', 0, '8692768038221', 1900, 79.9, 2),
