(14680, 'tr-tr', 810, 1, '8697409601598', '10104622', 'Autokit Yazlık Cam Suyu Mango 3 LT', 'Yazlık oto cam suyu, aracınızın silecek suyu deposuna ilave edilerek kullanılır. Konsantredir. Aracınızın cam yüzeylerinde kir, is, toz ve böcek kalıntılarını etkili bir şekilde çözer ve temizler. Her türlü yol ve iklim şartlarında daha güvenli bir görüş sağlar. Cam üzerinde leke bırakmaz. Oto boyası, cilası, silecek ve lastiklerine zarar vermez. Kokulu özelliği sayesinde su fıskiyelerinden aracın içine hoş koku sağlar.', 0, '8697409601598', 1900, 10, 2),
(14681, 'tr-tr', 810, 1, '8681015103850', '11885983', 'COMRADE 2\'li İç Bakım Seti', 'Comrade oto iç cila otonuzun torpido, kapı panelleri vinil ve plastik aksamların güneş ışığından kaynaklanan çatlamasını ve matlaşmasını önler, sürekli parlaklık verir. Kullanıldığı yüzeyi özel formülü sayesinde yumuşatır. Formülündeki koruyucu madde sayesinde tozlanmayı geciktirir. <br><br>Kullanma Talimatı: Tatbik edilecek yüzeyi önceden toz ve kirden arındırınız. Temizlenmiş yüzey üzerine sünger ile eşit miktarda sürünüz.', 0, '8681015103850', 1900, 7.95, 2),
(14682, 'tr-tr', 810, 1, '8681015111084', '10104556', 'Autokit Akü Takviye Kablosu', '2 metre kablo uzunluğu ile en kullanışlı tasarım. Nominal 200 ampere kadar takviye edebilme özelliği %100 bakır iletkenler kullanılmaktadır. Kullanım sırasında ellerimizle maşaların temas etmemesi için izole edilmiştir. Autokit akü takviye kablosu üç katmandan oluşmaktadır. Birinci katman iletken bakır ile kaplıdır, ikinci katman yalıtkan katman ile kaplıdır, üçüncü katman özel kauçuk kaplamasıyla kaplıdır. Her araçta bulunması gereken bir üründür.', 0, '8681015111084', 1900, 39.95, 2),
(14683, 'tr-tr', 810, 1, '8697353428210', '11507981', 'My Auto Oto Kurulama Bezi', 'Mükemmel emici, uzun ömürlü, iz bırakmayan mikrofiber havlu oldukça dayanıklı bir yapıya sahiptir. 50x70 cm ölçüleriyle hazırlanan My Auto kurulama bezini, evinizde, ofisinizde ve aracınızda üstün temizlik ve hijyen sağlamak için kullanabilirsiniz. <br><br>My Auto bir Özdilek markasıdır ve Özdilek adına özel olarak üretilmiştir.', 0, '8697353428210', 1900, 14.95, 2),
(14684, 'tr-tr', 810, 1, '8697409601987', '10103710', 'Autokit Bor Motor Yağı Katkısı 250 ml FA1-198', 'Sürtünmeden dolayı kaybolan güç ve performansı geri kazanır. Soğuk havalarda motorun kolay ve çabuk çalışmasını sağlar. Motor içerisindeki metal aksamalardaki sürtünmeyi, aşınmayı ve ısıyı azaltır. Metal yüzeylerdeki nem ve suya karşı etkilidir. Motor gürültüsünde sarsıntısında gözle görülür bir azalma hissedilir. Motor yağının ömrünü uzatır. Egzoz gazlarında azalma sağlar. Servis bakım ve yedek parça maliyetlerini en az seviyeye çeker.', 0, '8697409601987', 1900, 49.95, 2),
(14685, 'tr-tr', 810, 1, '8697409601888', '10103740', 'Autokit Cilalı Oto Şampuanı 1 lt', 'Özel Carnuba cilalı formülü sayesinde otonuzun boyası üzerinde bir tabaka oluşturarak her türlü kirlenmeye karşı itici güç kazandırır. Renk kaybolmasını ve oksitlenmeyi önler. Aracınızda cila parlaklığı görüntüsü verir. Otomobil dış temizliği için özel olarak imal edilmiş bir üründür. Otomobil yüzeyindeki kirleri etkin bir şekilde temizler. İçeriğindeki cila ile parlaklık ve koruma sağlar. Fosfat içermez, pH derecesi otomobil yüzeyine ve insan cildine zarar vermez.', 0, '8697409601888', 1900, 12.95, 2),
(14686, 'tr-tr', 810, 1, '8697409601550', '10103819', 'Magic Dose Dizel Enjektör Temizleyici FA1-155 250 ml', '', 0, '8697409601550', 1900, 14.95, 2),
(14687, 'tr-tr', 810, 1, '8697409602137', '10103841', 'Lastik Temizleyici Ve Parlatıcı 500 Ml', 'Özel formülü sayesinde lastiklerinizi tek işlemle parlatır ve korur. Lastiklerinizin uzun süreli yeni görünmesini sağlar. Sudan etkilenmez. Kış aylarında lastiklerinizin uzun süre parlak kalmasını sağlar. Lastik yüzeylerde çatlamayı önler, tozlanma ve kirlenmeyi geciktirir.', 0, '8697409602137', 1900, 18.9, 2),
(14688, 'tr-tr', 810, 1, '8693699230012', '10103847', 'Autokit Üstübü Extra 150 gr', 'Çok amaçlı ve genel işlevselliği olan bir üründür. Otomobil cilalama, pasta işlevlerinde, el ve ortam temizliğinde, motor, yağ, mekanik ile uğraşanlar için motor, jant vb. alanların temizleme işlemlerinde, yağlı çalışmalar sonrası vazgeçilmez yardımcınızdır.', 0, '8693699230012', 1900, 4.95, 2),
