(14691, 'tr-tr', 810, 1, '8697409605145', '10103025', 'Autokit Torpido Parlatıcı Okyanus', 'Aracınızın ön konsolunu, göstergelerini, kapı döşemelerini, plastik aksamlarını parlatır ve koruyucu bir tabaka oluşturur. Parlatacağınız yüzeyin temiz ve kuru olmasını sağladıktan sonra 15-20 cm uzaklıktan ürünü dikey olacak şekilde püskürtünüz. Kuru bezle iyice yayınız. Parlaklığı anında göreceksiniz. <br><br>Kullanım Uyarıları: Kutu basınçlıdır. 50 derece üzerindeki sıcaklıklara maruz bırakmayınız. Kutuyu delmeyiniz, bitse bile ateşe atmayınız. Açık alevlerin ya da kor halindeki materyallerin yakınında kullanmayınız. Yeterli havalandırma olan yerlerde kullanınız. Göz ve deri temasından kaçınınız. Çocukların ulaşamayacağı yerlerde muhafaza ediniz.', 0, '8697409605145', 1900, 9.95, 2),
