(14696, 'tr-tr', 810, 1, '8697409605039', '10783520', 'Autokit Mini Camsil 12 Cm FA1-503 (Adet)', 'Yüzeyleri çizmeden temizler. Suyun kolay çekilmesini sağlar. Pratik, kullanımı kolaydır. 12 cm uzunluğunda olan asörti ürün, stoklarımızda bulunan mevcut renk ürün gönderilecektir.', 0, '8697409605039', 1900, 2.9, 2),
