(14701, 'tr-tr', 810, 1, '8697409608368', '10103812', 'Autokit Sentetik Güderi FA1-836', 'Kir ve lekeleri kolayca temizler. Araçlarda, evlerde, iş yerlerinde kullanım için idealdir. <br><br>Kullanım şekli: Kullandıktan sonra sabunla yıkayın. Daima kutu içinde nemli kalmasına özen gösterin. Eğer kuruyup sertleşirse bir müddet su içinde bekletin. İlk kullanımdan önce temiz su ile iyice durulayın.', 0, '8697409608368', 1900, 12.95, 2),
