(14704, 'tr-tr', 143, 1, '8693699001209', '10877573', 'Carpex Lastik Tamir Kiti 300 Ml', 'Ürün Özellikleri:<br><br>Carpex Lastik Tamir Kiti (300 ml).<br><br>Önce rahatsız edici bir ses, ardından aracınızın yalpalamaya başlaması ve kenara çektiğinizde sizi bekleyen çok kötü sürpriz: Lastik patladı! Carpex Lastik Tamir köpüğü ile sadece 1 dakikada yolunuza geri dönebilirsiniz. Özel formülü ile patlayan lastiğin içindeki havayla birleşerek kauçuklaşan sıvı lastiğinizi 20 psi\'ye kadar şişirerek yolunuza devam etmenizi sağlar. Otomobilinizin bagajında bir adet bulundurun, kötü sürprizler canınızı sıkmasın.<br><br>Ürün Özellikleri:<br><br>Pratik, hızlı ve güvenli bir üründür. Patlayan lastiğinizi içerisindeki hava ile temas halinde kauçuklaşan sıvısıyla tamir eder. Lastik şişirme spreyi etkisiyle lastiğinizi 20 havaya (20 psi) kadar şişirir. Zahmetli ve yorucu olan lastik değiştirme işlemini spreyi kullanarak kolayca çözülmesini sağlar. 1 dakika gibi kısa bir sürede uygulanır. Profesyonellik gerektirmeyen kişisel kullanıma uygun bir üründür.<br><br>Nerelerde Kullanır?<br><br>Carpex Lastik Tamir Kiti Sprey yerli ve ithal tüm marka ve model otomobil, kamyonet ve motosiklet lastik tamirinde kullanılır. Tüm jant tiplerine uygundur.<br><br>Kullanım Talimatı:<br><br>Lastik Tamir Kitini kullanmadan önce tüpü iyice çalkalayınız. Ürünün hortumunu lastiğin sibop kısmına gelecek şekilde yerleştirerek tüpün içerisindeki kimyasal oluşumu lastiğin içine boşaltın. Lastik şişinceye kadar uygulayın. Hortumu çıkartıp hemen aracı hareket ettirerek maddenin lastiğe eşit şekilde dağılmasını sağlayın. Yolunuza rahatlıkla devam edebilirsiniz.', 0, '8693699001209', 1900, 24.95, 2),
(14705, 'tr-tr', 143, 1, '8693699001056', '10103730', 'Carpex Klima Temizleyicisi 150 Ml', '', 0, '8693699001056', 1900, 29.95, 2),
(14706, 'tr-tr', 810, 1, '8697409601871', '10103732', 'Autokit Oto Cila İç Torpido 500 ml', 'Torpido, plastik, vinil, deri ve kauçuk yüzeyleri parlatır ve yeni bir görünüm sağlar. Güneşin zararlı UV ışınlarına karşı tam bir koruma sağlar. Yağlı tabaka oluşturmaz. Yeni formülü ile uzun süre etkilidir.', 0, '8697409601871', 1900, 14.95, 2),
