(14708, 'tr-tr', 810, 1, '8697409601543', '10103795', 'Magic Dose Dizel Katkısı 250 ml', 'Mazotun performansını yükseltir. Tam yanma sağlar. Valflerin ve silindirlerin üstünü yağlar. Yakıt sisteminde pas ve korozyon oluşumunu önler. Enjektörleri ve ateşleme bujilerini temizler. İlk ateşlemeyi hızlandırır. Motorun gücünü artırır ve aynı yakıtla daha fazla km yapmanızı sağlar.', 0, '8697409601543', 1900, 14.95, 2),
