(14715, 'tr-tr', 810, 1, '8693699520205', '10647150', 'Gojo Oto Su Süpürücü', 'Ürün Özellikleri:<br><br>Gojo Silikonlu Su Süpürücü<br><br>Otomobilinizi kurulamak için idealdir.<br>Tek seferde suyu yok eder, iz bırakmaz.<br>Özel silikon silicisi zemine zarar vermez.<br>Yumuşak silikondan imal edilmiştir.', 0, '8693699520205', 1900, 21.95, 2),
