(14717, 'tr-tr', 810, 1, '8692768037026', '10104425', 'Castrol Magnatec Stop-Start 5W-30 A5 Motor Yağı 4 lt', 'Son 10 yılda artan trafik yoğunluğu motorda aşınmaya ve yakıt israfına neden olmaktadır. Bu yüzden, start-stop teknolojili otomobiller dahil olmak üzere hiçbir otomobil yoğun trafikte en iyi performansını gösteremez. <br>İşte bu yüzden, Castrol’ün en verimli tam sentetik baz yağlarını, patentli DUALOCK molekül teknolojisi ile bir araya getirerek yeni Castrol MAGNATEC STOP-START’ı geliştirdik. <br><br>DUALOCK MOLEKÜLLER: <br><br>Güçlü bir koruma kalkanı oluşturur. <br>Hem motor ısınmasında1 hem de dur-kalk2 sürüş anlarında meydana gelen aşınmayı %50 azaltır.<br>Dur-kalk sürüş sırasında bile yılda 60 litre yakıt tasarrufu sağlar. <br>Yeni nesil start-stop motor teknolojisine sahip araçlarda dahi, harekete geçtiğiniz andan itibaren durmaksızın koruma.<br><br>ONAY VE SPESİFİKASYONLAR: <br><br>ACEA A1/B1, A5/B5<br>API SN<br>ILSAC GF-4<br>WSS-M2C913-C/ WSS-M2C913-D onayını karşılar<br>TÜR: Tam Sentetik<br>', 0, '8692768037026', 1900, 189, 2),
