(14723, 'tr-tr', 517, 1, '8697353080432', '10102961', 'My Auto Oto Cam Suyu 3 L Antifrizli 10C', 'Aracınızı kullanırken yağ, is, toz, haşere kalıntıları, egzoz gazlarından oluşabilecek kirlenmeleri yok eder. Her türlü yol şartlarında daha güvenli bir görüş sağlar. Kışın silecek su püskürtme sistemlerinin donmasını önler. Cam üzerinde iz bırakmaz. Ön camda oluşabilecek buz ve kırağının çözülmesine yardımcı olurken, buğulanmayı önler ve net bir yol görüşü sağlar. <br><br>My Auto bir Özdilek markasıdır ve Özdilek adına özel olarak üretilmiştir.', 0, '8697353080432', 1900, 9.95, 2);
