(14732, 'tr-tr', 147, 1, '8692768020417', '10103772', 'Castrol Gtx 15W-40 Motor Yağı 1Lt', 'Castrol GTX Modern Engine 15W-40 \"Yeni Nesil Araçlarda Motor Ömrünü Uzatır\" ÜRÜN TANIMI Castrol GTX Modern Engine 15W-40, yeni nesil araçlar için geliştirilmiş özel bir formülasyona sahip mineral motor yağıdır. Hızla gelişen teknolojiye paralel olarak yeni nesil araçlardaki motor tasarımlarında da önemli gelişmeler yaşandı. Aynı hacimde olmalarına karşın, daha yüksek güç üretebilen bu yeni nesil motorlar daha fazla ısınma, aşınma ve oksidasyon gibi zorlu koşullarla karşılaşmaktadır. \"Sentetik Kalkan\" teknolojisine sahip Castrol GTX Modern Engine 15W-40 yeni nesil araçların motorlarındaki yüksek ve düşük sıcaklıklardaki motor aşınmasına karşı %50 daha fazla koruma ve daha iyi oksidasyon kontrolü sağlamak üzere geliştirilmiştir. Castrol GTX Modern Engine 15W-40, tüm benzinli, turboşarjlı motorlarda ve API CF sınıfı yağ kullanımı gerektiren dizel binek otomobillerde güvenle kullanılabilir. PERFORMANS SEVİYELERİ API SL/CF KULLANIM ÖZELLİKLERİ VE FAYDALAR \" Yüksek ve düşük sıcaklıklarda aşınmaya karşı %50 daha fazla koruma sağlar. \" Çamurlaşmaya karşı maksimum koruma sağlar.* \" Yağın viskozitesinin incelmesine ve oksidasyona karşı üstün koruma sağlar. \" Aracınızın turbo, multi-valf sistemleri ve katalitik konvertörleri için üstün koruma sağlar. *API SL performans seviyesine göre TİPİK FİZİKSEL VE KİMYASAL ÖZELLİKLERİ Test Birim Tipik Değer Yoğunluk @ 15 ºC g/cm3 0.879 Viskozite @ 40 ºC cSt 108.5 Viskozite @ 100 ºC cSt 14.4 Viskozite @ -20 ºC cP 6500 Viskozite İndeksi - 135 Toplam Baz Numarası mg KOH/g 8 Parlama Noktası (PMCC) 0C 201 Akma Noktası 0C -27', 0, '8692768020417', 1900, 34.95, 2),
