(14735, 'tr-tr', 332, 1, '8693699030032', '10103784', 'Gojo Pasta Cila Süngeri 3\'Lü', 'Yüzeye uyguladığınız cilayı,süngerin yüzeye temas edeceği şekilde ve dairesel hareketlerle yediriniz.Kuru olarak kullanınız.Yüzeydeki fazla cilayı pamuklu bir bez ile alınız.', 0, '8693699030032', 1900, 10.95, 2),
(14736, 'tr-tr', 59, 1, '8697409602212', '10103806', 'Autokit Pasta Cila Oto Çizik Giderici', 'Aracınızın boyası üzerindeki matlık ve oksidasyonu yok ederek kalıcı parlaklık sağlar. Autokit çizik alıcı pasta cila ürününün içeriğindeki mikro tanecikler sayesinde ince çizikleri etkili bir şekilde boyaya zarar vermeden yok edilir. Aracınızı ilk aldığınız halindeki gibi parlak gösterir. <br><br>Uygulanışı: Araç çizik alıcı pasta cila uygulanmadan önce Autokit cilalı şampuan ile yıkayın. Aracınızı temizlendikten sonra kuru olduğundan emin olmak için bezle silip kurulayın. Araç kuruduktan sonra, hızlı pasta cilasını bir sünger veya bir bez yardımıyla aracınızın yüzeyine eşit miktarlarda ve dairesel hareketlerle sürüp kısa bir süre bekleyin. Pasta cila kuruduktan sonra yumuşak bir bez ile silin ve aracınız kullanmaya hazır, pırıl pırıl bir hale gelecektir. <br><br>Uyarı: Plastik, vinil ve ahşap aksamlarda kullanmayın. Direkt güneş ışığı altında uygulamayın. Araç sıcak iken uygulamayın.', 0, '8697409602212', 1900, 24.95, 2),
(14737, 'tr-tr', 59, 1, '8697409603066', '10103818', 'Autokit Oto İç Bakım Seti 2Li', 'Torpido yenileme ve koruma sütü 200ml ve torpido parlatıcı sünger vakum ambalajlı.', 0, '8697409603066', 1900, 8.9, 2),
(14738, 'tr-tr', 147, 1, '8692768000112', '10103834', 'Castrol GTX 20W-50 Motor Yağı 1 lt', 'CASTROL GTX 20W/50\"ÜSTÜN KORUMA\"ÜRÜN TANIMICastrol GTX 20W-50, günümüzün motorlarını,her türlü iklim ve kullanım şartlarında yağlamak ve korumak için, kaliteli mineral bazyağlar ve geliştirilmiş katıklarla formüle edilmiş bir motor yağıdır.Castrol GTX 20W-50, herhangi bir sıradan yağın çok ötesinde; motorunuzu, hergün karşılaştığı yüksek ve düşük sıcaklıklardaki aşınmaya karşı %50 daha fazla korur. PERFORMANS SEVİYELERİAPI SL/CFKULLANILDIĞI YERLERCastrol GTX 20W-50, tüm benzinli, turboşarjlı motorlarda ve API CF sınıfı yağ kullanımı gerektiren dizel binek otomobiller ve ticari araçlarda kullanılabilir.KULLANIM ÖZELLİKLERİ VE FAYDALAR-Yüksek ve düşük sıcaklıklarda aşınmaya karşı %50 daha fazla koruma sağlar.*-Çamurlaşmaya karşı maksimum koruma sağlar.*-Yüksek sıcaklıklarda yağın bozulmasına ve viskozite kaybına karşı üstün koruma sağlar.*-Motoru soğutur ve temizler.*API SL performans seviyesi ile karşılaştırıldığındaTİPİK FİZİKSEL VE KİMYASAL ÖZELLİKLERİTestBirimTipik DeğerYoğunluk @ 15 ºC g/cm30.886Viskozite @ 40 ºCcSt158.9Viskozite @ 100 ºCcSt18Viskozite @ -15 ºC cP9300Viskozite İndeksi -125Toplam Baz Numarasımg KOH/g8.1Parlama Noktası (PMCC)0C198Akma Noktası0C-29', 0, '8692768000112', 1900, 29.95, 2),
(14739, 'tr-tr', 59, 1, '8697409602205', '10103837', 'Autokit Pasta Cila FA1-220', 'İçeriğindeki mikro temizleyiciler sayesinde boya üzerindeki kir ve lekeleri etkili bir şekilde boyaya zarar vermeden temizler. Boya üzerindeki matlık ve oksidasyonu yok ederek kalıcı parlaklık sağlar.', 0, '8697409602205', 1900, 24.95, 2),
