(14742, 'tr-tr', 143, 1, '8693699002770', '10103856', 'Carpex Oto Kokusu Kavanoz 100 ml Mango/Limon', 'Ürün Özellikleri:<br><br>Carpex Kavanoz Koku Mango Limon &amp; Kavun Kokusu (100 ml)<br><br>Güçlü esansları sayesinde uzun süre kalıcı bir etkiye sahiptir. Otonuzda, evinizde ve ofisinizde güvenle kullanabilirsiniz.<br><br>Kullanım Talimatı:<br><br>Şişeyi dik konumdayken üzerindeki beyaz kapağı çıkarınız.<br>Fitilin üzerindeki şeffaf güvenlik kapağını çevirerek çıkarınız.<br>Beyaz kapağı şişenin üzerine tık sesi duyana kadar bastırarak kapatınız.<br>Kokunun yoğunluğunu ayarlamak için beyaz kapağı sağa sola çevirmeniz yeterlidir.', 0, '8693699002770', 1900, 24.95, 2),
(14743, 'tr-tr', 810, 1, '71099150266', '10103858', 'Formula Pasta Cila Güçlü 230 ml FF1-5026', 'Küçük çizgileri ve bulanık görüntüyü ortadan kaldırıp boyayı parlatmak için gelişmiş Carnauba cilası içeren Formula 1 teknolojisi ile üretilmiştir. Boya rengini yeniler ve parlatır.', 0, '71099150266', 1900, 59.95, 2),
(14744, 'tr-tr', 143, 1, '8693699001186', '10103872', 'Carpex Çizik Giderici Pasta 200 gr', 'Ürün Özellikleri:<br><br>Carpex Yoğun Çizik Giderici Pasta (200 gr)<br><br>Aracınızda meydana gelen çiziklerin üzerine uyguladığınızda, yeni gibi bir görünüm elde etmenizi sağlar. Beklenmedik çiziklere karşı arabanızın görünümünü eski haline getiren bu ürün, her araç için önerilir. Metalik ve opak boyalı tüm yüzeylerde çizikleri gidermede kullanılır. Ağır oksidasyonu ve orta çizikleri boyalı yüzeylerden temizler. Solmuş ve matlaşmış boyaları canlandırır cilaya hazırlar. Tampon sürtmesi ile oluşan izleri çıkartmada kullanılır.<br><br>Kullanım Talimatı:<br><br>Aracınızı şampuan ile yıkayarak yüzeydeki kirlerden arındırınız.<br>Bir miktar ürünü yumuşak bir bez üzerine dökün.<br>Oksidasyonun, çiziklerin ve boya izlerini olduğu bölgeye ürünü eşit olarak dağıtın.<br>Eşit basınç kuruyana kadar uygulayınız. Uygulamadan sonra yüzeyi temiz bir bez ile silip, ürünü kalıntılardan temizleyiniz.<br><br>Makine ile Uygulama:<br><br>Temiz, kuru ve boyalı yüzeye doğrudan uygulayınız.<br>Polisaj makinesinde sünger veya yün disk ile 1200-1500 rpm devir hızında ve her seferinde küçük bir bölgeye eşit basınç ile kuruyana kadar uygulayınız.<br>Uygulamadan sonra yüzeyi temiz bir bez ile silip, ürünü kalıntılardan temizleyiniz.', 0, '8693699001186', 1900, 29.95, 2),
