(14746, 'tr-tr', 59, 1, '8697409601376', '10103882', 'Torpido Parlatıcı - Ultra Sünger', 'Otonuzun tampon, bakalit, lastik ve tüm deri yüzeylerini temizler ve parlatır. Uzun ömürlü olmasını sağlar. Parlaklığı sağlamanız için süngerli kısmı yüzeye sermeniz yeterli olacaktır. Her cins ayakkabı, vinleks deri eşyalarda da parlak görünüm sağlar.', 0, '8697409601376', 1900, 2, 2),
