(14752, 'tr-tr', 59, 1, '8697409602229', '10103949', 'Autokit Çizik Giderici Kalem', 'Hızlı bir şekilde çizikleri giderir. Direk kurur ve üzerinde tortu bırakmaz, bu nedenle neredeyse gözükmez. Her renge uygulanabilir. Derin ve büyük çizikleri de onarır. Zımparalamaya veya kazımaya gerek kalmadan onarır. Kısa sürede çizikleri yok edeceksiniz. Maliyeti birçok yönteme göre daha uygun. Kolay ve pratik bir şekilde kullanabileceğiniz bu ürünler aracınızın eskisi gibi yeni ve parlak durmasını sağlayabilirsiniz.', 0, '8697409602229', 1900, 19.95, 2),
