(14754, 'tr-tr', 810, 1, '8692768016816', '10104420', 'Castrol Magnatec 10W/40 Motor Yağı 1Lt', 'CASTROL MAGNATEC 10W-40 A3/B3 \"AKILLI MOLEKÜLLERLE 5 KAT DAHA FAZLA KORUMA*\" ÜRÜN TANIMI Castrol Magnatec 10W-40 A3/B3, formülasyonundaki \"akıllı molekül\" özelliği ve üstün sentetik teknolojisi ile üretilmiş bir motor yağıdır. İlk çalışma anından itibaren motor parçalarına yapışarak kuvvetli bir koruma tabakası sağlar. Böylece Castrol Magnatec 10W-40 A3/B3 günümüz araçlarının ihtiyaç duyduğu ek korumayı, API SL performans seviyesine göre 5 kat daha fazla koruma sağlayarak yerine getirir. *API SL performans seviyesine göre PERFORMANS SEVİYELERİ API SL/CF ACEA A3/B3 VW 505.00 MB-Approval 229.1 KULLANILDIĞI YERLER Castrol Magnatec 10W-40 A3/B3 , dünyanın önde gelen araç üreticilerinin talep ettiği performans seviyelerini karşılayan, turbo veya enjektörlü tüm eski ve yeni motor teknolojisi ile üretilmiş otomobiller için uygun motor yağıdır. KULLANIM ÖZELLİKLERİ VE FAYDALAR · Motor yüzeylerine güçlü bir mıknatıs gibi yapışarak ilk çalışma anında ve sonrasında ek bir koruma tabakası oluşturur. · Metal yüzeylere bağlanarak motor parçalarını aşınmaya karşı daha dayanıklı hale getirir. · Aşınma riskinin yüksek olduğu ilk çalıştırma anında sıradan motor yağlarına kıyasla daha üstün koruma sağlar. . Her türlü sürüş ve iklim koşullarında motoru mükemmel korur. TİPİK FİZİKSEL VE KİMYASAL ÖZELLİKLERİ Test Birim Tipik Değer Yoğunluk @ 15 ºC g/cm3 0.874 Viskozite @ 40 ºC cSt 103 Viskozite @ 100 ºC cSt 15 Viskozite @ -25 ºC cP 6800 Viskozite İndeksi - 153 Toplam Baz Numarası mg KOH/g 8.1 Parlama Noktası (PMCC) 0C 208 Akma Noktası 0C -36', 0, '8692768016816', 1900, 39.95, 2),
