(14756, 'tr-tr', 810, 1, '869276800259', '10104444', 'Castrol Fren Hidroliği 0.5 Lt Dot 4', 'BP Hydraulic Brake Fluid DOT 4 Üstün Kaliteli Sentetik Fren Hidrolik Sıvısı BP Hydraulic Brake Fluid DOT 4, hidrolik fren sistemlerinde ve debriyajlarda kullanılmak üzere geliştirilen, yüksek kaliteli sentetik fren hidrolik sıvısıdır. Mineral bazlı hidrolik sıvısı tavsiye edilenler hariç binek ve ticari araçların diskli ve kampanalı fren sistemlerinde ve debriyajlarında güvenli ve etkin olarak kullanılabilir.Yüksek kaynama noktası sayesinde gerek yoğun şehir içi trafiğinde gerekse uzun süreli yolculuklarda yükselen fren sıcaklıklarına rağmen görevini eksiksiz yerine getirir ve güvenli yolculuk sağlar.Modern sentetik formülasyonu oksidasyonu, pas ve korozyonu önleyici kimyasallar içerir. Özellikleri \" Sentetik formülasyonu sayesinde kusursuz güç iletimi ve uzun servis ömrü sağlar. \" Donma noktasının düşük olması her türlü soğuk iklimde akıcılığını korumasını ve hidrolik basıncın verimli bir şekilde fren balatalarına ve disklere iletilmesini sağlar. \" Rutubete maruz kaldığı durumlarda yapısal kararlılığını koruyarak kaynama noktasının düşmesine engel olur. \" Özellikle ABS fren sistemine sahip araçlarda üstün performans gösterir. \" Güç iletiminin yanı sıra kusursuz yağlama özelliklerine sahiptir. \" Metal, lastik ve kauçuk malzemeler ile tam uyumlu çalışır. \" Aynı spesifikasyona sahip diğer hidrolik sıvıları ve bütün fren sistem komponentleri ile uyumludur. Onay ve Şartnameler \" FMVSS 116 DOT 3&amp;4 \" ISO 4925 \" SAE J 1703 standartlarını fazlasıyla karşılar. Tipik Özellikleri Test Birim Tipik Değer Yoğunluk @ 15 ºC g/cm3 1.070 Viskozite @ 100 ºC cSt 1.5 min. Viskozite @ -40 ºC cP 1400 max. Kuru Kaynama Noktası (ERBP) 0C 260 min. Islak Kaynama Noktası (WERBP) 0C 165 min.', 0, '869276800259', 1900, 39.95, 2),
(14757, 'tr-tr', 810, 1, '8692768000143', '10104447', 'Castrol GTX 20W-50 Motor Yağı 4 lt', 'CASTROL GTX 20W/50 \"ÜSTÜN KORUMA\" ÜRÜN TANIMI Castrol GTX 20W-50, günümüzün motorlarını,her türlü iklim ve kullanım şartlarında yağlamak ve korumak için, kaliteli mineral bazyağlar ve geliştirilmiş katıklarla formüle edilmiş bir motor yağıdır. Castrol GTX 20W-50, herhangi bir sıradan yağın çok ötesinde; motorunuzu, hergün karşılaştığı yüksek ve düşük sıcaklıklardaki aşınmaya karşı %50 daha fazla korur. PERFORMANS SEVİYELERİ API SL/CF KULLANILDIĞI YERLER Castrol GTX 20W-50, tüm benzinli, turboşarjlı motorlarda ve API CF sınıfı yağ kullanımı gerektiren dizel binek otomobiller ve ticari araçlarda kullanılabilir. KULLANIM ÖZELLİKLERİ VE FAYDALAR -Yüksek ve düşük sıcaklıklarda aşınmaya karşı %50 daha fazla koruma sağlar.* -Çamurlaşmaya karşı maksimum koruma sağlar.* -Yüksek sıcaklıklarda yağın bozulmasına ve viskozite kaybına karşı üstün koruma sağlar.* -Motoru soğutur ve temizler. *API SL performans seviyesi ile karşılaştırıldığında TİPİK FİZİKSEL VE KİMYASAL ÖZELLİKLERİ Test Birim Tipik Değer Yoğunluk @ 15 ºC g/cm3 0.886 Viskozite @ 40 ºC cSt 158.9 Viskozite @ 100 ºC cSt 18 Viskozite @ -15 ºC cP 9300 Viskozite İndeksi - 125 Toplam Baz Numarası mg KOH/g 8.1 Parlama Noktası (PMCC) 0C 198 Akma Noktası 0C -29', 0, '8692768000143', 1900, 99.95, 2),
