(14759, 'tr-tr', 810, 1, '869276800021', '10104449', 'Castrol Gtx 20W/50 Motor Yağı 1.Lt', 'CASTROL GTX LPG 20W-50 \"LPG\'li Araçlarda Üstün Koruma\" ÜRÜN TANIMI Castrol GTX LPG 20W-50, LPG yakıt sistemiyle çalışan araçların özel yağlama ihtiyaçlarını karşılamak üzere özel olarak formüle edilmiş bir motor yağıdır. Castrol GTX LPG 20W-50, API SL/CF performans seviyesinde bir motor yağı olma özelliği sayesinde, özellikle zorlu şehiriçi trafiğinde, dur-kalkların motorda yarattığı olumsuz etkilerin azalmasını sağlar ve LPG yakıt kullanımından kaynaklanan yetersiz yağlamaya çözüm getirir. PERFORMANS SEVİYELERİ API SL/CF KULLANILDIĞI YERLER Castrol GTX LPG, LPG sistemiyle çalışan araçlarda kullanılır. KULLANIM ÖZELLİKLERİ VE FAYDALAR -Yüksek ve düşük sıcaklıklarda aşınmaya karşı %50 daha fazla koruma sağlar.* -Çamurlaşmaya karşı maksimum koruma sağlar.* -Yüksek sıcaklıklarda yağın bozulmasına ve viskozite kaybına karşı üstün koruma sağlar.* -Motoru soğutur ve temizler. -Göreceli olarak daha kuru olan LPG yakıtın kullanımından kaynaklanan yetersiz yağlamaya çözüm getirir. *API SL performans seviyesi ile karşılaştırıldığında TİPİK FİZİKSEL VE KİMYASAL ÖZELLİKLERİ Test Birim Tipik Değer Yoğunluk @ 15 ºC g/cm3 0.886 Viskozite @ 40 ºC cSt 158.9 Viskozite @ 100 ºC cSt 18.1 Viskozite @ -15 ºC cP 9300 Viskozite İndeksi - 126 Toplam Baz Numarası mg KOH/g 8.2 Parlama Noktası (PMCC) 0C 198 Akma Noktası 0C -29', 0, '869276800021', 1900, 29.95, 2),
(14760, 'tr-tr', 810, 1, '8698510814518', '10104450', 'Bp Direksiyon Yağı 1Lt', 'Araba temizliği ve bakımı ile ilgili aradığınız tüm ürünleri uygun fiyatları ile sanal market Özdilekteyim.com\'dan temin edebilirsiniz. Bp Direksiyon Yağı\'nı araçlarınızda güvenle kullanabilirsiniz. <br><br><br>Düşük akma noktası ve üstün soğuk çalışma özellikleri ile düşük sıcaklıklarda bile sorunsuz performans gösterir.<br>Sızdırmazlık elemanlarını, hortumları ve metal parçaları yağlayıp, koruyarak, sessiz, düzgün ve akıcı performans gösterir, parçaların ömrünü uzatır.<br>Sistemdeki sızıntı, ses ve pas problemlerini önlemede yardımcı olur.<br>Tüm sistemi aşınma, oksidasyon, korozyon ve köpüklenmeye karşı korur.<br>Soğutma suyunun donma noktasını düşürerek soğuk iklimlerde genleşmeden kaynaklanan çatlama ve diğer hasarların oluşumuna engel olur.<br>Sızdırmazlık elemanları ile uyumlu çalışı', 0, '8698510814518', 1900, 34.95, 2),
