(14772, 'tr-tr', 810, 1, '8697409606425', '12220789', 'Autokit Ön Cam Güneşlik Metalize 60x130cm \'Ayyıldız Türkiye!', 'Yazın yanıcı sıcaklarında aracınız park halindeyken aracınızın torpido ve direksiyonunu zararlı güneş ışınlarına karşı korur, aracınızın ısınmasını azaltır. Bütün binek araçlar için uygundur. Ürün üzerinde bulunan lastikler sayesinde güneşlik katlı olarak kolay saklanabilir. Dış yüzeyi özel alüminyum folyo kaplıdır. Reflektif özelliği ile bu sayede gelen bütün ışıkları yansıtarak dikkat çeker. Aracın ön camına göre dizayn edilmiştir. Ergonomik tasarımıyla pratik ve kullanışlıdır.', 0, '8697409606425', 1901, 16.9, 2),
(14773, 'tr-tr', 810, 1, '8693699000011', '10104567', 'Gojo Bel Minderi', 'Ürün Özellikleri:<br><br>Gojo Ortopedik Fileli Sırt Destek Minderi Bel Yastığı, Anatomik şekli ve rahatlatıcı özelliklerinden dolayı omurganın eğimine mükemmel olarak oturur. Seyahatte veya evdeyken kullanışlı bir bel desteğidir. Sırtı rahatlatır. Uzun süreyle konforlu oturmanızı sağlar. Evde işte seyahatte doğru oturma pozisyonuyla ve doğru vücut duruşuyla bel ve sırt ağrılarını engeller ve hafifletir. Sürekli oturarak çalışanların ihtiyacı olan bir üründür. Bel ve sırt ağrılarını önler. Arkasında bulunan elastik bantla her türlü koltuğa sabitlenir.<br><br>Kullanım Talimatı: Arkasındaki lastiği gereken kullanılacak koltuğun arkasına geçirerek kullanabilirsiniz.', 0, '8693699000011', 1901, 16.95, 2),
