(14826, 'tr-tr', 479, 1, '8697409608313', '11894533', 'Magic Dose Küre Koku 100 ml', 'Otomobilinizde torpido üzeri, arka pandizot, ön koltuk altlarına koymaya uygundur. Evinizde, banyonuzda, ofisinizde her ortamda rahatlıkla kullanılabilir. Evinize, ofisinize, aracınıza yüksek kalitede ve uzun ömürlü hoş bir koku verir. Etkisini uzun süre koruyan ve birbirinden hoş koku çeşitleri ile ortam havasını etkili bir biçimde değiştirir.', 0, '8697409608313', 1901, 14.95, 2),
(14827, 'tr-tr', 810, 1, '8692534441361', '11929064', 'Automix Koltuk Arkası Keçe Organizer', 'Araç koltuklarının arkasına yerleştirerek, araç içerisindeki dağınıklığı toparlayabilirsiniz. Araç içerisinde bebeğiniz ve çocuklarınızın ihtiyaçlarını bir arada taşımak için oldukça idealdir. Tablet, oyuncak, biberon, su şişeleri, kutu içecekler ve kağıt mendil vb. gibi eşyalarınızı düzenli bir şekilde aracınızda bulundurabilirsiniz.', 0, '8692534441361', 1901, 29.95, 2),
(14828, 'tr-tr', 810, 1, '8692534441170', '11929065', 'Automix Cam Temizlik Havlusu 50x70 cm', 'Automix Profesyonel Mikrofiber Cam Temizlik Havlusu, %100 mikrofiber özelliktedir. Cam yüzeylerin lekesiz temizliği için çok sık dokunmuş mikrofiber dokusu sayesinde yüzeyde leke bırakmaz.Cam vitrinler, büyük yekpare camlar için idealdir. Özel dokulu mikrofiber yüzeyi sayesinde cam, krom ve ayna gibi parlak yüzeylerde kiri, yağlı lekeleri ve parmak izlerini kolaylıkla temizler. Emici özelliğiyle yüzeyi anında kurular. Kolay sıkılır ve çabuk kurur. Rengini ve şeklini uzun süre korur. Kuru ve nemli kullanım için idealdir. Kirlerin hızlı ve kesin bir şekilde temizlenmesini sağlar. Hologram oluşturmaz, son derece yüksek parlaklık sağlar. Temizlik maddesi olmadan temizler. Statik etkisiyle yüzeydeki tozları toplar. Yıpranmadan defalarca yıkanıp kullanılabilir. Otomobil ve evde yüzeylerin kusursuz bir şekilde temizlenmesine yardımcı olur.', 0, '8692534441170', 1901, 19.95, 2),
(14829, 'tr-tr', 810, 1, '8692534441156', '11978130', 'Automix Yüzey Parlatma Havlusu 50x70 cm', 'Automix Detay Havlusu, %100 mikrofiber özelliktedir. Cam yüzeylerin lekesiz temizliği için çok sık dokunmuş mikrofiber dokusu sayesinde yüzeyde leke bırakmaz. Cam vitrinler, büyük yekpare camlar için idealdir. Özel dokulu mikrofiber yüzeyi sayesinde cam, krom ve ayna gibi parlak yüzeylerde kiri, yağlı lekeleri ve parmak izlerini kolaylıkla temizler. Emici özelliğiyle yüzeyi anında kurular. Kolay sıkılır ve çabuk kurur. Rengini ve şeklini uzun süre korur. Kuru ve nemli kullanım için idealdir. Kirlerin hızlı ve kesin bir şekilde temizlenmesini sağlar. Hologram oluşturmaz, son derece yüksek parlaklık sağlar. Temizlik maddesi olmadan temizler. Statik etkisiyle yüzeydeki tozları toplar. Yıpranmadan defalarca yıkanıp kullanılabilir. Otomobil ve evde yüzeylerin kusursuz bir şekilde temizlenmesine yardımcı olur.', 0, '8692534441156', 1901, 19.95, 2),
