(14837, 'tr-tr', 810, 1, '8697409606920', '11513024', 'Autojoy Bagaj Organizer FA1-692', 'Bagajınızdaki dağınık eşyalarınızın toplanmasına yardımcı olur. Taşıma kulpları sayesinde istediğiniz yere götürebilirsiniz. Pratiktir ve kolayca kurulum sağlanır. Kullanmadığınız zaman katlayarak saklayabilirsiniz.', 0, '8697409606920', 1901, 27.95, 2),
(14838, 'tr-tr', 479, 1, '8697409603585', '11596096', 'Magic Dose Oto Kokusu Küre Marina 75ml', 'Araç, ev, ofis kullanımı için idealdir. Ürünü ambalajından çıkarınca kilitleme ipiyle asarak kullanınız. Tekstil, deri, vinil ve plastik yüzeylere temas ettirmeyiniz.', 0, '8697409603585', 1901, 14.95, 2),
(14839, 'tr-tr', 810, 1, '8697409604773', '11582653', 'Autokit Universal Paspas Siyah FA1-477', 'Universal yapısı sayesinde belirtilen kesim yerlerinden kesilerek tüm yerli ve yabancı 4x4, suv, ticari otomobillerde kullanılabilir. Manuel ve otomatik araçlara uyumludur. %100 PVC enjeksiyon ile son teknoloji kullanılarak üretilmiş olup zaman içerisinde aşınma ve şekil bozukluğuna neden olmaz ham maddesi esans ile desteklenmiştir ve aracınızda hoş koku bırakır. Kendine has özel tasarımı ve desenleriyle aracınızda şık bir görüntü sağlar. Aracınıza dökülebilecek sıvı maddeleri, tasarımındaki kanallardan akarak bir arada tutulur ve bu sayede aracınız temiz kalır. Oto paspasımız şoför, ön yolcu, arka yolcu ve şaft üstü kısımlarından oluşmaktadır. Pratik ve hızlı bir şekilde yıkanır, hızlı kurur ve su ile temasından dolayı koku yapmaz.', 0, '8697409604773', 1901, 49.95, 2),
(14840, 'tr-tr', 810, 1, '8697409600546', '10104493', 'Trafik Seti Çift Reflektörlü FA1-054', 'Türk Standartları Enstitüsü’ne uygun olacak şekilde tasarlanan bu ürünün içinde; 1 kg’lık yangın söndürme tüpü, 2 adet Euronorm demir ayaklı üçgen reflektör, ilk yardım seti, boyunluk, takoz, çekme halatı ve kendiliğinden şarj edilme özellikli el feneri bulunuyor. Arıza ve kaza gibi durumlarda ihtiyaç duyulabilecek gereçlerden oluşan trafik seti, sürücü ve yolcuların güvenliği için oldukça önem arz ediyor.', 0, '8697409600546', 1901, 149, 2),
(14841, 'tr-tr', 810, 1, '8696386212032', '10103578', 'Erpar Serenat Oto Paspas Gri Şaft Üstü', 'Universal tasarımıyla tüm marka model araçlara mükemmel uyum<br>Uluslararası standartlara uygun yerli üretim<br>%100 kauçuk ham madde, PVC içermez<br>Kolay temizlenebilen modern tasarım<br>Kaymayı engelleyen özel taban tasarımıyla paspasınız, sürüş pedallarına doğru toplanma yapmaz<br>Yüksek ısı ya da soğuğa maruz kalsa da orijinal yapısını korur. Kırılma, çatlama ya da sertleşme yapmaz<br>Oluklu yapısıyla toz, kir ve çamurun aracınızın zeminine ulaşmasını engeller<br>Kaliteli yapısı ile koku yapmaz, deformasyona uğramaz<br>2 farklı renk seçeneği<br>Ön ve arka toplam 5 parça kauçuk paspas seti<br>Toplam 4,6 kg ağırlık<br>', 0, '8696386212032', 1901, 89.9, 2),
