(14843, 'tr-tr', 810, 1, '8681015111039', '11404717', 'Autojoy Seyehat Boyun Yastığı', 'Doğru oturma pozisyonunu destekler, işyeri, otomobil ve ev için idealdir. Yıkanabilir özel yapıya sahip ürün aynı zamanda modern ve şık tasarıma sahiptir. Sağlam ve dayanıklı malzemeden üretilen bu ürünü konforlu bir şekilde uzun yıllar kullanabilirsiniz.', 0, '8681015111039', 1901, 24.95, 2),
