(14846, 'tr-tr', 810, 1, '8697409602359', '10546095', 'Çok Amaçlı Cam Temizleyici 500 Ml', 'Kullanma Talimatı: Yüzeye uyguladıktan sonra durulamadan kuru bir bez ile siliniz. Geliştirilmiş yeni formülü ile iç ve dış camlar, araba ayna ve camları kapı, pencere, vitrin, ayna, duşakabin, fayans, cam yemek masası, buzdolabı, fırın gibi cam ve parlak yüzeyleri iz bırakmadan temizler ve parlatır. Plazma ve LCD ekran TV’lerde kullanmayınız .', 0, '8697409602359', 1901, 7.95, 2),
(14847, 'tr-tr', 810, 1, '8697409601468', '10104627', 'Cam Suyu Konsantre Parfümlü 50 ml FA1-146', 'Parfümlü Autokit konsantre cam suyu, silecek lastiklerinin cama tam temasını sağlayarak silecek performansını artırır. Yağ, is, toz, haşere kalıntılarını ve egzoz gazlarından oluşan ön camdaki kirlenmeyi yok eder, açık ve güvenli bir görüş sağlar. <br><br>Kullanma Talimatı: Aracımızın silecek suyu deposuna ilave edilerek kullanılır. Konsantre cam suyu şampuanı bir silecek suyu deposu için yeterlidir. <br><br>Uyarı: Çocuklardan uzak tutunuz. Gözler ve yüz için tahriş edicidir. Cildi korumak amacı ile ellerin temizlik maddesi ile uzun süre temasından kaçınınız. Yanlışlıkla yutulması halinde derhal doktora başvurunuz. Yanıcı ve parlayıcıdır. Ateşten uzak tutunuz. Çocukların ulaşamayacağı yerlerde saklayınız.', 0, '8697409601468', 1901, 3.95, 2),
(14848, 'tr-tr', 387, 1, '6910004472175', '10103230', 'İnwells Oto Silecek 9 Aparatlı 43 Cm', '9 farklı montaj aparatı ile eski ve yeni tüm araçlara uyumlu universal cam sileceğidir. <br> Özel tasarım lastiği ile sessiz ve iz bırakmadan çalışır, uzun ömürlü malzemelerden üretilmiştir. <br> Aracın cam yapısına göre şekil alarak, sıfır boşluk bırakır. <br> Cam da iz ve oynama yapmadığı için ses yapmaz.', 0, '6910004472175', 1901, 24.95, 2),
