(14857, 'tr-tr', 810, 1, '8697409604278', '10103529', 'Oto Paspas Lüks Havuzlu Gri Şaft Üstü', '2 ön, 2arka, 1 şaft üstü toplam 5 parçadan oluşur. Aracınızın ölçüsüne göre \"kesilebilir özelliğe\" sahiptir. Oto paspas setinin yapım aşamasındayken çamur tutacak şekilde oluklar tasarlanmıştır. Pratik ve kolay şekilde yıkanır, çabuk kurur. Derin havuz sayesinde aracınızın içini çamurdan ve tozdan maksimum koruma sağlar. Suyun havuz içerisinde toplanması paspas dışına çıkmaması düşünülerekten tasarlanmıştır. Havuz kauçuk paspas, altı dökülmeyen ve hareket halinde paspasın kaymasını, toplanmasını engelleyecek kauçuk tabana sahip tırtıklar vardır. Temizlenirken koku yapmaz.', 0, '8697409604278', 1901, 99, 2),
