(14960, 'tr-tr', 810, 1, '8681619020126', '11758102', 'Mefatech Kar Paleti Large', 'Tüm binek, hafif ticari ve 4x4 araçlara uygun Mefatech Kar Paleti ile karda özgürce yol alın. Kar zincirlerine göre çok daha kolay monte edilir, kar çoraplarına göre çok daha dayanıklı ve efektiftir. Klips ile kolayca montaj, tek hareket ile demontaj yapılır. <br><br>Lastik taban ölçüsü kar paleti boyutu: 165 - 225 mm arası Large (L) / 235 - 175 mm arası XLarge (XL)', 0, '8681619020126', 1902, 399, 2),
