(14962, 'tr-tr', 810, 1, '8681619020164', '11758104', 'Mefatech Kar Paleti Premium Large', 'Taşıma çantası, buz kırıcı, montaj eldiveni hediyelidir. 5 dakikada kolay montaj yapabilirsiniz. Gerdirme kelepçeleri sayesinde her ebat lastiğe uyumludur. Bir tekerleğe üç adet kar paleti takılır toplam 6 adettir. 5 ve 6 kollu jantlar ile uyumludur. Lastik taban ebadınız 165 - 225 arası ise L beden; 235 -275 arası ise XL beden almanız gerekmektedir. Her paletin üzerinde 8 adet çivi vardır karda kaymayı patinaj yapmayı önler.', 0, '8681619020164', 1902, 499, 2),
