(14981, 'tr-tr', 810, 1, '8697409609280', '10104577', 'Autokit Ayak Pompası', 'Ayak pompası ile araç, bisiklet lastikleri, top ve deniz yatağı şişirmede kullanabilirsiniz. Güçlü metl gövdeye sahiptir. Üzerinde hava basıncını görmenizi yarayan hava saati mevcuttur. Ayak pompası 50 cm uzunluğunda hortumuna sahiptir. Değişik tipte ürünü şişirebilmek için 3 adet aparatı mevcuttur. Ayak pompası 100 Psi’lik hava basar ve 5 bar hava basıncıyla çalışır. TÜV ve CE belgeleri bulunmaktadır. <br><br>Kullanma Talimatı: Ayak üzerindeki kancayı takınız. Hortum ucunu siboba yerleştirip kilidi ile kilitleyiniz. Saatten okuduğunuz basınç yeterli seviyeye geldiğinde kilidi açınız. <br><br>Uyarı: Kilidi açmadan hortumu çeker iseniz ürüne ve lastik sibobunuza zarar verebilirsiniz.', 0, '8697409609280', 1902, 34.95, 2),
(14982, 'tr-tr', 143, 1, '8693699222505', '10104580', 'Carpex Cam Buğu Önleyici 200Ml', 'Aracınızın camında buğulanmayı önler, net yol görüşü sağlar. Ayrıca buğulanmaya maruz kalan tüm ayna ve camlarda (banyo, gözlük, kask, yat) kullanabilirsiniz. Kullanımı kolaydır.', 0, '8693699222505', 1902, 16.95, 2),
(14983, 'tr-tr', 332, 1, '8693699420017', '10104585', 'Carpex Cam Buz Çözücü 250Ml', 'Camlardaki buzu ve kırağıyı çözer. Net bir yol görüşü sağlar. Kapı kilitlerindeki buzlanmayı çözer. İz ve leke bırakmaz', 0, '8693699420017', 1902, 24.9, 2),
(14984, 'tr-tr', 810, 1, '6942138960495', '10104590', 'Bestway Seyahat Yastığı 67006N', 'Ürün Özellikleri:<br><br>Vinil malzemeden üretilen Bestway seyahat yastığı, 37x24 cm ebatlarındadır. Seyahatlerinizde güvenle kullanabileceğiniz bu ürünü sitemizden güvenli bir şekilde satın alabilirsiniz.', 0, '6942138960495', 1902, 9.95, 2),
(14985, 'tr-tr', 810, 1, '8693699003005', '10104596', 'Bijon Anahtarı Çelik 4\'Lü', 'Ürün Özellikleri:<br><br>Bijon Anahtarı, bijon vidalarını gevşetmek ve sıkılaştırmak içindir.<br>17 inç, 19 inç, 21 inç ve 23 inç vidalar ile uyumludur.<br>Binek otomobiller, S.W, HB, Hafif ticari araçlar, minibüs ve panelvan araçların tümünde bulunan bijon tipleridir.<br>%100 çelik dökümden üretilmektedir.<br>Kaliteli ağır malzeme 1,2 kg.', 0, '8693699003005', 1902, 69.9, 2),
