(14989, 'tr-tr', 143, 1, '8693699222512', '10104628', 'Carpex Yağmur Kaydırıcı 200Ml', 'Yağmur damlacıklarının cama tutunmasını zorlaştırarak, rüzgarla kayıp uzaklaşmasını sağlar. Yağmurda ön, arka ve yan camlarda açık görüş sağlar.', 0, '8693699222512', 1902, 10.95, 2),
(14990, 'tr-tr', 810, 1, '6933410614267', '10104629', 'Oto Ön Cam Güneşliği Metalize 60X120Cm Autokit', 'Yazın yanıcı sıcaklarında aracınız park halindeyken aracınızın torpido ve direksiyonunu zararlı güneş ışınlarına karşı korur. Aracınızın ısınmasını bir nevi azaltır. Bütün binek araçlar için uygundur. Ürün üzerinde bulunan lastikler sayesinde güneşlik katlı olarak kolay saklanabilir. Dış yüzeyi özel alüminyum folyo kaplıdır. Reflektif özelliği ile bu sayede gelen bütün ışıkları yansıtarak dikkat çeker. Aracın ön camına göre dizayn edilmiştir. Ergonomik tasarımıyla pratik ve kullanışlıdır.', 0, '6933410614267', 1902, 13.95, 2),
(14991, 'tr-tr', 810, 1, '8693699530044', '10104634', 'Gojo Çekme Halatı 3 m', 'Ürün Özellikleri:<br><br>Gojo Çekme Halatı Kemer, döküm kancalı 3.5 m, siyah dış kaplamalıdır. Çekme halatının güçlü bağlantı noktaları sayesinde güvenli ve pratik kullanım sağlar. Özel saklama çantasıyla kolayca yer kaplamadan muhafaza edebilirsiniz.<br><br>Kullanım Talimatı:<br><br>Halatın üzerinde herhangi bir yıpranma olup olmadığını kontrol ediniz.<br>Halatın her iki ucunun emniyetli bir şekilde araçlara bağlı (doğru pozisyon için araç el kitabına bakınız) ve uygun çekme noktalarında (tampona değil) olduğuna emin olunuz.<br>Freni, direksiyon ve farları arızalı olan araçları çekmeyiniz.<br>Havalı direksiyon ve freni olan araçlarda, motorun kapalı olduğu durumlarda, fren pedalı ve direksiyonu kullanmak için daha fazla güç gerekir.<br>Dörtlü flaşörlerinizi yakınız ve aracınızın arkasına uyarı üçgeni asınız.<br>Frenlerin kilitlenmemesi için, kontak anahtarını \"açık\" durumda tutunuz.<br>Aracı yavaş ve dikkatli kullanınız. Virajlardan önce arkadaki araca zamanında uyarı yapınız.<br>Çekilen araç, çekme halatını görebilmeli ve gergin durumda olduğundan emin olmalı.<br>Gerektiğinde hafif fren uygulanabilir.<br>Not: Bu çekme halatı normal yol koşullarında ve etiketinde belirtilen çekme gücü kuvvetinde belirtilen kapasitedeki araçları çekmek üzere dizayn edilmiştir. Amacı dışındaki kullanımlar için üretici sorumlu tutulamaz.', 0, '8693699530044', 1902, 39.95, 2),
(14992, 'tr-tr', 810, 1, '8697409601628', '10104648', 'Autokit Yazlık Cam Suyu Limon 1Lt', 'Yazlık oto cam suyu, aracınızın silecek suyu deposuna ilave edilerek kullanılır. Konsantredir. Aracınızın cam yüzeylerinde kir, is, toz ve böcek kalıntılarını etkili bir şekilde çözer ve temizler. Her türlü yol ve iklim şartlarında daha güvenli bir görüş sağlar. Cam üzerinde leke bırakmaz. Oto boyası, cilası, silecek ve lastiklerine zarar vermez. Kokulu özelliği sayesinde su fıskiyelerinden aracın içine hoş koku sağlar.', 0, '8697409601628', 1902, 6.95, 2),
(14993, 'tr-tr', 810, 1, '8681619020065', '10104654', 'Lastik Zinciri 2\'Li No:80 Kutulu', '', 0, '8681619020065', 1902, 199, 2),
(14994, 'tr-tr', 810, 1, '8697409606500', '10104657', 'Oto Yan Cam Perdesi Siyah Renk', 'Tüm yerli, yabancı, marka ve model araçlarda kullanabilecek şekilde üretilip tasarlanmıştır. Cam güneşliği aracınıza yan camdan gelen güneş ışınlarını ortalama %70 - %80 oranında keserek size ve yolculara konforlu bir sürüş sağlar. Güneş ışınlarını kestiğinden bebekleri, çocukları, yaşlıları güneşin zararlı ışınlarından korur. Gece sürüşlerinde yan camlardan gelebilecek far ışıklarını da keserek gözünüzün yorulmasını engeller. Ürünü defalarca kullanabilirsiniz. Profesyonellik gerektirmeyen, kişisel uygulamalı bir üründür. Ürünü montaj vantuzları ile temiz cama uygulayınız. Gerektiğinde vantuzu az miktarda ıslatarak yapıştırınız.', 0, '8697409606500', 1902, 9.95, 2),
(14995, 'tr-tr', 810, 1, '859369902009', '10104659', 'Gojo Oto Akü Takviye Kablosu', '', 0, '859369902009', 1902, 79.95, 2),
(14996, 'tr-tr', 547, 1, '8698849339652', '12202197', 'Smart Socket 3\'lü Anahtarlı Priz', '', 0, '8698849339652', 1903, 24.95, 2),
