(14998, 'tr-tr', 810, 1, '8698849339706', '12305411', 'Smart Socket Akım Korumalı 6\'lı Priz 1,5 mt', '', 0, '8698849339706', 1903, 64.95, 2),
(14999, 'tr-tr', 810, 1, '8698849339713', '12305422', 'Smart Socket Akım Korumalı 6\'lı Priz 3 mt', '', 0, '8698849339713', 1903, 69.95, 2),
(15000, 'tr-tr', 810, 1, '8698849339720', '12305423', 'Smart Socket Akım Korumalı 3\'lü Fiş Priz', '', 0, '8698849339720', 1903, 39.95, 2),
(15001, 'tr-tr', 810, 1, '8697409602557', '10103352', 'Kaydırmaz Yapışkanlı Ped', 'Yapışkanlı kaydırmaz ped, bukelemunların her türlü yüzeyi kavrayabilen ayaklarından esinlenmiştir. Üstünde gözle görülemeyecek trilyonlarca hava deliği bulunmaktadır. Uçak ve helikopter kokpitlerinde kullanılmaya başlayan yapışkanlı kaydırmaz ped, şimdi ise evde, ofiste ve güvenli sürüş için otomobilinizde kullanılabilir.<br><br>Teknolojik vakumlardan oluşan benzersiz yüzey, yapıştırıcı, mıknatıs veya vida kullanmanıza gerek kalmadan 90 derece dahi düz nesneleri tutabilme özelliği taşır (panel, buzdolabı, seramik, cam, ahşap, pencere).Yapışkanlı kaydırmaz ped, -50 ila 100 derece arasındaki tüm sıcaklıklara dayanıklıdır ve uzun ömürlüdür. Herhangi bir zehirli madde ihtiva etmez, kokusuzdur ve geri dönüşebilir. Yapıştırdığınız yüzeyden kolayca sökebilirsiniz, herhangi bir iz veya kalıntı bırakmaz. Teknolojik pediniz kirlendiyse ılık suyla yıkayabilirsiniz.', 0, '8697409602557', 1903, 6.95, 2),
(15002, 'tr-tr', 810, 1, '8698657216893', '11749426', 'Kapı Altı Eşik Süngeri 0656-01-0001', '', 0, '8698657216893', 1903, 7.95, 2),
(15003, 'tr-tr', 810, 1, '8691751287110', '11563998', 'Tornavida Düz 6*100', '', 0, '8691751287110', 1903, 7.9, 2),
(15004, 'tr-tr', 810, 1, '8691751287257', '11564000', 'Tek-İş Kurbağacık', 'Çene açıklığı maksimum 22 milimetredir. Yüksek kalite çelik kullanılarak hazırlanan ürünün sapı ise plastik kaplamadır.', 0, '8691751287257', 1903, 39.9, 2),
(15005, 'tr-tr', 810, 1, '8691751288308', '11564001', 'Yan Keski Blisterli', 'Kablo, tel kesme ve kablo sıyırma için kullanabileceğiniz el aletleri arasında yer alan araçtır. Ergonomik sap ile rahat tutuş sağlar.', 0, '8691751288308', 1903, 24.9, 2),
(15006, 'tr-tr', 810, 1, '8691751288322', '11564044', 'Pense Blisterli', 'Tel ve çivi gibi ürünleri kolaylıkla tutmaya, çekmeye ya da kesmeye yarar. Ergonomik sap ile rahat tutuş sağlar.', 0, '8691751288322', 1903, 27.9, 2),
(15007, 'tr-tr', 810, 1, '8691751288315', '11564045', 'Kargaburnu Blisterli', 'Pensenin sığamayacağı yerlerdeki parçaların tutulması ve daha küçük ölçüdeki bükme, kıvırma ve şekillendirme işlerinde kullanılır. Yapısı gereği ulaşılması zor alanlara alınması gereken parçaları tutarak almanızı sağlayan gereçtir.', 0, '8691751288315', 1903, 24.9, 2),
(15008, 'tr-tr', 810, 1, '8691751287073', '11565056', 'Tek-İş Düz Tornavida 5 x 125', '', 0, '8691751287073', 1903, 5.95, 2),
