INSERT INTO `products` (`ID`, `LanguageCode`, `BrandID`, `UnitID`, `Barcode`, `SKU`, `Name`, `Description`, `State`, `Code`, `CategoryID`, `Price`, `Source`) VALUES
(15011, 'tr-tr', 810, 1, '8697409605404', '10104138', 'Autokit Çift Taraflı Bant 10 mm* 10 mt', 'Arabada, evde, ofiste, vb. çeşitli alanlarda kullanılmak üzere tasarlanmıştır. Suya karşı izole edilebilecek bölümlerde, kaporta üzerinde darbelere karşı koruyucu olarak ve tüm yüzeylerde uygulanabilir. Her iki tarafında yapışkanlı özellikte ve rulo içerisinde koruma bandı mevcuttur. <br><br>Uygulama: Uygulanacak yüzeyi kir, pas ve kimyasal maddelere karşı temizleyin. Uygulanacak cismin arkasına bandı yapıştırın. Daha sonra uygulanacak yüzeye tam olarak oturtun ve bastırarak tutun. Bandı birkaç kez yapıştırıp, sökmeyiniz.', 0, '8697409605404', 1903, 5.95, 2),
(15012, 'tr-tr', 810, 1, '8697409605411', '11527333', 'Autokit Çift Taraflı Bant 15 mm 10 mt', '', 0, '8697409605411', 1903, 7.95, 2),
(15013, 'tr-tr', 810, 1, '8697409605428', '11527334', 'Autokit Çift Taraflı Bant 20 mm 10 mt', '', 0, '8697409605428', 1903, 9.95, 2),
(15014, 'tr-tr', 810, 1, '8691751262872', '11563995', 'Silikon Tabancası Kartuş', 'Kartuş (soğuk) silikon ile kullanıma uygundur. Kirli ve ıslak zeminde uygulamayınız. Su ile irtibatı olan yerlerde kullanıma uygundur.', 0, '8691751262872', 1903, 9.9, 2),
(15015, 'tr-tr', 810, 1, '8691751290165', '11563996', 'Sıcak Silikon Tabancası 10 W', 'Sıcak silikonlar genel olarak yapıştırma amaçlı kullanılır. Kaliteli eritme özelliği ile sürülen silikon kısa sürede donarak yapışır çubuk silikon ile birlikte kullanılır. 40 w gücünde olup, hobi ve sanat gibi basit yapıştırma işlerinde kullanılabilir. Su ile irtibatı bulunan yerlerde kesinlikle kullanılmamalıdır, soğuk silikon tercih edilmelidir.', 0, '8691751290165', 1903, 29.95, 2),
(15016, 'tr-tr', 810, 1, '8691751290219', '11563997', 'Maket Bıçağı Metalli Pro 337', '', 0, '8691751290219', 1903, 5.9, 2),
(15017, 'tr-tr', 810, 1, '8691751287066', '11564049', 'Tornavida Düz 4*100', 'Vida sıkma ve sökme işlerinde kullanılabileceğiniz düz uçlu tornavida çeşididir. 4 x 100 mm ölçüde olup, farklı ölçüleri bulunmaktadır.', 0, '8691751287066', 1903, 5.95, 2),
(15018, 'tr-tr', 810, 1, '8691751287080', '11564050', 'Tornavida Yıldız 4*100', 'Vida sıkma ve sökme işlerinde kullanılabileceğiniz yıldız uçlu tornavida çeşididir. 4 x 100 mm ölçüde olup, farklı ölçüleri bulunmaktadır.', 0, '8691751287080', 1903, 5.95, 2),
(15019, 'tr-tr', 810, 1, '8691751290134', '11564051', 'Lavabo Açıcı Tel 3 mt', 'Lavabo ve gider boruları açmak için kullanılmaktadır. Plastik sap ile kolay ve ergonomik kullanım sunar. Esnek ve spiral yay yapıya sahiptir.', 0, '8691751290134', 1903, 17.9, 2),
(15020, 'tr-tr', 810, 1, '8691751260229', '11750466', 'Tek-İş Sıcak Silikon Küçük 10 Adt', 'Sıcak silikonlar genel olarak yapıştırma amaçlı kullanılır, kaliteli eritme özelliği ile sürülen silikon kısa sürede donarak yapışır çubuk silikon ile birlikte kullanılır. 10 w gücünde olup, hobi ve sanat gibi basit yapıştırma işlerinde kullanılabilir. Su ile irtibatı bulunan yerlerde kesinlikle kullanılmamalıdır, soğuk silikon tercih edilmelidir.', 0, '8691751260229', 1903, 9.95, 2),
(15021, 'tr-tr', 810, 1, '8691751287059', '11564048', 'Tek-İş Çekiç 200 gr', 'Çivi çakmak gibi benzeri işlemlerde kolaylık sağlar. Ahşap saplıdır ve baş ağırlığı 200 gramdır.', 0, '8691751287059', 1903, 11.9, 2),
(15022, 'tr-tr', 810, 1, '8681317083966', '12047035', 'Vodaseal Su İtici Sprey Şeffaf 400Ml', 'Emici olan tüm yüzeyleri su, leke ve kire karşı korur ve su geçirmezlik sağlar. Görünmezdir ve zehirli madde içermez. Uygulanan malzemenin dokusunu, görüntüsünü ve nefes alabilirliğini etkilemez. Tam kuruması gerçekleştikten sonra kokusuzdur. Çevresel etkilere ve kaplamaya bağlı olarak 6 aya kadar özelliğini korur. <br><br>Kullanım Alanları: <br>Bina – Çatı – Bahçe Mobilyaları – Şömine – Barbekü – Kamp malzemeleri – Ayakkabı – Kıyafet – Çadır – Tente – Koltuk – Mont.', 0, '8681317083966', 1903, 59.95, 2),
(15023, 'tr-tr', 810, 1, '8682340870189', '12124706', 'Vodaseal Temizlik Jeli Limon 160 g', 'Ulaşılması güç olan boşluk ve köşelerdeki her türlü toz, pislik veya kalıntıları temizlemek için mükemmeldir. Jelly temizlik jeli, yüzeydeki toz ve kirleri jelin içerisine hapsederek temizler ve parlaklık sağlar. Jelly temizlik jeli, ofisinizdeki bilgisayar klavyesi, hesap makinesi, uzaktan kumanda, telefon gibi elektronik eşyaların temizlenmesinde veya evinizdeki biblo, resim çerçevesi gibi obje ve süs eşyalarının ayrıca abajur, avize gibi temizlenmesi zor eşyaların tozunun alınmasında veya temizlenmesinde ve ayrıca otoların detaylı temizliğinde kullanılır. <br><br>Kullanım: <br><br>1- Jelly temizlik jelini ambalajından çıkartınız. Kullanım esnasında ellerinizin kuru olduğundan emin olunuz. <br>2- Temizlenecek yüzeye jeli yerleştiriniz, jeli yüzeye yayınız ve yavaşça delik ve boşlukların içine doğru itiniz. <br>3- Sonrasında kirin jele yapıştığına emin olduğunuzda jeli dışarı çekiniz, elinizde tekrar yoğurup, kiri jele hapsediniz ve bu uygulamayı tekrar eder şekilde temizlik işlemine devam ediniz. <br>Soğuk hava, toz, haşere gibi istenmeyen kapı altı sızıntılarını önlemek için idealdir. Güçlü yapışkanı sayesinde kapı altına kolayca monte edilir.', 0, '8682340870189', 1903, 19.95, 2),
(15024, 'tr-tr', 778, 1, '8681317083737', '12046986', 'Vodabond Süper Japon Yapıştırıcı 3gr', 'Seramik, cam, deri, ahşap, plastik, kağıt, metal ve kauçuk yapıştırılması için idealdir. Yüksek performans, kendiliğinden iğneli kapak özellikleriyle anında yapıştırır. <br><br>Kullanım Talimatı: <br>Yapıştırılacak yüzeyin temiz ve kuru olduğundan emin olunuz. <br>Yüzeye tek taraflı olarak uygulayınız, parçaları birleştiriniz ve 10 sn sıkıca bastırararak bekleyiniz. <br>Taşan kısmı hemen temizleyiniz. <br>Kullanım sonrası tüpün kapağını kapatınız.', 0, '8681317083737', 1903, 7.95, 2),
(15025, 'tr-tr', 778, 1, '8680838010895', '12046987', 'Vodabond 104 Japon Yapıştırıcı 15gr', '', 0, '8680838010895', 1903, 9.95, 2),
(15026, 'tr-tr', 778, 1, '8681317083119', '12046988', 'Vodabond Süper Hızlı Yapıştırıcı 10gr', '', 0, '8681317083119', 1903, 24.95, 2),
(15027, 'tr-tr', 778, 1, '8680838010680', '12046989', 'Vodabond Hızlı Yapıştırıcı 200+50ml', '\"', 0, '8680838010680', 1903, 29.95, 2),
(15028, 'tr-tr', 778, 1, '8680838010864', '12046990', 'Vodabond Kontakt Yapıştırıcı Tüp 50ml', '\"', 0, '8680838010864', 1903, 9.95, 2),
(15029, 'tr-tr', 778, 1, '8681317083652', '12046991', 'Vodabond Tamir Jeli 20gr Şeffaf 90', 'Tek bileşenli, solvent içermeyen formüle sahiptir. İki yüzey arasında uygulanan ince bir VODABOND® TAMİRET tabakası atmosferik nemle temas ettiğinde, hızlı bir polimerizasyon ve üstün yapışma gücü ortaya çıkarır. İç ve dış mekanlarda, plastik, ahşap, kauçuk seramik yüzeylerde kullanabileceğiniz ürünü sitemizden satın alabilirsiniz. <br><br>Kullanım Talimatı: <br>Yapıştırılacak yüzeylerin temiz ve kuru olduğundan emin olunuz. <br>Yapıştırıcıyı sadece bir yüzeye sürünüz. <br>Parçaları birleştirin ve birkaç saniye sıkıca bastırır şekilde tutunuz. <br> İyi temas şarttır. <br> 90 saniye içerisinde yeterli yapışma sağlanacaktır. <br>Maksimum yapışma gücü 24-48 saat arasında elde edilir. <br>Taşan kısmı siliniz ve uygulama sonrası kapağı kapatınız.', 0, '8681317083652', 1903, 21.95, 2),
(15030, 'tr-tr', 778, 1, '8681317083027', '12046992', 'Vodabond Epoksi Yapıştırıcı Şeffaf 6ml', '\"', 0, '8681317083027', 1903, 14.95, 2),
(15031, 'tr-tr', 778, 1, '8681317083096', '12046993', 'Vodabond Epoksi Tamir Macunu 9gr 2 Adet', '\"', 0, '8681317083096', 1903, 17.95, 2),
(15032, 'tr-tr', 778, 1, '8681317083430', '12046994', 'Vodabond Epoksi Yapıştırıcı A15gr+B15gr', '\"', 0, '8681317083430', 1903, 19.95, 2),
(15033, 'tr-tr', 779, 1, '8681317083898', '12046995', 'Vodaseal Hiyrid Polymer Beyaz 75gr', '', 0, '8681317083898', 1903, 32.95, 2),
(15034, 'tr-tr', 810, 1, '9555202602862', '12046996', 'V-Tech Genel Amaçlı Yapıştırıcı 20ml Şeffaf VT-921C', '\"', 0, '9555202602862', 1903, 14.95, 2),
