(15038, 'tr-tr', 779, 1, '8681317083607', '12047000', 'Vodaseal 3\'lü Oval Askı İz Bırakmayan Küçük', 'ASKI MONTAJ<br><br>1. Yüzeyi temizleyiniz ve yüzeyin kuru olduğundan emin olunuz. <br>2. Bandın üzerindeki arkalama kağıdını çıkarınız ve askının arka yüzüne yapıştırınız. <br>Yapışkana dokunmayınız. <br>3. Askıyı yüzeye bastırarak yapıştırınız. <br>30 saniye kadar bastırır şekilde bekleyiniz. Askıyı kullanmadan önce 1 saat kadar bekleyiniz. <br><br>ASKI SÖKME İŞLEMİ<br><br>Askıyı iz bırakmadan sökmek için bir eliniz ile askıyı tutarak diğer eliniz ile yapışkan bandı aşağı doğru yavaşça ve duvar yüzeyine paralel dikey bir şekilde çekiniz. <br>Sökme anında askıyı diğer elinizle tutmayı unutmayınız. <br>Bandı yukarı doğru veya sağa sola doğru çekerek askıyı sökmeye çalışmayınız. <br>', 0, '8681317083607', 1903, 17.95, 2),
