(15046, 'tr-tr', 779, 1, '8680838010215', '12047008', 'Vodaseal Mobilya Rotuş Ve Ahşap Dolgu Kalemi Beyaz', 'Ahşap Dolgu Kalemi Kullanım:<br><br>Çizik yerin üzerinden yavaşça bastırmadan geçiniz.<br>Fazlalığı yumuşak bir bez ile vakit geçirmeden dağıtınız. <br>Her kullanımdan sonra kapağı mutlaka kapatınız. <br>Hasarlı yüzeye kalemi ileri-geri şekilde sürtünüz. <br>Çatlak veya çukur bölgenin tam olarak doldurulduğundan emin olana kadar bu işleme devam ediniz. <br>Dağılan kısmı yumuşak bir bez ile fazla bastırmadan alınız.', 0, '8680838010215', 1903, 19.95, 2),
(15047, 'tr-tr', 779, 1, '8680838010222', '12047009', 'Vodaseal Mobilya Rotuş Ve Ahşap Dolgu Kalemi Krem', 'Ahşap mobilya, parke, pencere, çerçeve, kapı, banyo dolabı vb. tüm ahşap yüzeylerde zaman içerisinde oluşan derin veya kılcal çizikleri, oyukları, ezik, çatlak, çukur bölgeleri ve genel olarak darbeye veya aşınmaya bağlı yıpranmış ve hasar görmüş bölgeleri yenilemek için tasarlanmıştır. Set 1 adet mobilya rötuş kalemi ve 1 adet ahşap dolgu kalemi içerir. <br><br>Kullanımı: Çizik yerin üzerinden yavaşça bastırmadan geçiniz. Fazlalığı yumuşak bir bez ile vakit geçirmeden dağıtınız. Her kullanımdan sonra kapağı mutlaka kapatınız. Hasarlı yüzeye kalemi ileri-geri şekilde sürtünüz. Çatlak veya çukur bölgenin tam olarak doldurulduğundan emin olana kadar bu işleme devam ediniz. Dağılan kısmı yumuşak bir bez ile fazla bastırmadan alınız.', 0, '8680838010222', 1903, 19.95, 2),
