(15054, 'tr-tr', 779, 1, '8681317083539', '12047016', 'Vodaseal Derz Kalemi Gri 1 Adet Yedek', 'Vodaseal Derz Yenileme Kalemi sahip olduğu küf, mantar oluşumuna ve dolayısı ile kararmaya dirençli formülü sayesinde; derzlerin üzerinde bir tabaka oluşturarak, derzlerin tekrar kir ve leke tutmamasına yardımcı olur. Su ve hava şartlarına dayanıklı formülü ile dış mekan kullanımları için de son derece uygundur. Çift taraflı kullanılabilir dayanıklı uca sahiptir. Paket ayrıca 1 adet yedek uç da içerir. <br><br>Uygulama: <br><br>1. Kapağı kapalıyken 1 dakika boyunca çalkalayınız. <br>2. Kapağı çıkartınız ve keçe uçta boyayı görünceye kadar ucu pompalayınız. <br>3. Uca boya akışını sağladıktan sonra, ucu bastırmadan derz dolgularının üzerine uygulayınız.', 0, '8681317083539', 1903, 24.95, 2),
(15055, 'tr-tr', 779, 1, '8681317083546', '12047017', 'Vodaseal Derz Kalemi Bej 1 Adet Yedek', 'Vodaseal Derz Yenileme Kalemi sahip olduğu küf, mantar oluşumuna ve dolayısı ile kararmaya dirençli formülü sayesinde; derzlerin üzerinde bir tabaka oluşturarak, derzlerin tekrar kir ve leke tutmamasına yardımcı olur. Su ve hava şartlarına dayanıklı formülü ile dış mekan kullanımları için de son derece uygundur. Çift taraflı kullanılabilir dayanıklı uca sahiptir. Paket ayrıca 1 adet yedek uç da içerir. <br><br>Uygulama: <br><br>1. Kapağı kapalıyken 1 dakika boyunca çalkalayınız. <br>2. Kapağı çıkartınız ve keçe uçta boyayı görünceye kadar ucu pompalayınız. <br>3. Uca boya akışını sağladıktan sonra, ucu bastırmadan derz dolgularının üzerine uygulayınız.', 0, '8681317083546', 1903, 24.95, 2),
(15056, 'tr-tr', 778, 1, '8680838010949', '12047018', 'Vodabond Boncuk Hobi Tutkalı Seffaf 165gr', '\"', 0, '8680838010949', 1903, 14.95, 2),
(15057, 'tr-tr', 778, 1, '8681317083690', '12047021', 'Vodabond Simli Derz Kaplama Gümüş 160gr', 'Akrilik esaslı, küf ve mantar oluşumuna dirençli, esnek, düşük su emiciliğine ve kolay temizlenebilir özelliğe sahip, 1-5 mm derz aralığına uygun kullanıma hazır derz dolgudur. Eski derz dolgularının yenilenmesi için idealdir. Tüp aplikatör derz dolgusunun kusursuz ve pratik bir şekilde fayans aralarına yerleşmesini sağlar. Bu sayede kullanılan derz dolgu malzemesinin sarfiyatı önemli ölçüde azalır. Tüm ebatlardaki seramik ve fayansların, cam mozaiklerin derz aralarının doldurulmasında kullanılır. Yüksek esnekliği sayesinde iç ve dış mekanda, duvarda ve zeminde mükemmel sonuç vermektedir. <br><br>Uygulama: Uygulama esnasında yüzey ve hava sıcaklığının +10°C’nin üzerinde olmasına dikkat ediniz. Uygulama öncesi alttaki yapıştırıcı kürlenmiş olmalı ve derz araları tutunmayı önleyecek kalıntılardan arındırılmalıdır. Eski derz dolgularının üzerine uygulanıyor ise eski dolguların 1-2 mm kadar derz kazıyıcı ile kazınması yeterlidir. Yine yüzeyin kaba kir ve tozdan arındırılmış olmasına dikkat ediniz. Taşan kısmın nemli bir sünger ile ortam sıcaklığına bağlı olarak ilk 30-60 dakika içerisinde temizleyiniz. Derz arası derinliği en fazla 5 mm olmalıdır, daha fazla derinlikte yapılan uygulamalarda derz çökme yapabilir, bu da yüzeyin kurumasından sonra ikinci bir derz uygulaması gerektirebilir.', 0, '8681317083690', 1903, 17.95, 2),
(15058, 'tr-tr', 778, 1, '8681317083706', '12047022', 'Vodabond Simli Derz Kaplama Altın 160gr', 'Akrilik esaslı, küf ve mantar oluşumuna dirençli, esnek, düşük su emiciliğine ve kolay temizlenebilir özelliğe sahip, 1-5 mm derz aralığına uygun kullanıma hazır derz dolgudur. Eski derz dolgularının yenilenmesi için idealdir. Tüp aplikatör derz dolgusunun kusursuz ve pratik bir şekilde fayans aralarına yerleşmesini sağlar. Bu sayede kullanılan derz dolgu malzemesinin sarfiyatı önemli ölçüde azalır. Tüm ebatlardaki seramik ve fayansların, cam mozaiklerin derz aralarının doldurulmasında kullanılır. Yüksek esnekliği sayesinde iç ve dış mekanda, duvarda ve zeminde mükemmel sonuç vermektedir. <br><br>Uygulama: Uygulama esnasında yüzey ve hava sıcaklığının +10°C’nin üzerinde olmasına dikkat ediniz. Uygulama öncesi alttaki yapıştırıcı kürlenmiş olmalı ve derz araları tutunmayı önleyecek kalıntılardan arındırılmalıdır. Eski derz dolgularının üzerine uygulanıyor ise eski dolguların 1-2 mm kadar derz kazıyıcı ile kazınması yeterlidir. Yine yüzeyin kaba kir ve tozdan arındırılmış olmasına dikkat ediniz. Taşan kısmın nemli bir sünger ile ortam sıcaklığına bağlı olarak ilk 30-60 dakika içerisinde temizleyiniz. Derz arası derinliği en fazla 5 mm olmalıdır, daha fazla derinlikte yapılan uygulamalarda derz çökme yapabilir, bu da yüzeyin kurumasından sonra ikinci bir derz uygulaması gerektirebilir.', 0, '8681317083706', 1903, 17.95, 2),
