(15062, 'tr-tr', 778, 1, '8681317083799', '12047027', 'Vodabond Tamir Dolgusu Koyu Kahverengi 200 gr', 'Akrilik esaslı, kullanıma hazır, esnek yapıda, suya dayanıklı, iç ve dış mekan kullanıma uygun, duvar ve/veya zemindeki çatlak, delik ve pürüzlü yüzeyleri doldurmak ve/veya yüzey bozukluklarını gidermek üzere hazırlanmış, hızlı kuruma özelliğine sahip dolgu ve yüzey düzeltme macunudur. Çekme ve çatlama yapmaz. Kuruduktan sonra çok sağlam, üzeri zımparalanabilir ve boyanabilir bir yüzey sağlar. Ahşap, beton, sıva, alçıpan, mermer vb. tüm emici yüzeylerde uygulamaya uygundur. Uygulaması kolay ve hızlıdır. Solvent içermediği için rahatsız edici kokusu yoktur. <br><br>UYGULAMA:<br><br>Uygulama yapılacak yüzeyler kuru olmalıdır ayrıca toz, kir ve yağdan arındırılmış olmalıdır. Kullanıma hazırdır. Yüzeye tüpten sıkarak, spatula veya mala yardımı ile uygulayınız. Yüzey ve hava sıcaklığının uygulama esnasında +5-+30°C olmalıdır. Tek katmanda 5 mm den fazla kalınlıkta uygulama yapmayınız. Gerektiğinde iki kat uygulama yapınız ve katmanlar arasında 6 saat bekleyiniz. Ortam ve yüzey sıcaklığına göre tam kuruma süresi 6 - 12 saattir. Güneş ışığı almayan +5 – +30°C’de depolayınız. Son kullanım tarihi ambalajın üzerindedir.', 0, '8681317083799', 1903, 17.95, 2),
(15063, 'tr-tr', 778, 1, '8681317083782', '12047028', 'Vodabond Tamir Dolgusu Açık Kahverengi 200 gr', 'Tüm ebatlardaki seramik ve fayansların, cam mozaiklerin derz aralarının doldurulmasında kullanılır. Yüksek esnekliği sayesinde iç ve dış mekanda duvarda ve zeminde mükemmel sonuç vermektedir. <br><br>Uygulama esnasında yüzey ve hava sıcaklığının +5 – +30°C olmasına dikkat ediniz. Uygulama öncesi alttaki yapıştırıcı kürlenmiş olmalı ve derz araları tutunmayı önleyecek kalıntılardan arındırılmalıdır. Yine yüzeyin kaba kir ve tozdan arındırılmış olmasına dikkat ediniz. Taşan kısmın nemli bir sünger ile ortam sıcaklığına bağlı olarak ilk 30-60 dakika içerisinde temizleyiniz. Derz arası derinliği en fazla 10 mm olmalıdır, daha fazla derinlikte yapılan uygulamalarda derz çökme yapabilir, bu da yüzeyin kurumasından sonra ikinci bir derz uygulaması gerektirebilir.', 0, '8681317083782', 1903, 17.95, 2),
(15064, 'tr-tr', 778, 1, '8681317083775', '12047029', 'Vodabond Tamir Ahşap Beton Beyaz 200gr', '\"', 0, '8681317083775', 1903, 17.95, 2),
(15065, 'tr-tr', 778, 1, '8680838010499', '12047030', 'Vodabond Derz Dolgu 400gr', 'Tüm ebatlardaki seramik ve fayansların, cam mozaiklerin derz aralarının doldurulmasında kullanılır. Yüksek esnekliği sayesinde iç ve dış mekanda duvarda ve zeminde mükemmel sonuç vermektedir. <br><br>Uygulama esnasında yüzey ve hava sıcaklığının +5 – +30°C olmasına dikkat ediniz. Uygulama öncesi alttaki yapıştırıcı kürlenmiş olmalı ve derz araları tutunmayı önleyecek kalıntılardan arındırılmalıdır. Yine yüzeyin kaba kir ve tozdan arındırılmış olmasına dikkat ediniz. Taşan kısmın nemli bir sünger ile ortam sıcaklığına bağlı olarak ilk 30-60 dakika içerisinde temizleyiniz. Derz arası derinliği en fazla 10 mm olmalıdır, daha fazla derinlikte yapılan uygulamalarda derz çökme yapabilir, bu da yüzeyin kurumasından sonra ikinci bir derz uygulaması gerektirebilir.', 0, '8680838010499', 1903, 24.95, 2),
