(15067, 'tr-tr', 779, 1, '8680838010703', '12047032', 'Vodaseal Tüp Silikon Şeffaf 50gr', 'ÖZELLİKLERİ<br><br>Küf ve mantar oluşumuna dirençlidir. <br>Yüksek mukavemetlidir.<br>Süper elastiktir ve uzun ömürlüdür. <br>Mükemmel yapışma sağlar. <br>-50°C ile 250°C arasındaki sıcaklığa dayanıklıdır. <br>Hızlı kurur. <br>Boya tutmaz. <br>Kuruyan yüzeyler başka malzemelere yapışmaz. <br>UV ışınlarına dayanıklıdır. <br><br>UYGULAMA ŞEKLİ<br><br>1- Uygulanacak yüzeyin temiz, kuru ve yağsız olmasını sağlayınız. <br>2- Gerektiği takdirde, silikonlanacak bölgenin her iki tarafı bantlanabilir. <br>3- Tüpün ağzını deliniz, kanala takınız, kanul ucunu istenilen bölgeden 45°C açıyla kestikten sonra, gerekli miktarda uygulama yapınız. <br>4- Silikon sürülen alanın yüzeyi istenirse, sabunlu su ile düzeltilip parlatılabilir. <br>Düzeltme işleminden sonra bantları çıkarınız. <br>Tam kuruma için 24 saat bekleyiniz. <br>Çalışma süresi 5 – 15 dakika olup üzerinde yürüyebilme süresi 4 saattir.', 0, '8680838010703', 1903, 14.95, 2),
(15068, 'tr-tr', 810, 1, '8681317083959', '12047034', 'Vodabond Poliureatan Dolgu Köpüğü 500ml', '\"', 0, '8681317083959', 1903, 19.95, 2),
(15069, 'tr-tr', 779, 1, '8681317083386', '12047036', 'Vodaseal Leak Kauçuk İzolasyon Sprey Beyaz 396gr', 'Su sızıntılarına karşı yüzeyleri kaplayan, örten ve koruyan, kullanımı kolay bir kauçuk kaplama mastiği, bir sızdırmazlık, yalıtım malzemesidir. Yüzeye sıkıldığında, kauçuk sıvı; çatlak ve deliklere süzülür, nüfuz eder ve o bölgedeki su kaçağı veya her türlü sızıntıyı hızlı bir şekilde durdurur, önler. 396 gr’lık 1 adet sprey teneke kutu ile kaplama kalınlığına bağlı olarak yaklaşık 1 metrekare alan kaplar. Kuruduktan sonra üzeri istenilen renge boyanabilir. Sızıntı, çökme, çatlama, soyulma yapmaz. Yıllarca özelliğini koruyan, su geçirimsiz esnek bir kaplama oluşturur. LeakFix ‘in üzeri yağlı boya ile boyanabilir. <br><br>KULLANIM ALANLARI: <br><br>borular, su tesisatları, oluklar, çatılar, teraslar, bina dış cepheleri, derz araları, pencere / kapı çevreleri, arabalar, tekneler. <br><br>UYGULANABİLİR YÜZEYLER: <br><br>Metal, alüminyum, ahşap, pvc, astar, asfalt, beton, tuğla, sıva, galvaniz metal, çatı malzemeleri. <br><br>UYGULAMA: <br><br>1 dakika kadar çalkalayınız. Püskürtme şeklini hissetmek ve kavramak için uygulamaya geçmeden önce bir karton parçasının üzerinde test ediniz. Yüzeye 15 cm ile 45 cm mesafeden püskürtünüz. Süpürme hareketi kullanarak, yüzeye eşit bir şekilde püskürtünüz. İki kat olarak uygulanması tavsiye edilir. Hafif bir ilk kat uygulamasından sonra ikinci kat uygulamaya geçmeden önce 15 – 30 dk kadar ilk katın kurumasını bekleyiniz. İkinci katı daha kalın olarak uygulayabilirsiniz. İlk kat uygulamasında kabarcıklar görülebilir ama bunlar kurudukça ortadan kaybolur. İyi sonuç için 15°C üzerindeki ortam sıcaklıklarında uygulayınız. 2 saat içerisinde kürleşir, tam kuruma 24 saat sürer. Püskürtme esnasında sıçramalar yapabilir, elinize veya kıyafetlerinize sıçramaması için eldiven takılmasını, iş önlüğü giyilmesini tavsiye ederiz. Dikey uygulamalarda zemine damlamalar yapabilir, zeminleri korumak için bir örtü veya karton parçası serilmesini tavsiye ederiz. Uygulanacak bölgenin etrafında korumak istediğiniz alanlar var ise, kağıt bant kullanılması tavsiye edilir.', 0, '8681317083386', 1903, 59.95, 2),
(15070, 'tr-tr', 779, 1, '8681317083393', '12047037', 'Vodaseal Leak Kauçuk İzolasyon Sprey Şeffaf 396gr', 'Su sızıntılarına karşı yüzeyi kaplayan ve koruyan bir kauçuk kaplama mastiği, bir sızdırmazlık yalıtım malzemesidir. Su kaçağı veya her türlü sızıntıyı hızlı bir şekilde durdurur. Uzun yıllar özelliğini korur, çökme, çatlama ve soyulma yapmaz. Uygulama yapıldıktan sonra üzeri boyanabilir.', 0, '8681317083393', 1903, 59.95, 2),
(15071, 'tr-tr', 779, 1, '8681317083454', '12047038', 'Vodaseal Hazır Montaj Bandı Şeffaf 12\'li Set', 'Neme karşı yüksek dayanıklılığı sayesinde ev içerisinde banyo, mutfak gibi nemli alanlarda güvenle kullanılır. Kullanımı hızlı ve kolaydır. Güçlü yapışkanı ve sağlam yapısı ile vida ve çivinin alternatifi olarak kullanılabilir. Resim çerçeveleri, termometre, duvar saati, isim plakaları, işaret levhaları, duvar dekorasyonları, sabunluk, havluluk, plastik askı, ayna vb. birçok objenin sabitlenmesi için uygundur.', 0, '8681317083454', 1903, 19.95, 2),
(15072, 'tr-tr', 779, 1, '8680838010567', '12047040', 'Vodaseal Çift Taraflı Bant Şeffaf 25mmx3mt', 'Cam, şeffaf plastik gibi şeffaf bant gerektiren uygulamalar için idealdir. Yüksek sıcaklık ve UV dayanmlıdır. Üstün sızdırmazlık ve yapışma gücüne sahiptir. Neme karşı dayanıklı yapısı ve üstün yapışma performansı ile özellikle banyo, mutfak gibi nemli ortamlarda, ıslak mekan aksesuarlarının montajında güvenle kullanılır. Çivi ve çekiç gerektirmez, kullanımı kolaydır. İç mekanlarda tablo, ayna, askı, dekoratif süslemeler gibi ahşap, seramik, metal, plastik malzemelerin, pencere, fayans, cam, duvar gibi düz yüzeylere yapıştırılmasında, araç içi aksesuarlarının ve OGS cihazlarının sabitlenmesinde kullanılır.', 0, '8680838010567', 1903, 14.95, 2),
