(15084, 'tr-tr', 779, 1, '8681317083560', '12047054', 'Vodaseal Lavabo Kenar Bandı Beyaz 22mmx335m', 'Banyo ve mutfaklarda küvet, duşa kabin, lavabo ve tezgahların sızdırmazlık gerektiren duvar ve zemin birleşim noktalarında güvenle kullanılır. <br><br>Uygulama: <br><br>1) Öncelikle uygulama yapılacak alanın ve yüzeyin bütünüyle kuru ve temiz olduğundan emin olun. Eğer yüzeyde eski silikon, mastik veya dolgu malzemesinden kalan artıklar var ise bunları da mutlaka kazıyarak temizleyin. <br>2) Uygulama yapılacak alandaki uzunlukları ölçün. <br>3) Bandı çıkartın ve ölçtüğünüz uzunluklara uygun olarak kesin. <br>4) Bandın arkasındaki koruyucu kağıdı sökün ve bandı esnetmeden sıkıca baskı uygulayarak yapıştırın. <br>5) En iyi sonuç için uygulama alanını en az 24 saat sudan koruyunuz. <br><br>Önemli: Ürünün performansını arttırmak için bandı yerleştirdikten sonra fön makinası ile ısı tatbik edin ve aynı anda sıkıca bastırın.', 0, '8681317083560', 1903, 49.95, 2),
