(15087, 'tr-tr', 779, 1, '8681317083300', '12047057', 'Vodaseal Kapı Altı Sızdırmazlık Bandı Kahve 40mmx110cm', 'Soğuk hava, toz, haşere gibi istenmeyen kapı altı sızıntılarını önlemek için idealdir. Güçlü yapışkanı sayesinde kapı altına kolayca monte edilir. <br><br>UYGULAMA: <br><br>1) Yüzeyin kuru ve temiz olduğundan emin olunuz. <br>2) Arkalama kağıdını çıkarınız ve bandı bastırarak ve hafif gerdirerek yüzeye yapıştırınız.', 0, '8681317083300', 1903, 17.95, 2),
