(15104, 'tr-tr', 810, 1, '8691451560063', '10104231', 'Patex Japon Yapıştırıcı 3 Gr', 'Ürün anında kuruma özelliğine sahiptir. Ayrıca yüzeyleri de anında yapıştırmaktadır. Kauçuk, plastik, metal, seramik, deri, mermer ve camda gibi yani kısacası tüm alanlarda kullanıma uygundur. Aynı zamanda akıcıdır, ufacık aralıklarda bile etkisini anında gösterebilme özelliği de bulunur.', 0, '8691451560063', 1903, 7.95, 2),
(15105, 'tr-tr', 810, 1, '8699493022372', '10743700', 'Leva Kontrol Kalemi Ve Elektrik Bantı', 'Tamir araç-gereçlerinizi ve hırdavat ihtiyaçlarınızı <span style=\"font-weight:bold;\">çevrim içi internet sitesi Özdilekteyim.com</span>\'da bulabilirsiniz. <br>Evinizde ve iş yerlerinizde güvenle kullanabileceğiniz <span style=\"font-weight:bold;\">Leva kontrol kalemi</span>, yanında elektrik bantı ile birlikte satışınıza sunulmaktadır. <br><br>Dilediğiniz an da sahip olabileceğiniz <span style=\"font-weight:bold;\">Leva kontrol kalemi ve elektrik bant seti</span>ni uygun fiyatlarla <span style=\"font-weight:bold;\">Özdilekteyim.com</span>\'dan temin edebilir; <span style=\"font-weight:bold;\">sanal alışveriş </span>keyfini <span style=\"font-weight:bold;\">Özdilek </span>kalite ve güvencesiyle yaşayabilirsiniz.', 0, '8699493022372', 1903, 7.95, 2),
(15106, 'tr-tr', 561, 1, '8697435671619', '10104011', 'Panther Mini Masaj Aleti(Adet)', 'Vücudun her tarafında kullanabileceğiniz bu ürün, 3 adet AAA Pil veya USB kablosuyla bilgisayara takarak veya DC 4.5V adaptörle çalıştırılabilir. Islak elle veya yağmur altında kullanmayınız. Vücudunuza hafifçe bastırıp gezdirerek kullanınız. USB bağlantı kablosu paket içeriğine dahildir.', 0, '8697435671619', 1903, 10, 2),
(15107, 'tr-tr', 725, 1, '8691751237146', '10104296', 'Tek İş Kablo Bağı Siyah 140X2.5', '', 0, '8691751237146', 1903, 7.95, 2),
(15108, 'tr-tr', 810, 1, '8698657101564', '10104350', 'Kapı Arkası Askı', '', 0, '8698657101564', 1903, 5, 2),
(15109, 'tr-tr', 810, 1, '8681925308017', '12223459', 'Freebreath Tam Yüz Dalış Maskesi S/M ve L/XL', 'Üniversal olarak tüm aksiyon kameraları ile uyumlu olan Full Face (Tam Yüz) Dalış Maskesi su altında, yatay ve dikey olarak 180° derece görüş açısı sunar. Yüzü tamamıyla kaplayan Full face (Tam Yüz) dalış maskesi yapısı gereği hem ağızdan hem de burundan nefes alabilmenizi sağlar. Full face (Tam Yüz) dalış maskesi üzerindeki şnorkel bilyesi ve su tahliye boşlukları sayesinde oldukça keyifli bir dalış deneyimi yaşayabilirsiniz. <br>Ürün Özellikleri:<br>Çeneyi yormaz.<br>Doğal şekilde hem burundan hem de ağızdan hava alabilmenizi sağlar.<br>Şnorkelde su birikme sorununa son verir.<br>Buğulanma yapmaz.<br>Piyasadaki en geniş görüş açısına sahip dalış maskesidir.<br>Numaralı gözlük takabilme imkanı sağlar.<br>Aksiyon kameraları maskenin üst kısmına bağlanabilir.<br>Yüzü tamamıyla kapatarak dış etkenlerden ve soğuktan korur.<br>Maske beden ölçüsü olarak S/M ve L/XL ölçüleri mevcuttur. <br>Mavi, pembe ve siyah renk seçenekleri mevcuttur. <br>Renk ve beden seçiminizi sipariş notunda belirtmeniz gerekmektedir.', 0, '8681925308017', 1905, 109, 2),
(15110, 'tr-tr', 810, 1, '8681413450815', '12192637', 'Ahşap Kollu Piknik/Plaj Sandalyesi', '', 0, '8681413450815', 1905, 49.95, 2),
(15111, 'tr-tr', 810, 1, '6942138951943', '11901133', 'Bestway Binici Safari 42048', 'Emniyet valfleri, dayanıklı, önceden test edilmiş vinil, sabit yastık, 2 hava odası, ağır hizmet tipi tutma kolu ve onarım için yama özellikleriyle tasarlanan bu ürünü sitemiz üzerinden uygun fiyatlarla satın alabilirsiniz.', 0, '6942138951943', 1905, 139, 2),
(15112, 'tr-tr', 810, 1, '6942138933925', '11901134', 'Bestway Gölgelikli Bot 98x66 cm 34103', 'Gölgeliği sayesinde güneş ışınlarından korunma sağlar. Havuzda, gölde veya plajda kullanmak için idealdir. Tatilde ve seyahatte kolaylıkla yanınızda taşıyabileceğiniz bu ürünün ebatları, 98x66 cm’dir.Çocukların yetişkin gözetiminde kullanabileceği ürün, 3 – 6 yaş kullanımına uygundur.', 0, '6942138933925', 1905, 149, 2),
(15113, 'tr-tr', 810, 1, '6942138947663', '11901172', 'Bestway Bardaklık Fashion 34104', 'Yaz günlerinde sevdiklerinizle birlikte deniz ve havuz keyfinizi artırabileceğiniz flamingo bardaklıkla meşrubatlarınızı rahatlıkla yudumlayabilirsiniz.', 0, '6942138947663', 1905, 34.95, 2),
(15114, 'tr-tr', 810, 1, '6942138954647', '11901173', 'Bestway Yüzme Tahtası 32155', 'Dayanıklı köpük malzemeden üretilen yüzme tahtası CE sertifikalıdır. 3 - 6 yaş arası kullanımına uygun yüzme tahtasını sitemizden satın alabilirsiniz.', 0, '6942138954647', 1905, 74.95, 2),
(15115, 'tr-tr', 810, 1, '6942138946512', '11901174', 'Bestway Hydro Swim Maske 22056', 'Ürün Özellikleri:<br><br>Çocuklarınızın güvenle kullanabileceği Bestway Hydro Swim Maske ayarlanabilir askı özelliği ile oldukça rahat bir kullanıma sahiptir. 14 yaş ve üzeri kullanıma uygun olan ürünün lens malzemesi ise polikarbonattan üretilmiştir.', 0, '6942138946512', 1905, 44.95, 2),
(15116, 'tr-tr', 810, 1, '6942138946567', '11901175', 'Bestway Hydro Swim Şnorkel Set 24037', '14 yaş kullanımına uygun olan şnorkel seti, UV koruyucu kaplamalı havacı tasarımlı polikarbonat lensler bulunmaktadır. Çift dolgulu ve konforlu kenar contası ve bölünmüş tamamen ayarlanabilir kafa bandıyla hazırlanan bu ürünü sitemizden satın alabilirsiniz.', 0, '6942138946567', 1905, 64.95, 2),
(15117, 'tr-tr', 810, 1, '6942138938777', '11901176', 'Bestway Yüzücü Gözlüğü 21069', 'Konforlu vizör lastiğiyle oldukça yumuşak olan yüzücü gözlüğü, tek parça çerçeve UV koruyucu kaplamalı renk tonu, polikarbonat lensler, tamamen ayarlanabilir silikon kafa bandına sahiptir.', 0, '6942138938777', 1905, 19.95, 2),
(15118, 'tr-tr', 810, 1, '6942138939538', '11901177', 'Bestway Yüzücü Gözlüğü 21077', 'Konforlu vizör lastiğiyle oldukça yumuşak olan yüzücü gözlüğü, tek parça çerçeve UV koruyucu kaplamalı renk tonu, polikarbonat lensler, tamamen ayarlanabilir silikon kafa bandına sahiptir.', 0, '6942138939538', 1905, 19.95, 2),
(15119, 'tr-tr', 810, 1, '6942138956368', '11901179', 'Bestway Yüzücü Gözlüğü 21080', 'Çocuklar suyun tadını şimdi çıkarmaya başlayacak! Yumuşak rahat uyan göz fincanları, burun kemerine tam olarak ayarlanabilmesi ve tam ayarlanabilir silikon baş kayışı özelliklerine sahiptir. UV koruma kaplaması bulunmaktadır. Üstelik eğlenceli tasarımları ile çocuklar bu deniz gözlüklerini çok sevecek! Serinin; denizkızı, timsah, flamingo, güneş, köpek balığı ve figürlü siyah gözlük olmak üzere 6 farklı modeli bulunmaktadır. %100 Lateks içermez. Ürün uzunluğu 15 cm, kutu ölçüsü ise 18,5x3x15 cm’dir.', 0, '6942138956368', 1905, 19.95, 2),
(15120, 'tr-tr', 810, 1, '6942138913750', '11901164', 'Bestway Deniz Yatağı Fashion 183x69 cm 44033', 'Rahat ve konforlu özelliğiyle suyun keyfini çıkarabileceğiniz deniz ve havuz yatağıyla yaz tatillerinizi daha eğlenceli geçirebilirsiniz. Vücudu dengede tutan bir yapısı bulunmaktadır. Maksimum taşıma kapasitesi 90 kg’dır. Çocukların ürünü yetişkin gözetiminde kullanılması önerilmektedir.', 0, '6942138913750', 1905, 64.95, 2),
(15121, 'tr-tr', 810, 1, '6942138952254', '11901168', 'Bestway Deniz Yatağı Rainbow 183x69 cm 44041', 'Gökkuşağının can alıcı güzelliğini havuzunuzda görebileceğiniz Bestway deniz yatağıyla tatilinizi daha keyifli bir hale getirebilirsiniz. Baş kısmındaki özel şişme alan ve yumuşak dokusuyla maksimum konfor sağlar.', 0, '6942138952254', 1905, 89.95, 2),
(15122, 'tr-tr', 810, 1, '6942138952469', '11901170', 'Bestway Deniz Yatağı Gold Mat 183x69 cm 44044', '2 odacıklı yastık tasarımlı deniz yatağını emniyet valfları, dayanıklı ve test edilmiş viniliyle güvenli ve keyifli bir şekilde kullanabilirsiniz.', 0, '6942138952469', 1905, 64.95, 2),
(15123, 'tr-tr', 810, 1, '6942138952377', '11901106', 'Bestway Deniz Simidi 36x91 cm 36127', 'Denizin ve havuzun tadını Bestway Gold Simit ile çıkarabilirsiniz. Yetişkinlerin rahatlıkla kullanabileceği parlak renkli deniz simidi 91 cm çapındadır. Kolayca şişirilip kullanıma hazırlanabilir. Simit kenarında bulunan tutunma alanları kullanım esnasında maksimum güvenlik ve konfor sağlar. Hava sızdırmayan özel kapakları uzun ömürlü bir kullanım deneyiminin mimarıdır. Simit rengi güneşe karşı dayanıklıdır, renkte solma meydana gelmez.', 0, '6942138952377', 1905, 69.95, 2),
(15124, 'tr-tr', 810, 1, '6942138952575', '11901136', 'Bestway Deniz Simidi Predator 91 cm 36122', 'Yüksek kaliteli dayanıklı vinil, çizilmeye ve yırtılmaya karşı dayanıklıdır. Havuzda, gölde veya plajda kullanılması önerilir. Şişirmek ve söndürmek oldukça kolaydır. İnsanların dinlenebileceği ve rahatlayabileceği eğlenceli, parlak ve özel tasarıma sahiptir. Yetişkinlerin kullanımı için uygundur.', 0, '6942138952575', 1905, 89.95, 2),
(15125, 'tr-tr', 810, 1, '6942138930245', '11901140', 'Bestway Deniz Kolluğu Turtle 23x15 cm 32043', 'Bestway deniz kolluğu, dayanıklı vinyl malzemeden üretilmiş ve 3 - 6 ile 6 - 9 yaş arası çocukların kullanımı için uygundur. Kolaylıkla şişirilip güvenle kullanabileceğiniz deniz kolluğunu sitemizden satın alabilirsiniz.', 0, '6942138930245', 1905, 19.95, 2),
(15126, 'tr-tr', 810, 1, '6942138921588', '11901141', 'Bestway Deniz Kolluğu 30x15 cm 32110', '5 - 12 yaş çocukların kullanımı için uygun olan Bestway deniz kolluğu ile çocuklarınız havuzun ve denizin keyfini dilediğince çıkarabilecek. Çocukların rahat bir şekilde kullanabileceği, giyip çıkarma kolaylığı, yırtılmaya ve patlamaya karşı dayanıklı, özelliklerine sahip şişme kollukları tatilde ve seyahatte kolaylıkla yanınıza alabilirsiniz. Ürün, yetişkin gözetiminde kullanılmalıdır.', 0, '6942138921588', 1905, 29.95, 2),
(15127, 'tr-tr', 810, 1, '6942138952230', '11901167', 'Bestway Deniz Simidi 118x117 cm 43186', 'Bestway deniz simidiyle çocuklarınız da en az sizin kadar tatilin ve denizi keyfini çıkarabilecek. Tutunma alanlarıyla maksimum konfora sahip deniz simidi, 118x 117 cm ölçülerine sahiptir.', 0, '6942138952230', 1905, 159, 2);
INSERT INTO `products` (`ID`, `LanguageCode`, `BrandID`, `UnitID`, `Barcode`, `SKU`, `Name`, `Description`, `State`, `Code`, `CategoryID`, `Price`, `Source`) VALUES
(15128, 'tr-tr', 810, 1, '6942138913514', '11901171', 'Bestway Deniz Yeleği Spiderman 51x46 cm 98014', '4 - 6 yaş arası çocukların kullanımına uygun olan deniz yeleği, 18 – 30 kg taşıma kapasitesine sahiptir. 2 Adet kolay açılıp kapanabilen tokası bulunmaktadır. Güvenlik valfleri mevcuttur. Çok güçlü vinil malzemeden imal edilmiştir. Ön yüzeyindeki kemerler ayarlanabilir. Kolaylıkla şişirilebilir ve kolaylıkla havası indirilebilir. Çok yer kaplamadan saklanabilir. Çocuklarınızın güvenliği için yumuşak vinil malzemeden imal edilmiştir. Özel kutusunda sizlere sunulmaktadır.', 0, '6942138913514', 1905, 69.95, 2),
(15129, 'tr-tr', 810, 1, '6942138927924', '11901111', 'Bestway Şişme Havuz 70x24 cm 51128', 'Vücudu dengede tutan bir yapısı vardır. 0.20 mm vinyıl malzemeden üretilmiştir. Güvenlik valfleri ile donatılan oyun havuzunun ebatları ise 24 cm derinliğe, 70 cm de uzunluğa sahiptir. Su kapasitesi 41 litredir. 0 - 3 yaş arası çocuklar için uygun olan oyun havuzu, şişer tabanı ve yumuşak zeminiyle çocuklarınızda içerisinde rahatlıkla vakit geçirebilir. Hortum yardımıyla kolayca doldurabileceğiniz çocuk havuzu, çocuk sağlığını etkileyecek zararlı maddeler içermez.', 0, '6942138927924', 1905, 79, 2),
(15130, 'tr-tr', 810, 1, '6942138951967', '11900701', 'Bestway Deniz Topu 46 cm 31042', 'Şişirmek ve havaya uçurmak kolay plaj topu kolayca taşınabilir ve seyahatlerinizde kullanmak ve kullanılmadığında saklamak için mükemmeldir. <br>Plaj topu boyut 46 cm / 18 \"<br>Yaz meyvesi tasarımına sahip plaj topu ile su içinde veya dışında voleybol veya hentbol oyunları oynayın. <br>Her yaz tatili için bir havuz oyuncağı olmalı! <br> Bestway 46cm Panel Şişme Plaj Topu, plajda veya havuzda aileniz ve arkadaşlarınızla saatlerce eğlenmek için ideal bir şişirilebilir plaj topudur. <br>', 0, '6942138951967', 1905, 44.95, 2),
(15131, 'tr-tr', 810, 1, '6942138930054', '11901102', 'Bestway Deniz Topu 41 cm 31004(Adet)', 'Siz ve sevdikleriniz ile doyasıya eğlenceye hazır mısınız? Bestway ürünleri ile bu yaz oldukça eğlenceli geçecek. Güvenle sahip olabileceğiniz bu ürünler kaliteli malzemelerden üretilmiştir. <br>', 0, '6942138930054', 1905, 16.95, 2),
(15132, 'tr-tr', 810, 1, '6942138949827', '11901103', 'Bestway Deniz Simidi 36121', 'Yazın en lezzetli meyveleri şimdi Bestway simitlerine konu oluyor ve havuzlarda birbirinden güzel manzaralar görenleri kendine hayran bırakıyor. Ailenizle ve sevdiklerinizde neşeli vakit geçirmek, su üzerinde sakince dinlenmek ve çocuklarınızın havuzun tadını doyasıya çıkarmasını sağlamak için Bestway Meyve Desenli Simitlerden yardım alabilirsiniz. Ananas desenli Bestway simit 119 cm çapındadır. Pratik bir şekilde kullanıma hazırlanabilir.', 0, '6942138949827', 1905, 74.95, 2),
(15133, 'tr-tr', 810, 1, '6942138961133', '11901109', 'Bestway Deniz Simidi 91 cm 36141', 'Parlak renkler ile Bestway tutunmalı simitler çocukların dikkatini çeker, onları eğlenceli oyunlara teşvik eder. 10 yaş ve üzeri çocukların kullanıma uygundur. Kaliteli malzemesi kullanım esnasında maksimum kaldırma kuvvet uygular. Kullanım hazırlanması oldukça kolaydır. Darı yıldız, pembe kalp ve mavi halka olmak üzere 3 farklı renk ve desen seçeneği mevcuttur. Tüm simitlerin ölçüsü 91 cm’dir. Kullanılmadığı zamanlarda ürün ömrünün uzun olması için havasını indirilip saklanması önerilir.', 0, '6942138961133', 1905, 99.95, 2),
