(15138, 'tr-tr', 810, 1, '6942138914122', '11612814', 'Bestway Gölgelikli Havuz 97x66 cm Kurbağa Figürlü 52189', 'Ürün Özellikleri:<br><br>Vinil malzemeden üretilen Bestway havuz, 97x66 cm ebatlarındadır. Gölgelikli ve kurbağa figür detaylara sahip olan bu ürün için kullanım tavsiyesi minimum 2 yaştır. Yaz tatillerinizde keyifli bir şekilde kullanabileceğiniz deniz yatağı, deniz simidi, deniz topu, şnorkel, deniz gözlüğü gibi deniz ve havuz malzemelerini sitemizden uygun fiyatlarla temin edebilirsiniz.', 0, '6942138914122', 1905, 179, 2),
(15139, 'tr-tr', 810, 1, '6942138910445', '11612815', 'Bestway Bebek Havuzu 98x70 cm 52179', 'Ürün Özellikleri:<br><br>Vinil malzemeden üretilen Bestway bebek havuzu, 99x91x71 cm ebatlarındadır. Bebeklerinizin keyif dolu anlar geçirebileceği havuz, 26 litre su kapasitesine sahiptir. Bebekleriniz için güvenle kullanabileceğiniz bu ürünü sitemizden hızlı bir şekilde satın alabilirsiniz.', 0, '6942138910445', 1905, 125, 2),
(15140, 'tr-tr', 810, 1, '6942138930412', '11584116', 'Bestway Deniz Botu Çocuk 34036', 'Önerilen yaş: 3 - 6 yaş<br>Boyut (olarak): 102x62x24 cm şişme zemin için daha fazla konfor<br>Çekme halat entegre tutucu<br>Dayanıklı 0,18 mm vinil içerik: 1 havuzu tekne, bir tamirat yamaları<br>', 0, '6942138930412', 1905, 59.95, 2),
(15141, 'tr-tr', 810, 1, '6942138960242', '10101650', 'Bestway Ayak Pompası 28x19cm 62004B', '28 cm x 19 cm<br>3 ayrı başlığı ile şişme ürünleri kolay bir şekilde şişirmenizi sağlar. <br>', 0, '6942138960242', 1905, 89.95, 2),
