(15185, 'tr-tr', 810, 1, '8681413450914', '12332480', 'Alüminyum Katlanır Kamp Sandalyesi', 'Ergonomik ebat, ultra hafif, kolay taşınabilir özelliklerdeki katlanabilir kamp sandalyesi, 110 kg taşıma kapasitesine sahiptir. Kolay kurulumun yanı sıra su geçirmez, hava alabilen terletmeyen kumaş ile tasarlanmıştır. Taşıma çantalıdır. 850 gram ultra hafif yapıya sahip olan katlanabilir kamp sandalyesi, havacılık sektöründe de kullanılan alüminyum dayanıklı malzemeden üretilmiştir.', 0, '8681413450914', 1907, 99.9, 2),
(15186, 'tr-tr', 810, 1, '8697623603033', '12226426', 'Uzayan Hortum 7.5 mt', 'Bağ ve bahçe gibi yeşil alanları sulamak için tasarlanmış balkon ve bahçe hortumu, birçok işlevsel özelliği ve dayanıklı tasarımı ile uzun ömürlü kullanım vadediyor. Evinizin balkon ve terasını yıkamak için kullanabileceğiniz ip örgü tasarımlı hortumu, dilerseniz arabanızı yıkamak için de kullanabilirsiniz. Evinizin bahçe ve balkonunda, yazlık evinizde ve hatta teknenizde güvenle kullanabileceğiniz Bahçe Hortumu, UV tasarımı sayesinde sıcak ve soğuk havanın olumsuz etkilerinden maksimum düzeyde korunmuş oluyor. <br><br>Yeşil rengi ile bahçenizin genel atmosferine uyum sağlayan Hortum, kullanmadığınız zamanlarda kolayca toparlayıp kenara kaldırabileceğiniz ve hatta arabanızın bagajında her yere götürebileceğiniz kadar portatif bir ürün olma niteliği taşıyor.', 0, '8697623603033', 1907, 29.95, 2),
