(15746, 'tr-tr', 810, 1, '8690797108915', '10088062', 'Wee Baby Akıtmaz Bardak Yedek Uç 891', 'Ürün Özellikleri: <br>Özel olarak tasarlanmış emzik ucu. <br>Emzik ucunun özel şekli akıtma yapmasını engeller.<br>Sadece bebeğin emme hareketiyle akar.<br>Yuvarlak çift katlı etek sistemindeki kanallar antikolik özellik oluşturur ve akışkanlığı sağlar. <br>Akıtmaz özelliği sayesinde rahatlıkla çantada taşınabilir.', 0, '8690797108915', 1929, 10.9, 2),
(15747, 'tr-tr', 810, 1, '8690797108861', '10088315', 'Wee Baby 2 Hazneli Mama Kabı Seti 886', 'Ürün Özellikleri: <br>Seyahat sırasında saklama kabı işlevi görür. <br>Mamayı taze tutar. <br>Yarı akışkan yemekler için kullanılır. <br>Kapak kısmında kaşık yuvası ile kaşık temiz bir şekilde muhafaza edilir. <br>Kaymaz tabanı ile kolay kullanılır.', 0, '8690797108861', 1929, 39.9, 2),
(15748, 'tr-tr', 810, 1, '8690797107550', '10088316', 'Wee Baby Enjoy Akıtmaz PP Alıştırma Bardağı', 'Ürün Özellikleri: <br>6+ ay bebekler için uygundur. <br>Damlatmaz kapak sistemi sayesinde kolay içim sağlar. <br>Biberondan bardağa kolay geçiş sağlar. <br>Pratiktir, her bir parçası kolayca monte edilebilir. <br>Seyahat sırasında rahatlıkla kullanılabilir. <br>Biberondan bardağa kolay geçiş sağlar.', 0, '8690797107550', 1929, 32.9, 2),
(15749, 'tr-tr', 810, 1, '8690797101282', '10088322', 'Wee Baby İlk Hediyem Pembe set 128', 'Ürün Özellikleri: <br>Yenidoğan bebeklerin ihtiyaçları için tasarlanmıştır.<br> Kız bebek için özel damaklı emzik 1 numara, PP klasik biberon 125 ve 250 ml mevcuttur.<br> Pamuk kumaştan bebe önlüğü mevcuttur.', 0, '8690797101282', 1929, 74.9, 2),
(15750, 'tr-tr', 810, 1, '8690797108564', '11021406', 'Wee Baby Yuvarlak Uçlu Emzik No:2 856', 'Ürün Özellikleri: <br>6-18 aylık bebekler için uygundur. <br>Anne göğüs ucuna benzer. <br>Bebeğin kolay adaptasyonunu sağlar.', 0, '8690797108564', 1929, 8.9, 2),
(15751, 'tr-tr', 810, 1, '8690797107611', '11255054', 'Wee Baby Renkli Pipetli Bardak 761', 'Ürün Özellikleri: <br>6 aydan sonra kullanıma uygundur. <br>Tek elle kolayca açılır ve kapanır. <br>Özel kapak tasarımı ile akıtmaz. <br>Silikon pipete sahiptir.<br>Yumuşak pipeti bebeklerin hassas ağız yapısı için uygundur. <br>BPA içemeyen güvenilir materyalden üretilmiştir.', 0, '8690797107611', 1929, 54.9, 2),
(15752, 'tr-tr', 810, 1, '8690797101398', '11576885', 'Wee Baby Klasik Plus Geniş Ağızlı Isıya Dayanıklı Cam Biberon 120 ml', 'Ürün Özellikleri: <br> Anne göğsünü andıran özel şekilli emzik zemin içi tasarımı ile esneklik ve anne göğsü kavraması hissi sağlar, biberonla beslemeyi ve emzirmeyi birleştirir. <br>+200 ve -20 arasındaki ısı ve ısı değişikliklerine dayanıklıdır. <br>Geniş ağız kısmı sayesinde kolayca doldurulup temizlenir. <br>Akıtmayı önleyen, parmak izi tasarımlı pratik kapak mevcuttur.<br>Hem biberon hem de alıştırma bardağı olarak kullanılabilme özelliğine sahiptir.', 0, '8690797101398', 1929, 54.9, 2),
(15753, 'tr-tr', 810, 1, '8690797101404', '11576886', 'Wee Baby Klasik Plus Geniş Ağızlı Isıya Dayanıklı Cam Biberon 180 ml', 'Ürün Özellikleri: <br> Anne göğsünü andıran özel şekilli emzik zemin içi tasarımı ile esneklik ve anne göğsü kavraması hissi sağlar, biberonla beslemeyi ve emzirmeyi birleştirir. <br>+200 ve -20 arasındaki ısı ve ısı değişikliklerine dayanıklıdır. <br>Geniş ağız kısmı sayesinde kolayca doldurulup temizlenir. <br>Akıtmayı önleyen, parmak izi tasarımlı pratik kapak mevcuttur.<br>Hem biberon hem de alıştırma bardağı olarak kullanılabilme özelliğine sahiptir.', 0, '8690797101404', 1929, 56.9, 2),
(15754, 'tr-tr', 810, 1, '8690797101411', '11576887', 'Wee Baby Klasik Plus Geniş Ağızlı Isıya Dayanıklı Cam Biberon 280 ml', 'Ürün Özellikleri: <br> Anne göğsünü andıran özel şekilli emzik zemin içi tasarımı ile esneklik ve anne göğsü kavraması hissi sağlar, biberonla beslemeyi ve emzirmeyi birleştirir. <br>+200 ve -20 arasındaki ısı ve ısı değişikliklerine dayanıklıdır. <br>Geniş ağız kısmı sayesinde kolayca doldurulup temizlenir. <br>Akıtmayı önleyen, parmak izi tasarımlı pratik kapak mevcuttur.<br>Hem biberon hem de alıştırma bardağı olarak kullanılabilme özelliğine sahiptir.', 0, '8690797101411', 1929, 59.9, 2),
(15755, 'tr-tr', 810, 1, '8690797101589', '11576888', 'Wee Baby Damaklı Kelebek Emzik No:1', 'Ürün Özellikleri: <br> 0 - 6 ay için uygundur. <br>Ortodontik damaklı emzik yapısı, bebeğin doğal damak gelişimini destekler.<br>Emzik tasarımındaki gelişmiş “Hava Alan Sistem” emziğin bebeğin cildine yapışmasını engeller. <br>Emziğin derin burun kesimi, bebeğinizin daha rahat nefes alabilmesine yardımcı olur. <br>BPA içermeyen güvenli materyalden üretilmiştir.<br>Emzik ucu silikon; emzik gövdesi ve kapağı polipropilendir. <br>Renkler: Pembe, mavi, mor ve yeşildir.', 0, '8690797101589', 1929, 14.95, 2),
(15756, 'tr-tr', 810, 1, '8690797101596', '11576889', 'Wee Baby Damaklı Kelebek Emzik No:2', 'Ürün Özellikleri: <br> 6 - 18 ay için uygundur. <br>Ortodontik damaklı emzik yapısı, bebeğin doğal damak gelişimini destekler.<br>Emzik tasarımındaki gelişmiş “Hava Alan Sistem” emziğin bebeğin cildine yapışmasını engeller. <br>Emziğin derin burun kesimi, bebeğinizin daha rahat nefes alabilmesine yardımcı olur. <br>BPA içermeyen güvenli materyalden üretilmiştir.<br>Emzik ucu silikon; emzik gövdesi ve kapağı polipropilendir. <br>Renkler: Pembe, mavi, mor ve yeşildir.', 0, '8690797101596', 1929, 14.95, 2),
(15757, 'tr-tr', 810, 1, '8690797101619', '11882586', 'Wee Baby Full Silikon Emzik 161', 'Ürün Özellikleri: <br>0 - 6 ay için uygundur. <br>Silikon emzik gövdesinin yumuşak yapısı bebeğin teni ile temasında konfor sağlar. <br>Silikon emzik sapı, bebeğin emziği emdiği sırada sap sesi çıkmasını engeller. <br>Ortodontik damaklı emzik yapısı, bebeğin doğal damak gelişimini destekler. <br>Özel kelebek tasarımı, bebeğin emziği emerken burnunun açık kalmasını ve rahat hava alabilmesini sağlar. <br>Emzik tasarımındaki “Hava Alan Sistem” emziğin yapışmasını engeller. <br>BPA içermeyen güvenli materyalden üretilmiştir. <br>Renkler: Pembe ve mavidir.', 0, '8690797101619', 1929, 24.9, 2),
(15758, 'tr-tr', 810, 1, '8690797101626', '11882587', 'Wee Baby Burun Aspiratörü 162', 'Ürün Özellikleri: <br>Bebeğin burun içi salgısının pratik ve hijyenik bir şekilde temizlenmesine yardımcı olur. <br>Bebeklerin burun içi salgısının düzenli temizlenmesi onları kulak ve solunum yolu enfeksiyonlarından korunması için önemlidir. <br>Birleştirmesi ve kullanımı kolaydır.<br>Yumuşak silikon aspiratör ucu bebeğin burnunu tahriş etmez. <br>Sert kutusu ile hijyenik olarak saklanabilir ve taşınabilir. <br>Ambalajın içinde 2 adet yedek uç bulunmaktadır. <br>Uçlar tek kullanımlıktır. <br>Harici olarak yedek uçlar temin edilebilir.', 0, '8690797101626', 1929, 39.9, 2),
(15759, 'tr-tr', 810, 1, '8690797101633', '11882588', 'Wee Baby Tek Kullanımlık Burun Aspiratörü Yedek Ucu 163', 'Ürün Özellikleri: <br> Bebeğinizin burun içi salgısını pratik ve hijyenik bir şekilde temizlemenize yardımcı olur. <br>Bebeklerin burun içi salgısının düzenli temizlenmesi onları kulak ve solunum yolu enfeksiyonlarından korunması için önemlidir. <br>Birleştirmesi ve kullanımı kolaydır. <br>Yumuşak silikon aspiratör ucu bebeğinizin burnunu tahriş etmez. <br>Ambalajın içinde 10 adet yedek uç bulunmaktadır.', 0, '8690797101633', 1929, 24.9, 2),
(15760, 'tr-tr', 810, 1, '8690797101374', '11882589', 'Wee Baby Klasik Plus Geniş Ağızlı Kulplu PP Biberon 150 ml', 'Ürün Özellikleri: <br>Biberon emziğinin yumuşak ve esnek yapısı bebeklerin anne memesini kavradığı gibi biberon emziğini kavrayabilmelerini sağlar. Böylece bebekler anne memesi ve biberon arasında geçiş yapabilir.<br>Emzik tasarımındaki anti-kolik valf sistemi bebeğin beslenme sırasında dışardan hava yutmasına engel olur.<br>İnce tasarımı ile hafiftir.<br>Polipropilenden üretilmiştir. <br>Geniş ağız kısmı sayesinde kolayca doldurulup temizlenir. <br>Pratik kapak, akıtmayı önler. <br>1 numara emziğe sahiptir.<br>BPA içermez.', 0, '8690797101374', 1929, 33.9, 2),
(15761, 'tr-tr', 810, 1, '8690797101381', '11882590', 'Wee Baby Klasik Plus Geniş Ağızlı Kulplu PP Biberon 250 ml', 'Ürün Özellikleri: <br>Biberon emziğinin yumuşak ve esnek yapısı bebeklerin anne memesini kavradığı gibi biberon emziğini kavrayabilmelerini sağlar. Böylece bebekler anne memesi ve biberon arasında geçiş yapabilir.<br>Emzik tasarımındaki anti-kolik valf sistemi bebeğin beslenme sırasında dışardan hava yutmasına engel olur.<br>İnce tasarımı ile hafiftir.<br>Polipropilenden üretilmiştir. <br>Geniş ağız kısmı sayesinde kolayca doldurulup temizlenir. <br>Pratik kapak, akıtmayı önler. <br>1 numara emziğe sahiptir.<br>BPA içermez.', 0, '8690797101381', 1929, 39.9, 2),
(15762, 'tr-tr', 810, 1, '8690797101695', '11883085', 'Wee Baby Kulplu Alıştırma Bardağı 250 ml 169', 'Ürün Özellikleri: <br>Yumuşak ve eğimli emzik ucu bebeklerin ağız yapısıyla uyumludur. <br>Özel tasarım emzik ucu sayesinde damlatma ve akıtma yapmaz. <br>Emzik ucu silikondur ve esnektir. <br>Anti-kolik özelliğe sahip emziğin üstündeki hava deliği, bebeklerin beslenirken dışardan hava yutmasına engel olur. <br>Kıvrımlı kulpları bebeklerin kolay kavrayabilmesi için idealdir. <br>6+ ay bebekler için uygundur.', 0, '8690797101695', 1929, 34.5, 2),
