(15770, 'tr-tr', 810, 1, '8690797101503', '12205610', 'Wee Baby 2\'li Natural Biberon Emziği No:3', 'Ürün Özellikleri: <br>Anne göğsüne benzeyen geniş emzik yapısı sayesinde doğal beslenme hissi sağlar.<br>Geliştirilmiş anti-kolik sistem, bebeğin beslenme sırasında dışardan hava yutmasına engel olarak kolik sancısı ve rahatsızlık hissini önlemeye yardımcı olur.<br>Doğal emzik yapısı, emzik üstündeki kanallar emziğin yumuşak ve esnek kalmasını sağlar.<br>Emzirme ve biberon ile beslenmenin birleştirilmesine yardımcı olur. <br>Emziğin tamamı sağlıklı silikondan üretilmiştir. <br>Paket içerisinde 2 adet yedek emziği mevcuttur. <br>0-6 ay için uygundur.', 0, '8690797101503', 1929, 25.9, 2),
(15771, 'tr-tr', 810, 1, '8690797102852', '12205611', 'Wee Baby Göğüs Ucu Çıkarıcı', 'Ürün Özellikleri: <br>Düzleşmiş veya içe dönük göğüs uçlarını nazikçe dışarı çıkararak emzirmeye yardımcı olur. <br>Taşıma kutusu sayesinde hijyenik kullanım sunar.', 0, '8690797102852', 1929, 34.5, 2),
(15772, 'tr-tr', 810, 1, '8690797102975', '12205612', 'Wee Baby Natural Alıştırma Bardağı 250 Ml', 'Ürün Özellikleri: <br> Natural Alıştırma Bardağı Natural Seri’nin tamamlayıcı bir ürünüdür. <br>Natural Biberon kullanan bebeklerin kavramaya alıştıkları şişe ile kolayca alıştırma bardağı kullanmaya devam etmelerine yardımcı olur. <br>Bardak ucunun eğimli tasarımı ve yumuşak silikon yapısı bebeğin ağız içi anatomisi ile uyumludur. <br>Bardak ucundaki özel kesim sayesinde damlatma ve akıtma yapmaz. <br>Sıvı yalnızca bardak ucuna basınç uygulandığında gelir.<br> Ergonomik ve hafif şişe tasarımı bebeklerin kendi kendilerine kolay beslenebilmelerini destekler.', 0, '8690797102975', 1929, 43.9, 2),
(15773, 'tr-tr', 810, 1, '8690797109158', '12205614', 'Wee Baby Doğal Selülozik Banyo Süngeri', 'Ürün Özellikleri: <br> Doğal selülözden üretilmiştir. <br> Doğal selülozden üretildiği için su emme kapasitesi yüksektir.<br>Kolaylıkla durulanır ve kolayca sıkılır.<br>Hızlıca kurur.<br>Hızlıca kuruduğu için hijyeniktir. <br>Uzun süre kullanılmadığında sertleşebilir, ıslatıldığında yumuşak formuna geri döner. <br><br>Genel Bilgiler: <br>İlk Kullanımdan önce ılık sabunlu suda temizlenmeli ve durulanmalıdır. <br>Her kullanım sonrası bu işlem tekrarlanmalıdır. <br>Yıpranmaya neden olabileceğinden doğrudan güneş ışığı ve ısıya maruz bırakılmamalıdır<br>Çamaşır makinesinde temizlenmeye uygun değildir.<br>Hijyen açısından tamamen kurumasına özen gösterilmelidir. <br>Hijyenik olması için kişiye özel kullanılmasına özen gösterilmelidir. <br>Sünger oyuncak değildir, parçaların yutulması boğulma riskine neden olabilir.', 0, '8690797109158', 1929, 19.9, 2),
