(15832, 'tr-tr', 155, 1, '8058664110636', '12216964', 'Chicco Ohlala 2 Ultra Hafif Bebek Arabası Black Night', 'Ürün Özellikleri:<br><br>• ULTRA HAFİF: Ohlalà2 sadece 3.8 kg’dır.<br>• ULTRA KOMPAKT: Ohlalà2 tek el ile kolayca katlanabilir ve açılabilir. Katlanabilir itme kolu sayesinde şimdi daha da kompakt.<br>• SÜRÜŞ KOLAYLIĞI: Tek elle kavranabilir tutma kolu sayesinde sürüş sırasında daha kolay manevra yapabilirsiniz.<br>• KONFORLU: Ohlalà2 fermuarlı, genişletilebilir tentesi, farklı poziyonlara ayarlanabilir ve tamamen yatırılabilir koltuğu ve bunlara ek olarak ayarlanabilir ayaklığı sayesinde tüm koşullar için idealdir.<br>• TAŞIMASI KOLAY: Ohlalà 2 pratik tutma kolu sayesinde kolaylıkla taşınır.<br>• YIKANABİLİR: Çıkarılabilir ve yıkanabilir kılıf.<br>• DOĞUMDAN İTİBAREN KULLANIM: Ohlalà 2 doğumdan itibaren kullanılabilinir.<br><br>• Ürün Ağırlığı: 3,8 kg<br>• Ürün Ölçüleri:<br><br>Açık Ölçüler: 46 x 81 x 101 cm<br>Kapalı Ölçüler: 30 x 46 x 72 cm', 0, '8058664110636', 1929, 1399, 2),
(15833, 'tr-tr', 155, 1, '8058664110650', '12216965', 'Chicco Ohlala 2 Ultra Hafif Bebek Arabası Paprika', 'Ürün Özellikleri:<br><br>• ULTRA HAFİF: Ohlalà2 sadece 3.8 kg’dır.<br>• ULTRA KOMPAKT: Ohlalà2 tek el ile kolayca katlanabilir ve açılabilir. Katlanabilir itme kolu sayesinde şimdi daha da kompakt.<br>• SÜRÜŞ KOLAYLIĞI: Tek elle kavranabilir tutma kolu sayesinde sürüş sırasında daha kolay manevra yapabilirsiniz.<br>• KONFORLU: Ohlalà2 fermuarlı, genişletilebilir tentesi, farklı poziyonlara ayarlanabilir ve tamamen yatırılabilir koltuğu ve bunlara ek olarak ayarlanabilir ayaklığı sayesinde tüm koşullar için idealdir.<br>• TAŞIMASI KOLAY: Ohlalà 2 pratik tutma kolu sayesinde kolaylıkla taşınır.<br>• YIKANABİLİR: Çıkarılabilir ve yıkanabilir kılıf.<br>• DOĞUMDAN İTİBAREN KULLANIM: Ohlalà 2 doğumdan itibaren kullanılabilinir.<br><br>• Ürün Ağırlığı: 3,8 kg<br>• Ürün Ölçüleri:<br><br>Açık Ölçüler: 46 x 81 x 101 cm<br>Kapalı Ölçüler: 30 x 46 x 72 cm', 0, '8058664110650', 1929, 1399, 2),
(15834, 'tr-tr', 810, 1, '8699872931318', '11255052', 'Wee Baby Temassız Ateş Ölçer 131', 'Ürün Özellikleri: <br>3 cm - 5 cm uzaklıktan vücut sıcaklığı ölçülebilir. <br>Vücut, oda ve yüzey sıcaklığı ölçülebilir. <br>Mama veya banyo suyu sıcaklığı “yüzey sıcaklığı ölçüm modunda” özelliği ile hızlıca ölçülebilir. <br>Enerji Tespit Sistemi sayesinde güvenilir ve değişken olmayan ölçüm yapılmaktadır. <br>Sıcaklığın 38 C’den fazla olduğu zamanlarda sesli ve renklenen ekran ile uyarı sinyali vermektedir. <br>Son 32 sıcaklık ölçümünü hafızada tutabilir. <br>Aydınlatmalı LCD ekran ile takip edilmesi gereken durumlarda ekran turuncu; yüksek ateşte de ekran kırmızı renk ile uyarı verir. <br>Ateş birimi hem Celcius hem de Fahrenheit cinsinden görüntülenebilir. <br>Enerjiyi korumak için otomatik kapanma (≤ 30 sn.) sistemine sahiptir. <br>Uzun ömürlü kullanım (40.000 okumaya kadar) imkânı sunar. <br>Kolay taşıma ve hijyenik saklama için özel sert kabı ve koruma kılıfı bulunmaktadır. <br>Ergonomik tutuşa sahiptir. <br>Sesi isteğe göre açılıp kapatılabilir. <br>Hastane ve evde kullanımına uygundur. <br>2 adet AA pil ile çalışır.', 0, '8699872931318', 1929, 399, 2),
(15835, 'tr-tr', 810, 1, '8710103872948', '12024581', 'Philips Avent Ultra Air Tekli Emzik Mavi 0-6 Ay SCF444/10', 'Ürün Özellikleri:<br><br> Ultra air emzik, bebeklerin hassas cildinin nefes alması için maksimum hava akışı sağlayacak şekilde tasarlanmıştır.<br>Ortodontik ve BPA içermez.<br>Ultra air emziğin hafif kalkanı, bebeklerin rahat etmesi için yuvarlak köşelere sahiptir.<br>Emziğin ipeksi ve dokulu silikon malzemesi bebekleri sakinleştirir ve rahatlatır.<br>Taşıma kabıyla bebeğinizin emziğini mikrodalgada sterilize edebilir ve seyahat ederken hijyenik şekilde saklayabilirsiniz.', 0, '8710103872948', 1929, 34.9, 2),
