(15839, 'tr-tr', 810, 1, '5010993627813', '12043837', 'Monopoly Fortnite E6603', 'Ürün Özellikleri:<br><br>Monopoly oyunun bu heyecan verici Fortnite versiyonunda, hayatta kalıp oyunu kazanmak için konumları ele geçir, rakiplerinle savaş ve fırtınadan kaç!<br><br>Popüler video oyunundan ilham alınarak tasarlanan Monopoly Fortnite\'da video oyunundaki konumlar ve hazine sandığı nesneleri de yer alıyor. Monopoly parası yerine oyuncular sağlık puanı kazanıyor.<br><br>Oyuna başlamadan önce karakterini seçmek için 27 tarzdan birine karar ver. Rakiplerinle savaşmak için hazine sandığı nesnelerini ve aksiyon zarını kullan!<br><br>Aksiyon zarı sağlık puanı toplamanı, duvarlar inşa etmeni ve rakiplerine zarar vermeni sağlar.<br><br>Hazine Sandığı kartları ise sana bu aksiyonları daha da güçlü kılacak destansı nesneler verir!<br><br>Başlangıç noktasından geçtiğinde fırtınayı başlatırsın! Fırtınadan kaç, yoksa sağlık puanı kaybedersin! Fortnite video oyununda olduğu gibi ayakta kalan son oyuncu oyunu kazanır! <br><br>Kutu içerisinde oyun alanı, plastik standlarıyla birlikte 27 karakter kartı, 15 fırtına kartı, 16 konum kartı, 16 hazine sandığı kartı, 8 duvar kartı, 1 numaralı zar, 1 aksiyon zarı ve çıkartmaları, 110 sağlık puanı pulu ve oyun kılavuzu bulunmaktadır.<br><br>13 yaş ve üzeri çocukların kullanıma uygundur.<br><br>Oyuncu Sayısı: 2 - 7<br><br>Kutu Ölçüsü: 4 x 40 x 27 cm', 0, '5010993627813', 1929, 129, 2),
(15840, 'tr-tr', 472, 1, '9786058084841', '12119343', 'Hiçbir Şey Rayında Gitmiyorsa Raydan Çık Stewart Dawson Jr', 'Kitabın Özeti: Bir şeyler yapmak istiyor ama o şeyleri bir türlü yapamıyorsan, bütün çabalarına rağmen elde etmek istediklerini hiçbir şekilde elde edemiyorsan, mutlu olmak istiyor fakat bir türlü mutlu olamıyorsan, iki lafı bir araya getiremeyenlerin zengin olduğunu görüyor ancak sen bütün yeteneklerine rağmen borç içinde kıvranıyorsan, doğru aşkı arıyor lakin onu da bulamıyorsan; her şeyin en iyisini hak ettiğin hâlde bir türlü olmuyorsa sen muhtemelen yanlış raylarda yolculuk yapıyorsun demektir. Evet, “raydan çıkmak” kulağa tehlikeli hatta ürkütücü geliyor, bunun farkındayım elbette ancak hayatı boyunca gittiği raydan hiç çıkmadan yaşayanların hiçbirinin adını hatırlamıyoruz. Öyleyse raydan çıkmak, tehlikeli olsa da büyülü bir karardır, büyüten bir karar… Şimdi unut başına gelenleri, sil yaşadığın bütün kötü deneyimleri ve hiç üzülme, dert etme; bir karar ver sadece. Göreceksin ki bir anda etrafındaki duvarlar, kollarındaki zincirler ve tabii ki altındaki raylar yok olacak ve sen şaşırtıcı bir şekilde istediğin her şeye ulaşacaksın. Sözün özü, hayat bize tek seferlik bir bilet vermiş olsa da raylar sonsuzdur ve insanlar hep raydan çıkanları konuşur. Raysız ve ayarsız bir ömür diliyorum. <br>Stewart Dawson Jr.', 0, '9786058084841', 1929, 22, 2),
(15841, 'tr-tr', 510, 1, '9786052182482', '11900071', 'Misafir-sin I: İşaret 5 Deniz Erten', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 615<br>En / Boy: 13,50 / 21,00 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ocak 2020', 0, '9786052182482', 1929, 42, 2),
(15842, 'tr-tr', 810, 1, '9786058307131', '12122072', 'Rüzgara Karşı Juliana Buhring', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Orijinal Dil: Yunanca<br>Basım Yeri: Türkiye<br>Sayfa Sayısı: 232<br>En / Boy: 13,50 / 21,00 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Haziran 2019<br><br>Kitabın Özeti: Dünyanın çevresini bisikletle en kısa sürede dolaşan ilk kadının sıra dışı hikayesi… Rüzgara Karşı, bisiklete ilk kez 30 yaşındayken binmesine karşın sekiz aylık antrenman ile 2012 yılında Guinness Rekorlar Kitabı’na giren Juliana Buhring’in ilham verici hikayesini anlatıyor. İtalya’dan batıya doğru giderek ilerleyen yolculukta Julian’nın geçmişindeki zorlukları da onunla birlikte yaşayıp üstesinden nasıl geldiğini ve hayata tutunmayı nasıl başardığını okuyacaksınız. Sadece bisiklet meraklılarının değil, kadın hikayelerini okumayı seven okurların da bir solukta okuyacağı, adeta Juliana Buhring ile birlikte dünya çevresinde bisiklet sürüyormuş gibi hissedeceği, canlı ve gerçek anlatıma sahip bir kitap. Ülkemizden de geçen bu hikayeyi okuduktan sonra günlük hayatımızdaki problemlere artık farklı bir gözle bakacaksınız.', 0, '9786058307131', 1929, 32, 2),
(15843, 'tr-tr', 810, 1, '8680679180207', '10095171', 'Ay Yıldız Baskılı Balon 6\'lı', '', 0, '8680679180207', 1929, 7.95, 2),
(15844, 'tr-tr', 810, 1, '9786050969726', '12132180', 'Sağlığın Doğru Şifreleri Sedef Bingül', 'Kitabın Özellikleri:<br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 280<br>En / Boy: 14,00 / 21,00 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ocak 2020<br><br>Kitabın Özeti: Siz deneme tahtası değilsiniz! <br>Evet, biliyorum. Her gün yeni bir bilgiyle uyanıyorsunuz. Değişimlerin neredeyse ışık hızında yaşandığı, herkesin farklı bir şey söylediği günümüzde neyin doğru neyin yanlış olduğunu çözmeye çalışıyorsunuz. Evet, anlıyorum. Görselliğin altın çağında geride kalmak istemiyorsunuz. Yeni buluşların, işlemlerin nimetlerinden siz de yararlanıp görünüşünüzle ilgili o kırıcı eleştirilerden kurtulmayı, övgüleri duymayı arzuluyorsunuz. Evet, hak veriyorum. Şimdiye kadar adını bile duymadığınız ancak sağlığınızı düzeltecek, sizi gençleştirecek, zayıflatacak mucize gıdalar, çaylar, haplar sadece bir adım belki de bir “tık” önünüzde, hazır bekliyor. Siz de insansınız. Elbette sağlıklı, genç ve güzel kalmak isteyeceksiniz. <br><br>Ancak hedefleriniz uğruna, herkes kullanıyor diye, herkes yaptırıyor diye sizi robotlaştırmalarına izin vermeyin. Bu kitapta hastalıklara yol açabilen nedenleri, risk faktörlerini, doğru bildiğiniz yanlışları, bilimsel olarak kanıtlanmamış ancak ticari nedenlerle popüler olan akımlar ve ürünler konusunda uyarıları okuyacak, sağlıklı beden-zihin ilişkisi için doğru şifreleri öğreneceksiniz. Yaşamınızı doğru zamanlama ile planlayıp, bedenin kendini iyileştirme gücünden yararlanarak hastalıkları önlemenin, sağlıklı ve genç kalmanın, ruhsal olarak dingin, zihinsel olarak aktif olmanın yollarını keşfedeceksiniz.', 0, '9786050969726', 1929, 28, 2),
