(16018, 'tr-tr', 810, 1, '9786050957563', '11787379', 'İçimizdeki Şeytan Sabahattin Ali', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 288<br>En / Boy: 13,50 / 21,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Mart 2019<br><br>Kitabın Özeti: “…İçimdeki bu melun şeytan... Her şeyi imkânsızlığı nispetinde bana cazip gösteren, beni olmayacak şeylerin hasretiyle kavuran bu korkunç his...” <br>Sabahattin Ali, bir genç erkek ile eşinin yaşadıkları üzerinden “aydın” çevreyi, ilişkileri ve toplumsal düzene teslim olmuş bireyin çıkmazlarını ele alıyor. İçimizdeki Şeytan aydına, bireyin “içindeki şeytan” olarak nitelendirdiği âcizliğine ayna tutuyor…', 0, '9786050957563', 1929, 9, 2),
(16019, 'tr-tr', 810, 1, '9786050957549', '11787381', 'Sırça Köşk Sabahattin Ali', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 164<br>En / Boy: 13,50 / 19,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Nisan 2019<br><br>Kitabın Özeti: “Gözümde tüten ne şehirler, ne insanlar, ne de kırlar ve ormanlardı. Açık denizleri, etrafında duvar olmayan, uçsuz bucaksız yerleri arıyordum. Ama ruhumuz böyle gökyüzlerinde uçup dururken birdenbire yere inip insan küçüklüğü ile karşılaşmak ne tuhaf oluyor.” <br>İlk kez 1947’de yayımlanan ve kısa süre sonra toplatılan Sırça Köşk, Sabahattin Ali’nin düzeni ve iktidar sahiplerini eleştiren öykü ile masallarını bir araya getirir. Sabahattin Ali’nin öyküleri bugün hâlâ aynı derecede sarsıcı ve anlamlı…', 0, '9786050957549', 1929, 7.5, 2),
(16020, 'tr-tr', 791, 1, '9789750807411', '10066831', 'Ağrı Dağı Efsanesi Yaşar Kemal', 'Kitabın Özellikleri:<br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 120<br>En / Boy: 13,50 / 21,00 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Şubat 2020<br><br>Kitabın Özeti: Bir aşk destanı olan Ağrıdağı Efsanesi geleneklerini Mahmut Han\'a karşı savunan Ahmet ile Gülbahar arasındaki aşkı konu alır. Efsanelere ve halk söylencelerine yürekten bağlı Yaşar Kemal\'in bu romanı, insan psikolojisinin derinliklerini de içerir.', 0, '9789750807411', 1929, 15, 2),
(16021, 'tr-tr', 791, 1, '9789750806605', '10672749', 'Değirmenler Sabahattin Ali', 'Kitabın Özellikleri: <br> Basım Dili: Türkçe<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 137<br>En / Boy: 13,50 / 21,00 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Ocak 2020<br><br>Kitabın Özeti: \"İşte adaşım, sana seven bir Çingene\'nin hikayesi. Çiçeklerin açtığı bir mevsimde, senin kollarına yaslanan ve çiçekler kadar güzel kokan bir vücutla uzak su kenarlarında oturmak ve öpüşmek, yoruluncaya kadar öpüşmek hoş şeydir... (...) Fakat sevgili bir vücutta bulunmayan bir şeyi kendisinde taşımaya tahammül etmeyerek onu koparıp atabilmek, işte adaşım, yalnız bu sevmektir.\" <br><br>Değirmen\'den<br><br>Türk edebiyatının \"özgür\" sesi Sabahattin Ali\'den yıllara meydan okuyan öyküler...', 0, '9789750806605', 1929, 8, 2),
(16022, 'tr-tr', 791, 1, '9789750807190', '10672760', 'Teneke Yaşar Kemal', '', 0, '9789750807190', 1929, 20, 2);
