(16025, 'tr-tr', 394, 1, '9789944885454', '11181039', 'Babalar ve Oğullar - Hasan Ali Yücel Klasikleri - Ivan Sergeyeviç Turgenyev', 'Kitabın Özellikleri:<br> Basım Dili: Türkçe<br>Orijinal Dil: Rusça<br>Basım Yeri: Türkiye - İstanbul<br>Sayfa Sayısı: 259<br>En / Boy: 12,50 / 20,50 cm<br>Kağıt Cinsi: 2. Hamur<br>Basım Tarihi: Şubat 2020 <br><br>Kitabın Özeti: Ivan Sergeyeviç Turgenyev (1818-1883): Yapıtlarıyla 19. yüzyılın Rus klasikleri arasında Avrupa\'da ve ülkemizde tanınan yazarlardan biri olmuştur. İlk Aşk ve İlkbahar Selleri\'nden Duman ve Ham Toprak\'a pek çok nitelikli öykü ve roman yazmış olmasına karşın, Turgenyev adı günümüzde de, 1862\'de yayımlanan ve nihilizmin simgesine dönüşen oğul Bazarov tipini yarattığı Babalar ve Oğullar romanıyla özdeşleşmiş gibidir. Ergin Altay (1937): Yusuf Ziya Ortaç\'ın Akbaba dergisinde yayımlanan ilk öykü çevirisinden (Zoşçenko) günümüze, son elli yılın en önemli Rusça çevirmenlerindendir. Dostoyevski ve Tolstoy kadar, Gogol, Gonçarov ve Çehov da Altay\'ın yetkinlikle dilimize kazandırdığı yazarlar arasındadır.', 0, '9789944885454', 1929, 14, 2),
