(16067, 'tr-tr', 810, 1, '5010993388967', '11403351', 'Monopoly Gamer C1815', 'Ürün Özellikleri:<br><br>Monopoly ve sevilen Nintendo video oyunu güçlerini birleştirdi ve ortaya Monopoly Gamer çıktı! Monopoly piyonları yerine Super Mario karakterlerinin piyonlarıyla oyun alanında dolaşın, kahramanların güçlerini kullanın.<br><br>Monopoly Gamer’da önemli olan daha çok paraya sahip olmak değil, puan toplamak. Bunun için de altın toplayın, arsalar satın alın ve efsanevi Bölüm Sonu Canavarlarını yenin.<br><br>En yüksek puanı toplayın, oyunu kazanın! <br><br>Oyundaki piyonlar ise Super Mario oyununun öne çıkan karakterlerinden Mario, Prenses Peach, Yoshi ve Donkey Kong.<br><br>Kutu içerisinde 4 adet oyun piyonu, biri numaralı biri güç zarı olmak üzere 2 adet zar, oyun tahtası, 90 adet altın ve çeşitli oyun kartları (4 karakter kartı, 4 hatırlatma kartı, 8 Bölüm sonu canavarı kartı, 16 tapu senedi kartı) yer almaktadır.<br><br>Oyuncu sayısı: 2 - 4<br><br>Kutu Ölçüsü: 40 x 4 x 27 cm', 0, '5010993388967', 1929, 129, 2),
