(16077, 'tr-tr', 228, 1, '5000394203921', '11368737', 'DURACELL Lityum 3 Volt 2\'li Pil', 'Uzun ömürlü Duracell Pil Düğme 2 Li Lm Dp20322, tıbbi, güvenlik ve diğer elektronik cihazlarda kullanılabilir özelliğe sahiptir. Duralock teknolojisine sahip olması, depolama sırasında pilleri 10 yıla kadar dolu tutmayı mümkün kılar. Bu sayede kısa sürede enerjinin bitmesi ve sürekli değiştirmek zorunda kalınan bir durumla da karşılaşılmaz. Acil ya da seri bir şekilde kullanılması gereken cihazlarda pil değiştirme kaygısı da olmaz. <br><br>Çevreye Duyarlı Üretim<br>Duracell pil düğmelerinin lityum özellikte olması çocukların pil yutma tehlikesinin önüne geçmeyi amaçlar. 2\'li paket halinde satışa sunulan ürünün kabı çocukların oynamasıyla açılmaz, sadece makas yardımıyla paketinden çıkarılabilir. Çevreyi koruyan marka; %100 toksik olmayan mürekkepler, %40 geri dönüştürülmüş çelik, %30 geri dönüştürülmüş plastik ve %55 geri dönüştürülmüş malzeme ile dikkat çeker. Kaliteli üretime sahip piller, kullanılan cihaz ile uyumludur. Cihazın özelliklerini korur ve daha uzun ömürlü olmasını sağlar. <br><br>Teknik Özellikler: <br>Lityum Düğme - Duralock Teknolojisi - 3V Pil - Tek Kullanımlık - Geri dönüşüm desteği', 0, '5000394203921', 1929, 19.5, 2),
